INSERT INTO public."AboutTranslations" VALUES (1, '<p><strong>Azrbaycan Respublikasnn Mrkzi Bank</strong></p><p>&nbsp;</p><p>Azrbaycan Respublikasnn Milli Bank Azrbaycan Respublikas Milli Banknn yaradlmas haqqnda Azrbaycan Respublikas Prezidentinin 1992-ci il 11 fevral tarixli Frman il yaradlmdr.</p><p>Azrbaycan Respublikasnn Konstitusiyasna lavlr v dyiikliklr edilmsi haqqnda 18 mart 2009cu il tarixli Azrbaycan Respublikasnn Referendum Aktnn qvvy minmsi il laqdar olaraq Azrbaycan Respublikas Milli Bank Azrbaycan Respublikasnn Mrkzi Bank adlandrlmdr.</p><p>Azrbaycan Respublikas&nbsp;Mrkzi Banknn statusu, onun&nbsp;mqsd, funksiya v slahiyytlri, habel idaretm v tkilati strukturu, dvltin mrkzi bank kimi dvlt hakimiyyti orqanlar il v digr xslrl mnasibtlri Azrbaycan Respublikasnn Mrkzi Bank haqqnda Azrbaycan Respublikasnn 10 dekabr 2004-c il tarixli Qanunu (Qanun) il tnzimlnir. Mrkzi Bankn mstsna olaraq lknin milli valyutasnn emissiya funksiyas Azrbaycan Respublikasnn Konstitusiyas il tsbit olunur. Mrkzi Bank&nbsp;z&nbsp;faliyytind hminin Azrbaycan Respublikasnn digr qanunvericilik&nbsp;aktlarn v Azrbaycan Respublikasnn trfdar xd beynlxalq mqavillri rhbr tutur.</p><p>&nbsp;</p><p><strong>Mrkzi Bankn mqsdlri</strong>&nbsp;<br>&nbsp;</p><p>Mrkzi Bankn faliyytinin sas mqsdi&nbsp;Qanunla myyn edilmi&nbsp;slahiyytlri daxilind&nbsp;qiymtlrin sabitliyinin tmin edilmsidir.</p><p>sas mqsdin xll gtirmdn Mrkzi Bank maliyy bazarlarn tnzimlyn qanunlarla myyn edilmi slahiyytlr daxilind maliyy sabitliyini tmin edir.&nbsp;</p><p>Mnft gtrmk&nbsp;Mrkzi Bankn sas mqsdi deyildir.</p><p>&nbsp;</p><p><strong>Mrkzi Bankn funksiyalar</strong>&nbsp;<br>&nbsp;</p><p>Mrkzi Bank z mqsdlrin nail olmaq n Qanunun 5-ci maddsind myyn edilmi funksiyalar hyata keirir. Mrkzi Bankn funksiyalar aadaklardr:</p><p>&nbsp;</p><p><strong>Pul v mznn siyastinin myyn edilmsi v hyata keirilmsi</strong><br>&nbsp;</p><p><i>Mrkzi Bankn sas funksiyas dvltin pul v onun trkib hisssi olan mznn siyastinin myyn edilmsi v hyata keirilmsidir.</i></p><p>&nbsp;</p><p><strong>Nad pul dvriyysinin tkil edilmsi, Azrbaycan Respublikas Konstitusiyasnn 19-cu maddsinin II hisssin v bu Qanuna mvafiq olaraq pul nianlarnn tdavl buraxlmasnn v tdavldn xarlmasnn hyata keirilmsi</strong><br>&nbsp;</p><p><i>Mrkzi Bankn mhm funksiyalarndan biri d Azrbaycan Respublikasnn milli valyutasnn (manatn) emissiya edilmsidir. Azrbaycan Respublikas Konstitusiyasnn 19-cu maddsin sasn Mrkzi Bank bu hququn mstsna sahibidir. Bu slahiyyt rivsind Mrkzi Bank manatda olan kaz v metal pul nianlarn tdavl buraxr v tdavldn xarr, hminin onlarn dvriyysinin tkili zr tdbirlr grr.</i></p><p>&nbsp;</p><p><strong>Manatn xarici valyutalara nisbtd rsmi mznnsinin mtmadi myyn edilmsi v elan edilmsi</strong><br>&nbsp;</p><p><i>Mrkzi Bank manatn xarici valyutalara nisbtd rsmi mznnsini myyn edir v elan edir.</i></p><p>&nbsp;</p><p><strong>Valyuta tnzimi haqqnda Azrbaycan Respublikasnn Qanununa uyun olaraq valyuta tnziminin v nzartinin hyata keirilmsi</strong><br>&nbsp;</p><p><i>Valyuta tnzimi v nzarti  mznn siyastinin hyata keirilmsini dstklyn, beynlxalq hesablamalarn aparlmas, xarici valyuta il dvriyynin tnzimlnmsi, o cmldn qdlrin hyata keirilmsi, valyutadan istifadnin mhdudladrlmas v valyutann hrkti zr dvlt nzartinin aparlmas il bal kompleks tdbirlrdn ibart faliyytdir.</i></p><p>&nbsp;</p><p><strong>Srncamnda olan beynlxalq qzl-valyuta ehtiyatlarnn saxlanmas v idar edilmsi</strong><br>&nbsp;</p><p><i>Mrkzi Bank srncamnda olan beynlxalq qzl-valyuta ehtiyatlarn saxlayr v idar edir.</i></p><p>&nbsp;</p><p><strong>Beynlxalq standart v metodologiyalara uyun olaraq monetar, maliyy bazarlar v dni sistemlri zr statistikann, lknin tdiy balansnn, beynlxalq investisiya balansnn v icmal (dvlt v qeyri-dvlt) xarici borc statistikasnn trtib edilmsi, mlumatlarn mumildirilmsi v yaylmasnn tmin edilmsi, habel lknin tdiy balansnn proqnozladrlmasnda itirak edilmsi</strong><br>&nbsp;</p><p><i>Mrkzi Bankn funksiyalarndan biri qanunvericiliy uyun olaraq hesabat tdiy balansnn trtib edilmsi v&nbsp;lknin proqnoz tdiy balansnn hazrlanmasnda itirak edilmsidir. Mrkzi Bank lknin icmal (dvlt v qeyri-dvlt) xarici borc statistikasn v beynlxalq investisiya balansn trtib edir, mlumatlarn mumildirilmsini v yaylmasn tmin edir.&nbsp;</i></p><p>&nbsp;</p><p><strong>dni sistemlrinin sabit, thlksiz v effektiv faliyytinin tmin edilmsi, inkiafna dstk verilmsi</strong><br>&nbsp;</p><p><i>Mrkzi Bank lk razisind faliyyt gstrn banklar, xarici banklarn yerli filiallar v pot rabitsinin milli operatoru arasnda milli valyutada hesablamalarn hmin tkilatlarn Mrkzi Bankda adqlar mxbir hesablar vasitsil hyata keirilmsini tkil edir. Mrkzi Bank dni xidmtlri tchizatlar trfindn dni mliyyatlarnn aparlmas v onlar arasnda hesablamalarn hyata keirilmsi qaydalarn, hminin dni altlrin dair tlblri myyn edir.</i></p><p>&nbsp;</p><p><strong>Maliyy bazarlarnn faliyytinin sabitliyi v dayanqlnn tmin edilmsi, maliyy bazarlarnda tnzimlm v nzartin, o cmldn makroprudensial tnzimlm v nzartin hyata keirilmsi</strong><br>&nbsp;</p><p><i>Mrkzi Bank maliyy bazarlarnn faliyytinin sabitliyi v dayanqln tmin etmk mqsdil banklar, bank olmayan kredit tkilatlar, sorta bazarnn pekar itiraklar, investisiya irktlri v qiymtli kazlar bazarnda digr lisenziyaladrlan xslr, investisiya fondlar, investisiya fondunun idarilri, klirinq (prosessinq) faliyytini hyata keirn xslr, kredit brolar v maliyy bazarlarn tnzimlyn qanunlarla Mrkzi Bankn nzart etdiyi subyektlr kimi myyn ediln digr xslrin (nzart subyektlrinin) faliyytinin lisenziyaladrlmasn, tnzimlnmsini v faliyytlri zrind nzarti hyata keirir.</i></p><p><strong>&nbsp;</strong></p><p><strong>Maliyy bazarlarnda istehlaklarn v investorlarn hquqlarnn qorunmas n tdbirlrin grlmsi v maliyy bazarlar sahsind maariflndirm ilrinin aparlmas</strong><br>&nbsp;</p><p><i>Mrkzi Bank nzart subyektlrinin faliyytinin tnzimlnmsi v faliyytin nzartl bal istehlaklarn v investorlarn hquqlarnn qorunmas mqsdil Mrkzi Bank trfindn myyn edilmi qaydaya uyun olaraq maliyy xidmtlrinin (mhsullarnn) test mqsdli aln hyata keirir, maliyy bazarlarnda istehlaklarn v investorlarn qanuni maraqlarnn pozulmas v ya pozulmasna rait yaradan hallarn aradan qaldrlmas bard nzart subyektlrin icras mcburi olan gstrilr verir.</i></p><p><strong>&nbsp;</strong></p><p><strong>mantlrin sortalanmas sahsind nzart sisteminin faliyytinin tmin edilmsi</strong><br>&nbsp;</p><p><i>Mrkzi Bank mantlrin sortalanmas sahsind nzart sisteminin faliyytinin tmin edilmsi istiqamtind ilri hyata keirir.</i></p><p>&nbsp;</p><p>Mrkzi Bankn hyata keirdiyi funksiyalar btvlkd lknin makroiqtisadi sabitliyin dstk gstrilmsin xidmt edir.</p><p><strong>&nbsp;</strong></p><p>Maliyy xidmtlri bazarnda tnzimlm v nzart sisteminin idaredilmsinin tkmilldirilmsi haqqnda Azrbaycan Respublikas Prezidentinin 28 noyabr 2019-cu il tarixli Srncam il Azrbaycan Respublikasnn qanunlarnda maliyy bazarlarna nzart orqannn myyn edilmi slahiyytlri, o cmldn onun maliyy xidmtlri bazarnda lisenziyaladrma, tnzimlm v nzart, investorlarn v maliyy xidmtlri istehlaklarnn hquqlarnn qorunmas sahsind vzif v hquqlar Azrbaycan Respublikasnn Mrkzi Bankna verilmidir.</p><p>&nbsp;</p><p><strong>Mrkzi Bankn dvlt orqanlar il mnasibtlri&nbsp;</strong>&nbsp;<br>&nbsp;</p><p>Azrbaycan Respublikasnn Konstitusiyas v qanunlar il myyn edilmi funksiya v slahiyytlrini hyata keirrkn&nbsp;Mrkzi Bank&nbsp;mstqildir v&nbsp;bu zaman hr hans dvlt hakimiyyti v yerli znidaretm orqanlar, fiziki v&nbsp;hquqi xslr onun faliyytin hr hans bir sbbdn bilavasit,&nbsp;yaxud dolay yolla mhdudiyyt qoya bilmz, Qanunda nzrd tutulmu hallar istisna olmaqla, faliyyti zrind monitorinq hyata keir, qanuna zidd tsir v mdaxil&nbsp;ed bilmz. Lakin Mrkzi Bank qanunla myyn edilmi mstqillik statusuna malik olsa da, z faliyytini digr iqtisadi dvlt orqanlar v qurumlar il qarlql surtd laqlndirir. Eyni zamanda Mrkzi Bank dvltin iqtisadi siyastinin mxtlif istiqamtlri zr msllrin mzakirsind itirak edir, mvafiq tkliflr verir. Mrkzi Bank dvltin bank olaraq dvlt xzindarlq hesablarna xidmt gstrir, hmin hesablar zr mdaxil-mxaric mliyyatlarn aparr. Mrkzi Bank dvlt bdcsind qsamddtli vsait atmazl yarandqda dvlt qanunla myyn edilmi limitlr rivsind kredit ver bilr.</p><p>&nbsp;</p><p><strong>Mrkzi Bankn hesabatll</strong><br>&nbsp;</p><p>Mrkzi Bank faliyytinin ffafln artrmaq v ictimai etimad gclndirmk n ictimaiyyti z mqsd v funksiyalarnn hyata keirmsi il bal daim mlumatlandrr. Mrkzi Bankn sdri lk iqtisadiyyatna, o cmldn maliyy sektorunun inkiaf zr grln ilr dair lk Prezidentin hesabat verir. Hminin dvlt bdcsi layihsinin mzakirsi zaman Bankn sdri qardak il n pul siyastinin sas istiqamtlri bard Azrbaycan Respublikasnn Milli Mclisin mlumat verir. Mrkzi Bankn illik faliyyti Azrbaycan Respublikasnn Prezidenti trfindn tyin edilmi auditor trfindn yoxlanlr v maliyy hesabat Prezident tqdim edilir. Mrkzi Bankn illik hesabat ictimaiyyt d aqlanr. Bel ki, illik hesabat, o cmldn audit yoxlamasndan kemi maliyy hesabat hr il ktlvi informasiya vasitlrind (Mrkzi Bankn internet saytnda) drc edilir.</p>', 1, 1, '2025-09-14 18:23:04.881235', '2025-09-14 18:23:04.881235', NULL);
INSERT INTO public."AboutTranslations" VALUES (2, '<p><strong>The Central Bank of the Republic of Azerbaijan&nbsp;</strong></p><p>&nbsp;</p><p>The National Bank of the Republic of Azerbaijan was established by Decree of President of the Republic of Azerbaijan ''on Establishment of the National Bank of the Republic of Azerbaijan'' dated 11 February 1992.</p><p>The National Bank of the Republic of Azerbaijan was renamed as ''The Central Bank of the Republic of Azerbaijan'' due to entry into force of the Referendum Act of the Republic of Azerbaijan dated 18 March 2009 on ''Making additions and amendments to the Constitution of the Republic of Azerbaijan''.</p><p>The status, goals, functions and authorities, as well as management and organizational structure of the Central Bank of the Republic of Azerbaijan, relations with public authorities and other persons as the central bank of the state are determined by the Law of the Republic of Azerbaijan ''on the Central Bank of the Republic of Azerbaijan'' (the Law) dated 10 December 2004. The Central Bank''s exceptional function of issue of the national currency of the country is specified in the Constitution of the Republic of Azerbaijan. The Central Bank is also guided by other legislative acts of the Republic of Azerbaijan and international treaties seconded by the Republic of Azerbaijan.</p><p>&nbsp;</p><p><strong>Goals of the Central Bank&nbsp;</strong></p><p>&nbsp;</p><p>The main goal of the Central Bank is to maintain price stability within its authorities set by the Law.</p><p>Without prejudice to the main goal the Central Bank safeguards financial stability within its mandated powers with the laws governing financial markets.&nbsp;</p><p>Profit making is not the main goal of the Central Bank.</p><p>&nbsp;</p><p><strong>Functions of the Central Bank&nbsp;</strong></p><p>&nbsp;</p><p>The Central Bank discharges the following functions to attain its goals according to Article 5 of the Law:</p><p>&nbsp;</p><p><strong>Set and implement the monetary and exchange rate policy</strong></p><p>&nbsp;</p><p><i>The main function of the Central Bank is to set and implement the monetary policy and the exchange rate policy, which is its integral part.</i></p><p>&nbsp;</p><p><strong>Organize cash circulation, issue currency to and withdraw from circulation according to Article 19 Part II of the Constitution of the Republic of Azerbaijan</strong></p><p>&nbsp;</p><p><i>One of the critical functions of the Central Bank is to issue the national currency (manat) of the Republic of Azerbaijan. According to Article 19 of the Constitution of the Republic of Azerbaijan, the Central Bank enjoys this exclusive right. Within this authority the Central Bank issues manat denominated banknotes and coins to and withdraws from circulation, and takes actions on their circulation</i></p><p>&nbsp;</p><p><strong>Set and announce an official exchange rate of manat against foreign currencies regularly</strong></p><p>&nbsp;</p><p><i>The Central Bank sets and announces an official exchange rate of manat against foreign currencies.</i></p><p>&nbsp;</p><p><strong>Regulate and control foreign currency according to the Law of the Republic of Azerbaijan on Currency Regulation</strong></p><p>&nbsp;</p><p><i>Foreign currency regulation and control is a set of measures that support conduction of the exchange rate policy, maintain international settlements, regulate foreign currency circulation, execute transactions, restrict foreign currency use, and exercise government control over foreign currency movement.</i></p><p>&nbsp;</p><p><strong>Maintain and manage international gold-foreign exchange reserves</strong></p><p>&nbsp;</p><p><i>The Central Bank maintains and manages international gold  foreign exchange reserves at its disposal.</i></p><p>&nbsp;</p><p><strong>Develop monetary, financial markets and payment systems statistics, the balance of payments, international investment balance and external debt (public and non-public) statistics in accordance with international standards and methodologies, summarize and disseminate data, as well as participate in forecasting the balance of payments of the country</strong></p><p>&nbsp;</p><p><i>One of the functions of the Central Bank is to develop reporting balance of payments and participate in the development of forecasting balance of payments under the legislation. The Central Bank compiles, summarises and publishes international investment balance and external debt (public and non-public) statistics.&nbsp;</i></p><p>&nbsp;</p><p><strong>Maintain stable, uninterrupted and effective operation of payment systems and support their development</strong></p><p>&nbsp;</p><p><i>The Central Bank organizes settlements in the national currency between banks, local branches of foreign banks and the national operator of postal communication through correspondent accounts of those institutions with the Central Bank. The Central Bank determines regulations on conduction of payment operations by payment service providers and settlements between them, as well as requirements on payment instruments.</i></p><p>&nbsp;</p><p><strong>Ensure stability and sustainability of financial markets, regulate and supervise financial markets and maintain macro prudential regulation and supervision</strong></p><p>&nbsp;</p><p><i>In order to ensure stability and sustainability of financial markets, the Central Bank shall license, regulate and supervise banks, non-bank credit institutions, professional participants of the insurance market, investment companies and other licensed persons in the securities market, investment funds, investment fund managers, persons engaged in clearing (processing), credit bureaus and other persons identified as the entities supervised by the Central Bank (supervised entities) under the laws regulating financial markets.</i></p><p><strong>&nbsp;</strong></p><p><strong>Take actions for the protection of the rights of consumers and investors in financial markets and conduct financial literacy efforts</strong></p><p>&nbsp;</p><p><i>In order to protect the rights of consumers and investors, the Central Bank carries out test purchase of financial services (products) in accordance with the procedure it has determined, issues obligatory instructions for supervised entities on elimination of violations or the cases that create conditions for violations of legal interests of consumers and investors in financial markets.</i></p><p><strong>&nbsp;</strong></p><p><strong>Supervise deposit insurance activities</strong></p><p>&nbsp;</p><p><i>The Central Bank takes actions to maintain supervision of deposit insurance activities.</i></p><p>&nbsp;</p><p>The functions of the Central Bank contribute to overall macroeconomic stability.</p><p><strong>&nbsp;</strong></p><p>The powers of the financial markets supervisory authority defined by laws of the Republic of Azerbaijan, including licensing, regulation and supervision in the financial services market, and duties and responsibilities on protection of rights of investors and consumers of financial services were transferred to the Central Bank of the Republic of Azerbaijan with the Decree of the President of the Republic of Azerbaijan on ''Improvement of the management of the system of regulation and supervision in the financial services market'' dated 28 November 2019.</p><p>&nbsp;</p><p><strong>Relations of the Central Bank with public authorities</strong></p><p>&nbsp;</p><p>The Central Bank is independent in discharge of its responsibilities and exercise of its authorities prescribed by the Constitution and laws of the Republic of Azerbaijan, and no public authority or self-administration body, individuals or legal entities may directly or indirectly for whatever reason contain, illegally influence or interfere with its activities. Although the Central Bank is independent under the legislation, it coordinates its activities with other public authorities and institutions. At the same time, the Central Bank participates in discussions on various directions of the country''s economic policy and issues relevant proposals. As a state bank, the Central Bank services and maintains debit-credit operations on state treasury accounts. The Central Bank may issue loans to the government in case of short-term shortage of funds in the state budget within the limits set by the legislation.</p><p>&nbsp;</p><p><strong>Central Bank accountability&nbsp;</strong></p><p>&nbsp;</p><p>The Central Bank keeps the broad public informed on discharge of its goals and functions to make its activities more transparent and boost public confidence. Governor of the Central Bank reports to President of the country on the works done to contribute to the economy, as well as on the development of the financial sector. During state budget discussions, Governor of the Central Bank informs the Milli Majlis of the Republic of Azerbaijan on monetary policy guidelines for the year to come. Annual performance of the Central Bank is reviewed by an auditor appointed by President of the Republic of Azerbaijan and financial statements are presented to the President. Central Bank''s annual report goes public  the annual report and audited financial statements are published in media (the Central Bank''s web site) on an annual basis.</p>', 1, 2, '2025-09-14 18:23:04.881272', '2025-09-14 18:23:04.881272', NULL);


