INSERT INTO public."BankCaptionTranslations" VALUES (1, '<p>Azrbaycan Respublikasnn bank sistemi maliyy bazarlarna nzart orqan olan Azrbaycan Respublikasnn Mrkzi Bankndan (Mrkzi Bank) v kredit tkilatlarndan ibartdir.</p><p><br><strong>Bank</strong> - fiziki v hquqi xslrdn depozitlrin v ya digr qaytarlan vsaitlrin clb edilmsi, z adndan v z hesabna kreditlrin verilmsini, habel mtrilrin tapr il krm v hesablama-kassa mliyyatlarn mcmu halda hyata keirn hquqi xsdir.</p><p><br>Mrkzi Bank banklarn, filiallarn, blrin v nmayndliklrin ictimaiyyt n aq olan mrkzi <strong>reyestrini</strong> trtib edir.</p>', 1, 1, '2025-09-19 18:38:34.407402', '2025-09-19 18:38:34.407402', NULL);
INSERT INTO public."BankCaptionTranslations" VALUES (2, '<p>The banking system of the Republic of Azerbaijan consists of the Central Bank of the Republic of Azerbaijan, as the financial markets supervisory authority, and credit institutions.</p><p><br><strong>Bank</strong>  is a legal entity that attracts deposits and other returnable funds from individuals and legal entities, issues loans on its behalf and from its own funds, as well as makes transfers and cash settlements in aggregate at a clients'' requests.</p><p><br>The Central Bank maintains a public <strong>register</strong> of banks, branches, departments and representative offices.</p>', 1, 2, '2025-09-19 18:38:34.40744', '2025-09-19 18:38:34.40744', NULL);


