INSERT INTO public."BlogTranslations" VALUES (17, 'Azrbaycan Mrkzi Banknn sdri sver Milli Banknn nmaynd heytini qbul edib', 'azerbaycan-merkezi-bankinin-sedri-isvecre-milli-bankinin-numayende-heyetini-qebul-edib', 'Azrbaycan Mrkzi Banknn sdri sver Milli Banknn nmaynd heytini qbul edib', 'Azrbaycan Mrkzi Banknn sdri sver Milli Banknn nmaynd heytini qbul edib', 'Sint alias eveniet ', NULL, NULL, NULL, '<p>sver Milli Banknn (MB) sdri Martin leqelin rhbrlik etdiyi nmaynd heytinin Azrbaycana ilk igzar sfri balayb.</p><p>&nbsp;</p><p>Sfr rivsind MB nmaynd heytinin Mrkzi Bankn sdri Taleh Kazmov il gr tkil olunub.</p><p>&nbsp;</p><p>Gr zaman qlobal iqtisadiyyat v maliyy bazarlarnda gedn proseslr, ortamddtli dvr n pul siyasti v maliyy sabitliyi zr prioritetlr, elc d maliyy sektorunun inkiafna dair rqmsal tbbslr trafnda geni fikir mbadilsi aparlb.</p><p>&nbsp;</p><p>Trflr Azrbaycan il sver arasnda iqtisadi laqlrin cari vziyytindn mmnunluq ifad ediblr.</p><p>&nbsp;</p><p>Gr qarlql maraq douran msllrin, o cmldn iki qurum arasnda mkdaln genilndirilmsi imkanlarnn mzakirsi il davam edib.</p>', 3, 1, '2025-10-01 08:06:25.62226', '2025-10-01 08:06:25.622261', NULL);
INSERT INTO public."BlogTranslations" VALUES (18, 'Reprehenderit soluta', 'reprehenderit-soluta', 'Dolorem accusantium ', 'Dicta deleniti nulla', 'Consequat Cupiditat', NULL, NULL, NULL, '<p>asodka</p>', 3, 2, '2025-10-01 08:06:25.622438', '2025-10-01 08:06:25.622438', NULL);
INSERT INTO public."BlogTranslations" VALUES (19, 'Banklarda likvidlik risklrinin idar edilmsi Qaydasna dyiikliklr tsdiq edilib', 'banklarda-likvidlik-risklerinin-idare-edilmesi-qaydasina-deyisiklikler-tesdiq-edilib', 'Banklarda likvidlik risklrinin idar edilmsi Qaydasna dyiikliklr tsdiq edilib', 'Banklarda likvidlik risklrinin idar edilmsi Qaydasna dyiikliklr tsdiq edilib', 'jj', NULL, NULL, NULL, '<p>Mrkzi Bank trfindn Banklarda likvidlik riskinin idar edilmsi Qaydasna (Qayda)&nbsp; dyiikliklr edilib. Szgedn dyiikliklr 2025-ci il avqust aynn 1-dn qvvy minir.</p><p>&nbsp;</p><p>Qaydaya ediln dyiikliklrin sas mqsdi kmiyyt v keyfiyyt parametrlrinin yenidn tnzimlnmsi yolu il banklarda likvidlik risklrinin daha effektiv idar olunmas v onlarn likvidlik mvqelrinin daha da mhkmlndirilmsi il yana, bank sektorunun real iqtisadiyyat maliyyldirmk imkanlarnn qorunmasndan ibartdir.</p><p>&nbsp;</p><p>Yeni tlblr banklarn likvidlik mvqeyinin qiymtlndirilmsi n ttbiq ediln likvidliyin rtlm msalnn (LCR) hm mcmu, hm d milli valyuta zr ttbiqini nzrd tutur. &nbsp;01.08.2025-ci il tarixindn etibarn sistem hmiyytli banklar milli valyuta zr LCR msaln 50%-dn balamaqla 01.06.2027-ci il tarixindk, btn digr banklar is 40%-dn balamaqla 01.12.2027-ci il tarixindk mrhlli qaydaya 100%- atdrmaldr. Paralel olaraq, dyiikliklr vasitsil banklarn yksk keyfiyytli likvid aktiv kimi tsnifldir bilcklri aktivlrin dairsi d genilndirilibdir (bank metallar, dvlt zmantli maliyy institutlarnn qiymtli kazlar, geclik (overnight) depozitlr, Mrkzi Bankda yerldirilmi qsamddtli vsaitlrin yksk keyfiyytli likvid aktiv kimi tsnifldirilmsin icaz verilibdir).</p><p>&nbsp;</p><p>Qaydaya ediln dyiikliklr, mumilikd likvidlik risklrinin llmsi v idar olunmas mexanizmlrinin daha evik qurulmasna, hminin banklarda likvid vsaitlrin milli v xarici valyutalar arasnda blgsnn daha optimal proqnozladrlmasna, banklarn milli valyutada likvid mvqeyinin daha dayanql kild formaladrlmasna xidmt edckdir.</p>', 1, 1, '2025-10-01 08:09:17.83379', '2025-10-01 08:09:17.83379', NULL);
