INSERT INTO public."BlogTranslations" VALUES (26, 'Azrbaycan Mrkzi Banknn sdri sver Milli Banknn nmaynd heytini qbul edib', 'azerbaycan-merkezi-bankinin-sedri-isvecre-milli-bankinin-numayende-heyetini-qebul-edib', 'Azrbaycan Mrkzi Banknn sdri sver Milli Banknn nmaynd heytini qbul edib', 'Azrbaycan Mrkzi Banknn sdri sver Milli Banknn nmaynd heytini qbul edib', 'ghbj', NULL, NULL, NULL, '<p>sver Milli Banknn (MB) sdri Martin leqelin rhbrlik etdiyi nmaynd heytinin Azrbaycana ilk igzar sfri balayb.</p><p>&nbsp;</p><p>Sfr rivsind MB nmaynd heytinin Mrkzi Bankn sdri Taleh Kazmov il gr tkil olunub.</p><p>&nbsp;</p><p>Gr zaman qlobal iqtisadiyyat v maliyy bazarlarnda gedn proseslr, ortamddtli dvr n pul siyasti v maliyy sabitliyi zr prioritetlr, elc d maliyy sektorunun inkiafna dair rqmsal tbbslr trafnda geni fikir mbadilsi aparlb.</p><p>&nbsp;</p><p>Trflr Azrbaycan il sver arasnda iqtisadi laqlrin cari vziyytindn mmnunluq ifad ediblr.</p><p>&nbsp;</p><p>Gr qarlql maraq douran msllrin, o cmldn iki qurum arasnda mkdaln genilndirilmsi imkanlarnn mzakirsi il davam edib.</p>', 5, 1, '2025-10-01 15:56:42.561166', '2025-10-01 15:56:42.561166', NULL);
INSERT INTO public."BlogTranslations" VALUES (27, 'Azrbaycan Mrkzi Bank Qazaxstann Maliyy Bazarnn Tnzimlnmsi v nkiaf Agentliyinin nmayndlrini qbul edib', 'azerbaycan-merkezi-banki-qazaxistanin-maliyye-bazarinin-tenzimlenmesi-ve-inkisafi-agentliyinin-numayendelerini-qebul-edib', 'Azrbaycan Mrkzi Bank Qazaxstann Maliyy Bazarnn Tnzimlnmsi v nkiaf Agentliyinin nmayndlrini qbul edib', 'Azrbaycan Mrkzi Bank Qazaxstann Maliyy Bazarnn Tnzimlnmsi v nkiaf Agentliyinin nmayndlrini qbul edib', 'Aut consequatur Ut ', NULL, NULL, NULL, '<p>Azrbaycan Mrkzi Banknda (AMB) tcrb mbadilsi mqsdil sfrd olan Qazaxstann Maliyy Bazarnn Tnzimlnmsi v nkiaf Agentliyinin (QMBT) nmaynd heyti il grlr keirilib.</p><p>&nbsp;</p><p>QMBT nmayndlrinin igzar sfrinin sas mqsdi ikitrfli texniki mkdalq rivsind maliyy sahsind tnzimlyici qurumlar arasnda pekar dialoqun genilndirilmsi olub. Grlr zaman AMB nmayndlri trfindn qiymtli kazlarn qeydiyyat, slam qiymtli kazlarnn tnzimlnmsi, hminin sekyuritizasiya prosesi v xsusi maliyy irktlrinin faliyyti bard mlumat tqdim edilib.</p><p>&nbsp;</p><p>QMBT nmaynd heyti emissiya prospektinin, maliyy hesabatlarnn v digr sndlrin nzrdn keirilmsi v tsdiqi n normativ tlblr, yal istiqrazlar n hquqi riv, korporativ qiymtli kazlarn emissiyasna diferensial yanamann ttbiqi, istiqrazlara zmant v subsidiyalar kimi mhm mvzular zr tmsil etdiklri qurumun tcrbsini blb.</p><p>&nbsp;</p><p>Qeyd edk ki, bu sfr cari ilin may aynda Mrkzi Bank il Qazaxstann Maliyy Bazarnn Tnzimlnmsi v nkiaf Agentliyi arasnda imzalanm Anlama Memorandumu rivsind tkil olunub. Memorandum maliyy bazarnn vziyyti v inkiaf, bazarn tnzimlnmsi v nzartin dair standartlar v tlblri, elc d bu sahd innovativ mexanizmlr zr mlumat mbadilsinin aparlmasn v bazar itiraklarnn faliyytin nzart mexanizmlrinin tkmilldirilmsi istiqamtind mkdaln genilndirilmsini nzrd tutur.</p>', 2, 1, '2025-10-01 15:57:10.238853', '2025-10-01 15:57:10.238853', NULL);
