INSERT INTO public."CBDCTranslations" VALUES (1, '<p>Mrkzi Bank Rqmsal Valyutas (MBRV), Mrkzi Bank trfindn buraxlan v milli valyutann rqmsal formas kimi faliyyt gstrn yeni nsil dni vasitsidir. nnvi nad pullardan frqli olaraq, MBRV yalnz rqmsal formatda mvcuddur v birbaa Mrkzi Bankn zmanti il dvriyyy buraxlr.</p><p><br>MBRV-nin ttbiqi lkd maliyy inklzivliyinin artrlmasna, halinin maliyy xidmtlrin x imkanlarnn genilnmsin v rqmsal dnilrin stimulladrlmasna rait yaradr. Eyni zamanda, bu valyuta dvlt dnilrinin daha effektiv v ffaf kild hyata keirilmsin imkan verir. MBRV, hminin srhdlraras mliyyatlarda srtin v smrliliyin artrlmas baxmndan yeni imkanlar tqdim edir.</p><p><br>Azrbaycan Respublikasnn Mrkzi Bank MBRV layihsinin iqtisadi, texniki v hquqi saslarn aradrr v beynlxalq tcrbni daim izlyir. Hazrda lk daxilind bu valyutann mmkn ttbiq sahlri, texnoloji hllri v onun iqtisadi sistem tsiri thlil olunur.</p><p><br>MBRV-nin hyata keirilmsi innovativ dni infrastrukturlarnn formaladrlmasna, rqmsal iqtisadiyyatn dinamik inkiafna v lknin maliyy texnologiyalar sahsind rqabt qabiliyytinin gclnmsin thf verck. Bu tbbs, hminin Mrkzi Bankn pul siyastindki rolunu masir texnologiyalar fonunda qorumaa v mhkmlndirmy xidmt edir.</p>', 1, 1, '2025-09-26 18:44:15.192173', '2025-09-26 18:44:15.192173', NULL);
INSERT INTO public."CBDCTranslations" VALUES (2, '<p>The Central Bank Digital Currency (CBDC) is a new generation payment instrument issued by the Central Bank and operating as a digital form of the national currency. Unlike traditional cash, CBDC exists only in digital format and is released into circulation directly with the guarantee of the Central Bank.</p><p><br>The introduction of CBDC creates conditions for increasing financial inclusion in the country, expanding access to financial services for the population, and stimulating digital payments. At the same time, this currency allows for more effective and transparent implementation of government payments. CBDC also provides new opportunities in terms of increasing the speed and efficiency of cross-border transactions.</p><p><br>The Central Bank of the Republic of Azerbaijan is studying the economic, technical, and legal foundations of the CBDC project and is constantly monitoring international experience. Currently, possible areas of application of this currency within the country, technological solutions, and its impact on the economic system are being analyzed.</p><p><br>The implementation of CBDC will contribute to the formation of innovative payment infrastructures, the dynamic development of the digital economy, and the strengthening of the country''s competitiveness in the field of financial technologies. This initiative also serves to preserve and strengthen the Central Bank''s role in monetary policy against the backdrop of modern technologies.</p>', 1, 2, '2025-09-26 18:44:15.192212', '2025-09-26 18:44:15.192212', NULL);


