INSERT INTO public."ChronologyTranslations" VALUES (9, 'Amet cupiditate dol', 4, 1, '2025-09-18 13:49:56.94724', '2025-09-18 13:49:56.94724', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (10, 'Minus expedita cum u', 4, 2, '2025-09-18 13:49:56.947243', '2025-09-18 13:49:56.947243', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (83, '<p>deyisdim</p>', 19, 1, '2025-09-30 18:52:52.219893', '2025-09-30 18:52:52.219893', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (84, '<p>cra deyisdim</p>', 19, 2, '2025-09-30 18:52:52.219897', '2025-09-30 18:52:52.219897', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (85, '<ul><li>7 mart  Azrbaycan Dvlt Banknn (mrkzi bankn) tkil edilmsi haqqnda qrar qbul edildi.</li><li>16 sentyabr  Azrbaycan Dvlt Banknn Nizamnamsi qbul edildi.</li><li>30 sentyabr  Azrbaycan Dvlt Banknn tntnli al oldu v faliyyt balad.</li></ul>', 1, 1, '2025-10-01 04:20:01.372356', '2025-10-01 04:20:01.372356', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (86, 'March 7  A decision was adopted on the establishment of the State Bank of Azerbaijan (the central bank).  September 16  The Charter of the State Bank of Azerbaijan was adopted.  September 30  The State Bank of Azerbaijan held its ceremonial opening and commenced operations.', 1, 2, '2025-10-01 04:20:01.372418', '2025-10-01 04:20:01.372418', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (87, '<ul><li>31 may  Azrbaycan Dvlt Bank Azrbaycan Xalq Bank adlandrld.</li><li>9 iyun  Btn banklar millildirilrk Xalq Banknn trkibin qatld.</li><li>16 sentyabr  Azrbaycan Dvlt Banknn Nizamnamsi qbul edildi.</li><li>30 sentyabr  Azrbaycan Dvlt Banknn tntnli al oldu v faliyyt balad.</li></ul>', 2, 1, '2025-10-01 04:20:42.950825', '2025-10-01 04:20:42.950825', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (88, 'May 31  The State Bank of Azerbaijan was renamed the People''s Bank of Azerbaijan.  June 9  All banks were nationalized and incorporated into the People''s Bank.  September 16  The Charter of the State Bank of Azerbaijan was adopted.  September 30  The State Bank of Azerbaijan held its ceremonial opening and commenced operations.', 2, 2, '2025-10-01 04:20:42.950827', '2025-10-01 04:20:42.950827', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (89, '<ul><li>16 oktyabr  Azrbaycan Dvlt Bank yenidn yaradld v nizamnamsi qbul edildi.</li></ul>', 3, 1, '2025-10-01 04:21:08.800929', '2025-10-01 04:21:08.80093', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (90, 'October 16  The State Bank of Azerbaijan was re-established, and its charter was adopted.', 3, 2, '2025-10-01 04:21:08.800981', '2025-10-01 04:21:08.800982', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (91, '<ul><li>10 yanvar  Zaqafqaziya vahid pul sistemin kedi, Azrbaycan Dvlt Banknn pul emissiyas dayandrld.&nbsp;</li><li>3 iyul  Azrbaycan Dvlt Bank Azrbaycan Dvlt Knd Tsrrfat Bank adlandrld.</li></ul>', 5, 1, '2025-10-01 04:21:27.299853', '2025-10-01 04:21:27.299853', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (92, 'January 10  Transcaucasia transitioned to a unified monetary system, and the currency issuance of the State Bank of Azerbaijan was discontinued.  July 3  The State Bank of Azerbaijan was renamed the State Agricultural Bank of Azerbaijan.', 5, 2, '2025-10-01 04:21:27.299854', '2025-10-01 04:21:27.299854', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (93, '<ul><li>25 may  Azrbaycan Respublikasnn iqtisadi mstqilliyinin saslar haqqnda Konstitusiya Qanunu qbul edildi, mstqil bank sistemi v milli pul vahidinin hquqi saslar tsbit olundu.</li></ul>', 6, 1, '2025-10-01 04:21:57.006714', '2025-10-01 04:21:57.006714', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (94, 'May 25  The Constitutional Law ''On the Foundations of Economic Independence of the Republic of Azerbaijan'' was adopted, establishing the legal basis for an independent banking system and a national currency unit.', 6, 2, '2025-10-01 04:21:57.006716', '2025-10-01 04:21:57.006716', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (95, '<ul><li>11 fevral  Azrbaycan Respublikas Prezidentinin frman il Milli Bank yaradld.&nbsp;</li><li>12 fevral  Milli Bankn yaradlmas gn kimi qeyd olunur.&nbsp;</li><li>7 avqust  Azrbaycan Respublikasnn Milli Bank haqqnda ilk qanun qbul edildi.&nbsp;</li><li>1 dekabr  Azrbaycan Respublikasnn Milli Banknn Nizamnamsinin tsdiq edilmsi haqqnda qrar qbul olundu.&nbsp;</li><li>15 avqust  Azrbaycan milli valyutas manat dvriyyy buraxld.</li></ul>', 7, 1, '2025-10-01 04:22:17.397185', '2025-10-01 04:22:17.397185', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (96, 'February 11  By decree of the President of the Republic of Azerbaijan, the National Bank was established.  February 12  Is observed as the day of the establishment of the National Bank.  August 7  The first law On the National Bank of the Republic of Azerbaijan was adopted.  December 1  A resolution On the Approval of the Charter of the National Bank of the Republic of Azerbaijan was adopted.  August 15  The national currency of Azerbaijan, the manat, was put into circulation.', 7, 2, '2025-10-01 04:22:17.397187', '2025-10-01 04:22:17.397187', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (97, '<ul><li>1 yanvar  Manat lknin yegan dni vasitsi elan edildi.</li></ul>', 8, 1, '2025-10-01 04:22:28.396086', '2025-10-01 04:22:28.396086', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (98, 'January 1  The manat was declared the sole legal means of payment in the country.', 8, 2, '2025-10-01 04:22:28.396087', '2025-10-01 04:22:28.396087', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (99, '<ul><li>12 noyabr  Azrbaycann ilk Konstitusiyasnn 19-cu maddsind Milli Bankn pul nianlarnn tdavl buraxlmas zr mstsna hquqa malik olduu tsbit edildi.</li></ul>', 9, 1, '2025-10-01 04:22:41.29597', '2025-10-01 04:22:41.29597', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (100, 'November 12  Article 19 of Azerbaijan''s first Constitution established that the National Bank holds the exclusive right to issue currency.', 9, 2, '2025-10-01 04:22:41.295972', '2025-10-01 04:22:41.295972', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (101, '<ul><li>14 iyun  Azrbaycan Respublikasnn Milli Bank haqqnda qanunun ikinci redaksiyas qbul edildi.</li></ul>', 10, 1, '2025-10-01 04:22:54.936171', '2025-10-01 04:22:54.936171', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (102, 'June 14  The second version of the Law ''On the National Bank of the Republic of Azerbaijan'' was adopted.', 10, 2, '2025-10-01 04:22:54.936172', '2025-10-01 04:22:54.936172', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (103, '<ul><li>Mrkzi Bankn yeni inzibati binas istifady verildi.</li></ul>', 11, 1, '2025-10-01 04:23:22.817309', '2025-10-01 04:23:22.817309', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (104, 'The new administrative building of the Central Bank was put into operation.', 11, 2, '2025-10-01 04:23:22.817366', '2025-10-01 04:23:22.817366', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (105, '<ul><li>10 dekabr  Azrbaycan Respublikasnn Milli Bank haqqnda qanunun nc redaksiyas qbul edildi.</li></ul>', 12, 1, '2025-10-01 04:23:36.456373', '2025-10-01 04:23:36.456373', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (106, 'December 10  The third version of the Law ''On the National Bank of the Republic of Azerbaijan'' was adopted.', 12, 2, '2025-10-01 04:23:36.456374', '2025-10-01 04:23:36.456375', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (107, '<ul><li>28 noyabr  Maliyy xidmtlri bazarnda tnzimlm v nzart funksiyalar Mrkzi Banka verildi.</li></ul>', 18, 1, '2025-10-01 04:23:42.927444', '2025-10-01 04:23:42.927444', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (108, 'On November 28, the functions of regulation and supervision in the financial services market were transferred to the Central Bank.', 18, 2, '2025-10-01 04:23:42.927445', '2025-10-01 04:23:42.927445', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (109, '<ul><li>4 mart  Mrkzi Bankn slahiyytlrin dyiikliklr edildi, banklarn lisenziyaladrlmas v nzart funksiyalar yeni quruma verildi.</li></ul>', 17, 1, '2025-10-01 04:23:48.460701', '2025-10-01 04:23:48.460701', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (110, 'March 4  Changes were made to the powers of the Central Bank, and the functions of bank licensing and supervision were transferred to the new institution.', 17, 2, '2025-10-01 04:23:48.460702', '2025-10-01 04:23:48.460702', NULL);
INSERT INTO public."ChronologyTranslations" VALUES (111, '<ul><li>18 mart  Azrbaycan Respublikasnn Mrkzi Bank kimi adlandrlmas bard Konstitusiyaya lavlr v dyiikliklr edildi.</li></ul>', 16, 1, '2025-10-01 04:23:56.724566', '2025-10-01 04:23:56.724566', NULL);
