INSERT INTO public."ClearingSettlementSystemCaptionTranslations" VALUES (1, 'Xrda dnilr zr Hesablama Klirinq Sistemi (XHKS)  xrda, daimi tkrarlanan v tcili olmayan dnilrin hyata keirilmsi n yaradlm klirinq sistemidir. Bu sistemd dnilr oxtrfli klirinq prosesi nticsind myynldirilmi tmiz mvqelr (netto) sasnda aparr. dni sndlri FFO ( 1-ci daxil olan 1-ci emal olunur) prinsipi il ilnilir. Nvbd olan sndlr itiraklar trfindn geri arla v prioritetlri dyidiril bilr. Vsait atmazl sbbindn gn rzind nvbd qalan dni paketlri gnn sonunda sistem trfindn avtomatik rejimd lv olunur v bu haqda itiraklara mvafiq mlumat gndrilir. Gn rzind itiraklarn sorular sasnda onlara mxbir hesablarnda aparlan mliyyatlar, nvbd olan dni paketlri v qalq haqqnda mlumatlar verilir. tiraklar sistem 10 gn vvldn glck valyutalama tarixi il dni sndlrini gndr bilrlr.', 1, 1, '2026-02-04 16:58:13.725189+04', '2026-02-04 16:58:13.725189+04', NULL);
INSERT INTO public."ClearingSettlementSystemCaptionTranslations" VALUES (2, 'Small Payments Settlement Clearing System (SPS) is a clearing system created for the implementation of small, recurring and non-urgent payments. In this system, payments are made on the basis of net positions determined as a result of the multilateral clearing process. Payment documents are processed on the FIFO (first in, first out) principle. Documents in the queue can be recalled by participants and their priorities can be changed. Payment packages that remain in the queue during the day due to lack of funds are automatically canceled by the system at the end of the day and relevant information is sent to participants. During the day, based on participants'' requests, they are provided with information about transactions carried out on correspondent accounts, payment packages in the queue and balance. Participants can send payment documents to the system with a future exchange date 10 days in advance.', 1, 2, '2026-02-04 16:58:13.725276+04', '2026-02-04 16:58:13.725276+04', NULL);


