INSERT INTO public."ControlMeasureTranslations" VALUES (9, 'Rabitbank ASC-y maliyy sanksiyasnn ttbiq olunmas haqqnda mlumat', '<p>Bank sistemind likvidliyin effektiv idar edilmsi v likvidliyin konsentrasiyasnn azaldlmas mqsdil Azrbaycan Respublikasnn Mrkzi Bank trfindn mcburi ehtiyat normalar altindn istifad olunur. Banklara ttbiq ediln mcburi ehtiyatlar zr tlblr Azrbaycan Respublikasnn Mrkzi Bank haqqnda Qanunla (Qanun) yana, Mrkzi Bankn Mcburi ehtiyatlarn normas, hesablanmas v saxlanmas Qaydas (Qayda) il tnzimlnir. Bundan irli glrk, banklar tlb olunan mcburi ehtiyatlarn Qaydaya mvafiq surtd Mrkzi Bankda olan mxbir hesablarnda saxlanmasn tmin etmlidirlr.</p><p>15.07.2025-14.08.2025-ci il tarixlrini hat edn saxlama dvrnd&nbsp;Rabitbank&nbsp;ASC manatla mcburi ehtiyatlar tlb olunan normadan az saxlamaqla Qaydann tlblrin riayt etmmidir. Bundan irli glrk, Qanunun 32-ci maddsin mvafiq olaraq Mrkzi Bank trfindn Rabitbank&nbsp;ASC-y qar 1857.54 manat (min skkiz yz lli yeddi manat lli drd qpik) mblind maliyy sanksiyas ttbiq olunmudur.</p>', 1, 10, '2025-10-01 15:14:52.738567', '2025-10-01 15:14:52.738567', NULL);
INSERT INTO public."ControlMeasureTranslations" VALUES (10, 'Information on financial sanction imposed on Rabitbank OJSC', '<p>The Central Bank of the Republic of Azerbaijan applies reserve requirements to effectively manage liquidity and reduce its concentration in the banking system. These requirements for banks are regulated both by the Law of the Republic of Azerbaijan ''on the Central Bank of the Republic of Azerbaijan'' (the Law) and the ''Regulations of the Central Bank on the ratio, calculation and maintaining required reserves'' (the Regulation). According to the Regulation, banks are obliged to maintain required reserves in their correspondent accounts with the Central Bank.</p><p>Rabitbank OJSC failed to meet these obligations during the maintenance period of 15 July 2025 - 14 August 2025 keeping its reserves below the threshold. Pursuant to Article 32 of the Law, the Central Bank imposed a financial sanction of AZN1857.54 (one thousand eight hundred fifty-seven manats and fifty-four gapiks) on Rabitbank OJSC.</p>', 2, 10, '2025-10-01 15:14:52.738619', '2025-10-01 15:14:52.738619', NULL);
INSERT INTO public."ControlMeasureTranslations" VALUES (11, 'Rabitbank ASC-y maliyy sanksiyasnn ttbiq olunmas haqqnda mlumat', '<p>Bank sistemind likvidliyin effektiv idar edilmsi v likvidliyin konsentrasiyasnn azaldlmas mqsdil Azrbaycan Respublikasnn Mrkzi Bank trfindn mcburi ehtiyat normalar altindn istifad olunur. Banklara ttbiq ediln mcburi ehtiyatlar zr tlblr Azrbaycan Respublikasnn Mrkzi Bank haqqnda Qanunla (Qanun) yana, Mrkzi Bankn Mcburi ehtiyatlarn normas, hesablanmas v saxlanmas Qaydas (Qayda) il tnzimlnir. Bundan irli glrk, banklar tlb olunan mcburi ehtiyatlarn Qaydaya mvafiq surtd Mrkzi Bankda olan mxbir hesablarnda saxlanmasn tmin etmlidirlr.</p><p>15.07.2025-14.08.2025-ci il tarixlrini hat edn saxlama dvrnd&nbsp;Rabitbank&nbsp;ASC manatla mcburi ehtiyatlar tlb olunan normadan az saxlamaqla Qaydann tlblrin riayt etmmidir. Bundan irli glrk, Qanunun 32-ci maddsin mvafiq olaraq Mrkzi Bank trfindn Rabitbank&nbsp;ASC-y qar 1857.54 manat (min skkiz yz lli yeddi manat lli drd qpik) mblind maliyy sanksiyas ttbiq olunmudur.</p>', 1, 10, '2025-10-01 15:15:04.276539', '2025-10-01 15:15:04.276539', NULL);
INSERT INTO public."ControlMeasureTranslations" VALUES (12, 'Information on financial sanction imposed on Rabitbank OJSC', '<p>The Central Bank of the Republic of Azerbaijan applies reserve requirements to effectively manage liquidity and reduce its concentration in the banking system. These requirements for banks are regulated both by the Law of the Republic of Azerbaijan ''on the Central Bank of the Republic of Azerbaijan'' (the Law) and the ''Regulations of the Central Bank on the ratio, calculation and maintaining required reserves'' (the Regulation). According to the Regulation, banks are obliged to maintain required reserves in their correspondent accounts with the Central Bank.</p><p>Rabitbank OJSC failed to meet these obligations during the maintenance period of 15 July 2025 - 14 August 2025 keeping its reserves below the threshold. Pursuant to Article 32 of the Law, the Central Bank imposed a financial sanction of AZN1857.54 (one thousand eight hundred fifty-seven manats and fifty-four gapiks) on Rabitbank OJSC.</p>', 2, 10, '2025-10-01 15:15:04.27654', '2025-10-01 15:15:04.276541', NULL);
INSERT INTO public."ControlMeasureTranslations" VALUES (13, 'Rabitbank ASC-y maliyy sanksiyasnn ttbiq olunmas haqqnda mlumat', '<p>Bank sistemind likvidliyin effektiv idar edilmsi v likvidliyin konsentrasiyasnn azaldlmas mqsdil Azrbaycan Respublikasnn Mrkzi Bank trfindn mcburi ehtiyat normalar altindn istifad olunur. Banklara ttbiq ediln mcburi ehtiyatlar zr tlblr Azrbaycan Respublikasnn Mrkzi Bank haqqnda Qanunla (Qanun) yana, Mrkzi Bankn Mcburi ehtiyatlarn normas, hesablanmas v saxlanmas Qaydas (Qayda) il tnzimlnir. Bundan irli glrk, banklar tlb olunan mcburi ehtiyatlarn Qaydaya mvafiq surtd Mrkzi Bankda olan mxbir hesablarnda saxlanmasn tmin etmlidirlr.</p><p>15.07.2025-14.08.2025-ci il tarixlrini hat edn saxlama dvrnd&nbsp;Rabitbank&nbsp;ASC manatla mcburi ehtiyatlar tlb olunan normadan az saxlamaqla Qaydann tlblrin riayt etmmidir. Bundan irli glrk, Qanunun 32-ci maddsin mvafiq olaraq Mrkzi Bank trfindn Rabitbank&nbsp;ASC-y qar 1857.54 manat (min skkiz yz lli yeddi manat lli drd qpik) mblind maliyy sanksiyas ttbiq olunmudur.</p>', 1, 10, '2025-10-01 15:15:08.909401', '2025-10-01 15:15:08.909401', NULL);
INSERT INTO public."ControlMeasureTranslations" VALUES (14, 'Information on financial sanction imposed on Rabitbank OJSC', '<p>The Central Bank of the Republic of Azerbaijan applies reserve requirements to effectively manage liquidity and reduce its concentration in the banking system. These requirements for banks are regulated both by the Law of the Republic of Azerbaijan ''on the Central Bank of the Republic of Azerbaijan'' (the Law) and the ''Regulations of the Central Bank on the ratio, calculation and maintaining required reserves'' (the Regulation). According to the Regulation, banks are obliged to maintain required reserves in their correspondent accounts with the Central Bank.</p><p>Rabitbank OJSC failed to meet these obligations during the maintenance period of 15 July 2025 - 14 August 2025 keeping its reserves below the threshold. Pursuant to Article 32 of the Law, the Central Bank imposed a financial sanction of AZN1857.54 (one thousand eight hundred fifty-seven manats and fifty-four gapiks) on Rabitbank OJSC.</p>', 2, 10, '2025-10-01 15:15:08.909403', '2025-10-01 15:15:08.909403', NULL);


