INSERT INTO public."CurrencyCaptionTranslations" VALUES (1, 'Qeyd-1: 02.10.2005-ci il tarixindn etibarn 100 zbkistan somunun, 100 Livan funtunun, 100 Yaponiya yeninin v 100 ran rialnn 1 Azrbaycan manatna qar rsmi mznnlrinin myyn edildiyi nzr alnmaldr. Qeyd-2: 01.01.2006-c il tarixind Azrbaycan manatnn 5000:1 nisbtind denominasiyas hyata keirilmidir. Qeyd-3: 01.07.2016-c il tarixindk 100 Belarus rublunun v 02.10.2005-12.01.2009-cu il tarixlrind 100 Trkmnistan manatnn 1 Azrbaycan manatna qar rsmi mznnlrinin myyn edildiyi nzr alnmaldr. Qeyd-4: 18.11.2024-c il tarixindn etibarn 100 Rus rublunun, 100 Qazaxstan tengsinin v 10.000 ran rialnn 1 Azrbaycan manatna qar rsmi mznnlrinin myyn edildiyi nzr alnmaldr.', 1, 1, '2025-11-21 03:56:58.94574', '2025-11-21 03:56:58.94574', NULL);
INSERT INTO public."CurrencyCaptionTranslations" VALUES (2, 'Note-1: It should be noted that since 02.10.2005, the official exchange rates of 100 Uzbek soms, 100 Lebanese pounds, 100 Japanese yen and 100 Iranian rials were established against 1 Azerbaijani manat. Note-2: On 01.01.2006, the Azerbaijani manat was denominated at a rate of 5000:1. Note-3: It should be noted that until 01.07.2016, the official exchange rates of 100 Belarusian rubles and 100 Turkmen manat were established against 1 Azerbaijani manat from 02.10.2005 to 12.01.2009. Note-4: It should be noted that as of 18.11.2024, the official exchange rates of 100 Russian rubles, 100 Kazakhstani tenge and 10,000 Iranian rials against 1 Azerbaijani manat have been established.', 1, 2, '2025-11-21 03:56:58.945815', '2025-11-21 03:56:58.945815', NULL);


