INSERT INTO public."CustomEditingModeTranslations" VALUES (1, '<p>Xsusi tnzimlm rejimi  innovativ maliyy mhsul v xidmtlrinin real mhit bnzr raitd, lakin mhdud miqyasda v nzart altnda snaqdan keirilmsin imkan vern tnzimlyici rivdir. Azrbaycan Respublikasnn Mrkzi Bank trfindn ttbiq olunan bu rejim, maliyy texnologiyalar (fintex) sahsind innovasiyalarn tviq olunmas, istehlak hquqlarnn qorunmas v maliyy sabitliyinin tmin edilmsi mqsdi dayr.<br><br>Xsusi tnzimlm rejimi rivsind irktlr yeniliki texnologiyalara saslanan mhsullarn tnzimlyici icaz olmadan v ya mvcud qaydalardan myyn drcd azad kild snaqdan keir bilirlr. Bu proses zaman Mrkzi Bank snaqlarn gediin nzart edir, risklrin idar olunmasn tmin edir v nticlr sasn normativ rivnin tkmilldirilmsi il bal qrarlar qbul edir.<br><br>Rejim mracit etmk istyn tkilatlar ffaf v obyektiv seim meyarlarna sasn dyrlndirilir. Qiymtlndirm zaman innovativliyin drcsi, potensial ictimai fayda, risklrin idarolunma imkanlar v snaq plan nzr alnr. Mrkzi Bankn sas mqsdi, hm innovasiyalar tviq etmk, hm d maliyy sistemind risklri idar etmkl sabitliyi qorumaqdr.<br><br>Daha trafl: <a target="_blank" rel="noopener noreferrer" href="https://sandbox.cbar.az/">https://sandbox.cbar.az/</a></p>', 1, 1, '2025-09-26 18:34:52.664807', '2025-09-26 18:34:52.664808', NULL);
INSERT INTO public."CustomEditingModeTranslations" VALUES (2, '<p>A special regulatory regime is a regulatory framework that allows innovative financial products and services to be tested in an environment similar to the real market, but on a limited scale and under supervision. Implemented by the Central Bank of the Republic of Azerbaijan (CBAR), this regime aims to promote innovations in financial technologies (FinTech), protect consumer rights, and ensure financial stability.<br>&nbsp;</p><p>Within the special regulatory regime, companies can test products based on innovative technologies either without a regulatory license or with certain exemptions from existing rules. During this process, the Central Bank monitors the progress of the trials, ensures risk management, and makes decisions to improve the regulatory framework based on the results.<br>&nbsp;</p><p>Organizations wishing to participate in the regime are evaluated based on transparent and objective selection criteria. The assessment considers the degree of innovation, potential public benefit, risk management capabilities, and the testing plan. The main goal of the Central Bank is to foster innovation while managing risks to maintain stability in the financial system.<br><br>For more information: https://sandbox.cbar.az/</p>', 1, 2, '2025-09-26 18:34:52.664848', '2025-09-26 18:34:52.664848', NULL);


