INSERT INTO public."CustomerContactTranslations" VALUES (1, 'Qaynar xtt', 'Mrkzi Bankn966 qaynar xttii gnlrindfasilsizolaraq saat 09:00-dan 18:00-dk daxil olan znglrin cavablandrlmasn hyata keirir. Daxil olan znglrin yerind cavablandrlmas mmkndrs, vtndalarn ifahi mracitlri il laqdar onlara mvafiq izahat verilrk mracitlri cavablandrlr. ks halda znglr cavablandrlmas n mvafiq struktur blmlr v ya daxil olan rsmi yazl mracitlri zr icralara ynldilir.Mrkzi Banka daxil olan znglr telefonu-operatorlar trfindn qbul edilir v btn znglrin qeydiyyat aparlr.', 1, 1, '2025-12-09 01:55:30.657711', '2025-12-09 01:55:30.657712', NULL);
INSERT INTO public."CustomerContactTranslations" VALUES (2, 'Hot line', 'The Central Bank''s "966 hotline" answers incoming calls from 09:00 to 18:00 on business days without interruption. If it is possible to answer incoming calls on the spot, citizens'' verbal appeals are answered by providing them with appropriate explanations. Otherwise, calls are directed to the relevant structural units for answering or to executives on incoming official written appeals. Calls to the Central Bank are received by telephone operators and all calls are registered.', 1, 2, '2025-12-09 01:55:30.657763', '2025-12-09 01:55:30.657763', NULL);
INSERT INTO public."CustomerContactTranslations" VALUES (3, 'laq nmrlri', 'Mrkzi Bankla (+994 12) 493 5058 telefon nmrlri vasitsil laq saxlanlr.', 2, 1, '2025-12-09 01:56:48.55735', '2025-12-09 01:56:48.55735', NULL);
INSERT INTO public."CustomerContactTranslations" VALUES (4, 'Contact numbers', 'The Central Bank can be contacted via the phone number (+994 12) 493 5058.', 2, 2, '2025-12-09 01:56:48.557353', '2025-12-09 01:56:48.557353', NULL);
INSERT INTO public."CustomerContactTranslations" VALUES (5, 'Whatsapp', 'Aada qeyd olunan istiqamtlr zr Mrkzi Bankn 055-966-19-66 nmrli whatsapp xidmtindn (xidmt) istifad edil bilr:', 3, 1, '2025-12-09 01:58:08.373772', '2025-12-09 01:58:08.373772', NULL);
INSERT INTO public."CustomerContactTranslations" VALUES (6, 'Whatsapp', 'The Central Bank''s WhatsApp service at 055-966-19-66 can be used for the following purposes:', 3, 2, '2025-12-09 01:58:08.373774', '2025-12-09 01:58:08.373774', NULL);
