INSERT INTO public."DirectorDetailTranslations" VALUES (11, 'Karyera', '<p><strong>2004-c </strong>ildn Maliyy sektorunda pekar faliyytin balam, 2006-c ildk "Bank Standard" QSC-d mxtlif vziflrd ilmidir.<br><br><strong>2006-2007-ci </strong>illrd "Ernst &amp; Young" irktind auditor vzifsini tutmudur. 2007-ci ilin yanvar ayndan aprel aynadk "Fineko Analitika v nformasiya Agentliyi" ASC-nin ba direktoru vzifsind almdr.</p><p>&nbsp;</p><p><strong>2007-ci </strong>ilin iyul ayndan PAA Bank" ASC-d Risklrin idaredilmsi departamentinin meneceri vzifsind ilmi, 2009-cu ildn is Bankn Xzindarlq v pul bazar departamentinin direktoru vzifsini tutmudur.</p><p>&nbsp;</p><p><strong>2011-ci </strong>ilin dekabr aynda "PAA Bank" ASC-nin dar Heytinin zv seilmidir.</p><p>&nbsp;</p><p><strong>2015-2022-ci </strong>illrd "PAA Bank" ASC-nin dar Heytinin sdri v Ba icra direktoru vzifsini icra etmidir.</p><p>&nbsp;</p><p><strong>2022-ci </strong>ilin aprel aynn 12-dn Azrbaycan Respublikas Milli Mclisinin qrar il Azrbaycan Respublikas Mrkzi Bank dar Heytinin zv vzifsin tyin edilmidir.</p><p>&nbsp;</p><p>Azrbaycan Respublikas Prezidentinin&nbsp;<strong>13 aprel 2022-ci</strong> il&nbsp;tarixli Srncam il Mrkzi Bankn sdri vzifsin tyin edilmidir.</p>', 1, 1, '2025-10-01 03:42:45.617624', '2025-10-01 03:42:45.617625', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (12, 'Career', 'He started his professional activity in the financial sector in 2004 and worked in various positions at Bank Standard CJSC until 2006. In 2006-2007, he held the position of auditor at Ernst & Young. From January to April 2007, he worked as the General Director of Fineko Analytics and Information Agency OJSC. Since July 2007, he has worked as a Manager of the Risk Management Department at "PASHA Bank" OJSC, and since 2009, he has held the position of Director of the Treasury and Money Market Department of the Bank. In December 2011, he was elected a member of the Board of Directors of "PASHA Bank" OJSC. In 2015-2022, he served as the Chairman of the Board of Directors and Chief Executive Officer of "PASHA Bank" OJSC. Since April 12, 2022, by the decision of the Milli Majlis of the Republic of Azerbaijan, he has been appointed a member of the Board of Directors of the Central Bank of the Republic of Azerbaijan. By the Decree of the President of the Republic of Azerbaijan dated April 13, 2022, he has been appointed Chairman of the Central Bank.', 1, 2, '2025-10-01 03:42:45.617709', '2025-10-01 03:42:45.617709', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (25, 'Doum tarixi', '<p><strong>1977</strong>-ci ild Bak hrind anadan olmudur. Azrbaycanldr. Ali thsillidir.</p>', 9, 1, '2025-10-02 06:54:23.423019', '2025-10-02 06:54:23.423019', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (26, 'Born', '<p>He was born in Baku in <strong>1977</strong>. He is Azerbaijani and holds a higher education degree.</p>', 9, 2, '2025-10-02 06:54:23.423023', '2025-10-02 06:54:23.423023', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (27, 'Thsil', '<p><strong>1998</strong>-ci ild Azrbaycan Dvlt qtisad nstitutunu qtisad ixtisas zr frqlnm diplomu il, 2008-ci ild is Byk Britaniyann Nottingem Universitetini MBA ixtisas zr frqlnm diplomu il bitirmidir.</p>', 10, 1, '2025-10-02 06:54:43.773042', '2025-10-02 06:54:43.773042', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (28, 'Education', '<p>He graduated with honors in Economics from the Azerbaijan State University of Economics in <strong>1998 </strong>and earned his MBA with distinction from the University of Nottingham, United Kingdom, in 2008.</p>', 10, 2, '2025-10-02 06:54:43.773045', '2025-10-02 06:54:43.773045', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (31, 'Karyera', '<p><strong>1999</strong>-cu ildn 2000-ci ildk hqiqi hrbi xidmtd olmudur.<br>&nbsp;</p><p><strong>2001-2004</strong>-c illrd Azrbaycan Respublikas Milli Banknn Kredit tkilatlarnn faliyytin nzart departamentinin 3 N-li nzart bsind iqtisad, aparc iqtisad vziflrind ilmidir.<br>&nbsp;</p><p><strong>2004-2006</strong>-c illrd AR Milli Banknn Kredit tkilatlarnn faliyytin nzart departamentinin Xarici nzart bsinin trkibind olan Pullarn yuyulmasna qar faliyyt qrupunun rhbri vzifsind ilmidir.<br>&nbsp;</p><p><strong>2006-2007</strong>-ci illrd AR Milli Banknn Kredit tkilatlarnn faliyytin nzart departamentinin Xarici nzart bsinin risi vzifsind ilmidir.<br>&nbsp;</p><p><strong>2012</strong>-ci ilin fevral aynda Azrbaycan Respublikasnda bank iinin inkiaf etdirilmsindki xidmtin gr Trqqi medal il tltif edilmidir.<br>&nbsp;</p><p><strong>2008-2016</strong>-c illrd AR Mrkzi Banknn Kredit tkilatlarnn faliyytin nzart departamentinin direktor mavini, departament direktoru vziflrind ilmidir.<br>&nbsp;</p><p><strong>2016</strong>-c ilin may ayndan Azrbaycan Respublikas Mrkzi Bank sdrinin maviri vzifsin tyin edilmidir.&nbsp;<br>&nbsp;</p><p><strong>2017</strong>-ci ilin sentyabr ayndan 2019-cu ilin aprel aynadk Azrbaycan mantlrin Sortalanmas Fondunun Himayilik urasnn sdri vzifsind ilmidir.<br>&nbsp;</p><p><strong>2022</strong>-ci ilin may aynn 31-dn Azrbaycan Respublikas Milli Mclisinin qrar il Azrbaycan Respublikas Mrkzi Bank dar Heytinin zv vzifsin tyin edilmidir.<br>&nbsp;</p><p><strong>2022</strong>-ci il iyun ayndan <strong>2024-c </strong>ilin dekabr aynadk Azrbaycan Respublikas Mrkzi Bank sdrinin mavini&nbsp;vzifsind ilmidir.<br>&nbsp;</p><p>Azrbaycan Respublikas Prezidentinin&nbsp;<strong>4 dekabr 2024-c il</strong>&nbsp;tarixli Srncam il Mrkzi Bankn sdrinin birinci mavini vzifsin tyin edilmidir.</p>', 11, 1, '2025-10-02 06:55:49.019018', '2025-10-02 06:55:49.019018', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (32, 'Career', '<p>From <strong>1999</strong> to 2000, he served in active military service.<br>&nbsp;</p><p>From <strong>2001 to 2004</strong>, he worked as an Economist and Senior Economist at the Supervision Department No. 3 for Credit Institutions of the Central Bank of the Republic of Azerbaijan.<br>&nbsp;</p><p>From <strong>2004 to 2006</strong>, he served as Head of the Anti-Money Laundering Unit within the External Supervision Division of the Supervision Department for Credit Institutions of the Central Bank.<br>&nbsp;</p><p>From <strong>2006 to 2007</strong>, he held the position of Head of the External Supervision Division of the Supervision Department for Credit Institutions of the Central Bank.<br>&nbsp;</p><p>In<strong> February 2012</strong>, he was awarded the Progress Medal for his services in the development of banking in the Republic of Azerbaijan.<br>&nbsp;</p><p>From<strong> 2008 to 2016</strong>, he served as Deputy Director and later as Director of the Supervision Department for Credit Institutions of the Central Bank of the Republic of Azerbaijan.<br>&nbsp;</p><p>In <strong>May 2016</strong>, he was appointed Advisor to the Chairman of the Central Bank of the Republic of Azerbaijan.<br>&nbsp;</p><p>From<strong> September 2017 to April 2019</strong>, he served as Chairman of the Supervisory Board of the Deposit Insurance Fund of Azerbaijan.<br>&nbsp;</p><p>On <strong>May 31, 2022</strong>, by the decision of the National Assembly of the Republic of Azerbaijan, he was appointed as a Member of the Board of the Central Bank of Azerbaijan.<br>&nbsp;</p><p>From <strong>June 2022 to December 2024</strong>, he served as Deputy Chairman of the Central Bank of the Republic of Azerbaijan.<br>&nbsp;</p><p>By the Decree of the President of the Republic of Azerbaijan dated<strong> December 4, 2024</strong>, he was appointed First Deputy Chairman of the Central Bank of Azerbaijan.</p>', 11, 2, '2025-10-02 06:55:49.01902', '2025-10-02 06:55:49.01902', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (35, 'Doum tarixi', '<p><strong>1983</strong>-c ild Bak hrind anadan olmudur. Azrbaycanldr. Ali thsillidir.</p>', 5, 1, '2025-10-02 07:05:01.623858', '2025-10-02 07:05:01.623858', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (36, 'Born', '<p>He was born in Baku in <strong>1983</strong>. He is Azerbaijani and holds a higher education degree.</p>', 5, 2, '2025-10-02 07:05:01.623861', '2025-10-02 07:05:01.623861', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (54, 'Born', '<p>He was born in Baku in <strong>1983</strong>. He is Azerbaijani and holds a higher education degree.</p>', 16, 2, '2025-10-02 07:29:56.488348', '2025-10-02 07:29:56.488348', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (55, 'Thsil', '<p><strong>2004</strong>-c ild Bak Dvlt Universitetini Hquqnaslq ixtisas zr bakalavr drcsil bitirmidir.<br>&nbsp;</p><p><strong>2023</strong>-c ild Byk Britaniyann effild Universitetini Biznesin idar edilmsi ixtisas zr magistr drcsi il bitirmidir.</p>', 17, 1, '2025-10-02 07:31:18.904786', '2025-10-02 07:31:18.904786', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (37, 'Thsil', '<p><strong>2004-c </strong>ild Azrbaycan Texniki Universitetini "Avtomatika v kompter mhndisliyi" ixtisas zr bakalavr drcsini, 2006-c ild Azrbaycan Dvlt Neft Akademiyasnn&nbsp;AB-n&nbsp;Corciya tat Universiteti&nbsp;il birg proqram rivsind maliyy ixtisas zr "Biznesin idar edilmsi (MBA)" magistr drcsini, 2012-ci ild&nbsp;London Biznes Mktbinin&nbsp;v 2014-c ild&nbsp;Harvard Biznes Mktbinin&nbsp;idarilr n xsusi proqramlarn bitirmidir.</p>', 6, 1, '2025-10-02 07:05:58.34458', '2025-10-02 07:05:58.34458', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (38, 'Education', '<p>He earned his Bachelor''s degree in Automation and Computer Engineering from Azerbaijan Technical University in <strong>2004</strong>. In 2006, he obtained his MBA in Finance through a joint program between Azerbaijan State Oil Academy and Georgia State University, USA. He also completed executive programs at London Business School in 2012 and at Harvard Business School in 2014.</p>', 6, 2, '2025-10-02 07:05:58.344582', '2025-10-02 07:05:58.344582', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (39, 'Karyera', '<p><strong>2004-c </strong>ildn Maliyy sektorunda pekar faliyytin balam, 2006-c ildk "Bank Standard" QSC-d mxtlif vziflrd ilmidir.</p><p>&nbsp;</p><p><strong>2006-2007-ci </strong>illrd "Ernst &amp; Young" irktind auditor vzifsini tutmudur. 2007-ci ilin yanvar ayndan aprel aynadk "Fineko Analitika v nformasiya Agentliyi" ASC-nin ba direktoru vzifsind almdr.</p><p>&nbsp;</p><p><strong>2007-ci </strong>ilin iyul ayndan PAA Bank" ASC-d Risklrin idaredilmsi departamentinin meneceri vzifsind ilmi, 2009-cu ildn is Bankn Xzindarlq v pul bazar departamentinin direktoru vzifsini tutmudur.</p><p>&nbsp;</p><p><strong>2011-ci </strong>ilin dekabr aynda "PAA Bank" ASC-nin dar Heytinin zv seilmidir.</p><p>&nbsp;</p><p><strong>2015-2022-ci </strong>illrd "PAA Bank" ASC-nin dar Heytinin sdri v Ba icra direktoru vzifsini icra etmidir.</p><p>&nbsp;</p><p><strong>2022-ci </strong>ilin aprel aynn 12-dn Azrbaycan Respublikas Milli Mclisinin qrar il Azrbaycan Respublikas Mrkzi Bank dar Heytinin zv vzifsin tyin edilmidir.</p><p>&nbsp;</p><p>Azrbaycan Respublikas Prezidentinin&nbsp;<strong>13 aprel 2022-ci</strong> il&nbsp;tarixli Srncam il Mrkzi Bankn sdri vzifsin tyin edilmidir.</p>', 7, 1, '2025-10-02 07:10:25.517144', '2025-10-02 07:10:25.517144', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (40, 'Career', '<p>He began his professional career in the financial sector in <strong>2004</strong>, working in various positions at Bank Standard OJSC until 2006.<br>&nbsp;</p><p>From <strong>2006 to 2007</strong>, he served as an Auditor at Ernst &amp; Young.<br>&nbsp;</p><p>From <strong>January to April 2007</strong>, he worked as Chief Executive Officer at Fineko Analytics and Information Agency CJSC.<br>&nbsp;</p><p>From <strong>July 2007</strong>, he joined PAA Bank OJSC as Manager of the Risk Management Department and, from 2009, served as Director of the Treasury and Money Market Department.<br>&nbsp;</p><p>In <strong>December 2011</strong>, he was elected as a Member of the Board of PAA Bank OJSC.<br>&nbsp;</p><p>From <strong>2015 to 2022</strong>, he served as Chairman of the Board and Chief Executive Officer of PAA Bank OJSC.<br>&nbsp;</p><p>On <strong>April 12, 2022</strong>, by the decision of the National Assembly of the Republic of Azerbaijan, he was appointed as a Member of the Board of the Central Bank of the Republic of Azerbaijan.<br>&nbsp;</p><p>By the Decree of the President of the Republic of Azerbaijan dated <strong>April 13, 2022</strong>, he was appointed as Chairman of the Central Bank of Azerbaijan.</p>', 7, 2, '2025-10-02 07:10:25.517148', '2025-10-02 07:10:25.517148', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (41, 'Hyat', '<p>Aillidir, 2 vlad var.</p>', 8, 1, '2025-10-02 07:11:14.923327', '2025-10-02 07:11:14.923327', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (42, 'Personal Life', '<ul><li>Married with 2 children.</li></ul>', 8, 2, '2025-10-02 07:11:14.923328', '2025-10-02 07:11:14.923328', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (43, 'Doum tarixi', '<p><strong>1982</strong>-ci ild Naxvan hrind anadan olmudur. Azrbaycanldr. Ali thsillidir.</p>', 12, 1, '2025-10-02 07:17:33.171653', '2025-10-02 07:17:33.171653', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (44, 'Born', '<p>He was born in Nakhchivan in <strong>1982</strong>. He is Azerbaijani and holds a higher education degree.</p>', 12, 2, '2025-10-02 07:17:33.171655', '2025-10-02 07:17:33.171655', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (45, 'Thsil', '<p><strong>2004</strong>-c ild Trkiy Cumhuriyytinin Qazi Universitetini qtisadiyyat ixtisas zr bakalavr drcsi il, <strong>2006</strong>-c ild Odlar Yurdu v AB-n Corciya dvlt universitetinin birg proqram olan Biznesin idar olunmas ixtisas zr MBA proqramn magistr drcsi il, <strong>2014</strong>-c ild is AB Cons Hopkins Universitetini Dvlt siyasti zr beynlxalq magistr drcsi il bitirmidir.</p>', 13, 1, '2025-10-02 07:19:27.038265', '2025-10-02 07:19:27.038265', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (46, 'Education', '<p>He earned his Bachelor''s degree in Economics from Gazi University, Turkey, in <strong>2004</strong>. In <strong>2006</strong>, he obtained his MBA in Business Administration through a joint program between Odlar Yurdu University and Georgia State University, USA. In <strong>2014</strong>, he completed his Master''s degree in International Public Policy at Johns Hopkins University, USA.</p>', 13, 2, '2025-10-02 07:19:27.038266', '2025-10-02 07:19:27.038266', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (47, 'Karyera', '<p>mk faliyytin Mrkzi Bankda <strong>2004</strong>-c ilin avqust aynda Monetar siyast departamentinin Monetar thlil v proqnozladrma bsind iqtisad vzifsind balamdr. <strong>2005</strong>-ci ilin iyul aynda qtisadi tdqiqatlar v proqnozladrma departamentinin Maliyy proqramlamas bsind iqtisad vzifsin tyin edilmidir.<br>&nbsp;</p><p><strong>2006-2008</strong>-ci illrd Azrbaycan Respublikas Milli Banknda Tdqiqatlar v statistika departamentinin qtisadi tdqiqatlar v proqnozladrma bsind iqtisad, aparc iqtisad vziflrind ilmidir.<br>&nbsp;</p><p><strong>2008-2011</strong>-ci illrd Azrbaycan Respublikas Milli Banknda Bazar mliyyatlar departamentinin Risklrin idar edilmsi bsind byk analitik vzifsind, <strong>2013</strong>-c ilin avqust aynadk is hmin departamentin Risklrin idar edilmsi bsinin risi vzifsind ilmidir.<br>&nbsp;</p><p><strong>2013-</strong>c ilin avqust ayndan <strong>2014</strong>-c ilin iyun aynadk AB-n Cons Hopkins Universitetind thsil almdr.<br>&nbsp;</p><p><strong>2014-2015</strong>-ci illrd Mrkzi Bankda Bazar mliyyatlar departamentinin Risklrin idar edilmsi bsinin risi vzifsind ilmidir. <strong>2015</strong>-ci ilin iyun ayndan hmin departamentin direktor mavini  Risklrin idar edilmsi bsinin risi vzifsind, <strong>2016</strong>-c ilin aprel ayndan <strong>2020</strong>-ci ilin yanvar aynadk Bazar mliyyatlar departamentinin direktoru vzifsind ilmidir.<br>&nbsp;</p><p><strong>2019-</strong>cu ilin sentyabr aynda Azrbaycanda mrkzi bankln yaranmasnn 100 illiyi mnasibtil v bank iinin inkiaf etdirilmsindki xidmtin gr Trqqi medal il tltif edilmidir.<br>&nbsp;</p><p><strong>2020</strong>-ci ilin yanvar ayndan <strong>2024</strong>-c ilin noyabr aynadk Mrkzi Bankn ba direktoru vzifsind ilmidir.<br>&nbsp;</p><p><strong>2024</strong>-ci ilin noyabr aynn 7-dn Azrbaycan Respublikas Milli Mclisinin qrar il Azrbaycan Respublikas Mrkzi Bank dar Heytinin zv vzifsin tyin edilmidir.<br>&nbsp;</p><p>Azrbaycan Respublikas Prezidentinin&nbsp;<strong>4 dekabr 2024-c il</strong>&nbsp;tarixli Srncam il Mrkzi Bankn sdrinin mavini vzifsin tyin edilmidir.</p>', 14, 1, '2025-10-02 07:26:00.818657', '2025-10-02 07:26:00.818657', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (48, 'Career', '<p>He began his professional career at the Central Bank in August <strong>2004 </strong>as an Economist in the Monetary Analysis and Forecasting Department of the Monetary Policy Division. In July <strong>2005</strong>, he was appointed Economist in the Financial Programming Department of the Economic Research and Forecasting Division.<br>&nbsp;</p><p>From <strong>2006 </strong>to <strong>2008</strong>, he served as Economist and Senior Economist in the Economic Research and Forecasting Division of the Research and Statistics Department at the Central Bank of the Republic of Azerbaijan.<br>&nbsp;</p><p>From <strong>2008 </strong>to <strong>2011</strong>, he worked as Senior Analyst in the Risk Management Department of the Market Operations Division, and until August <strong>2013</strong>, he served as Head of the Risk Management Department of the same division.<br>&nbsp;</p><p>From August <strong>2013 </strong>to June <strong>2014</strong>, he pursued studies at Johns Hopkins University, USA.<br>&nbsp;</p><p>From <strong>2014 </strong>to <strong>2015</strong>, he continued as Head of the Risk Management Department in the Market Operations Division. From June <strong>2015</strong>, he served as Deputy Director  Head of the Risk Management Department, and from April <strong>2016 </strong>to January <strong>2020</strong>, he was Director of the Market Operations Division.<br>&nbsp;</p><p>In September <strong>2019</strong>, he was awarded the Progress Medal on the occasion of the 100th anniversary of central banking in Azerbaijan and for his contributions to the development of the banking sector.<br>&nbsp;</p><p>From January <strong>2020 </strong>to November <strong>2024</strong>, he served as Chief Director of the Central Bank.<br>&nbsp;</p><p>On November 7, <strong>2024</strong>, by the decision of the National Assembly of the Republic of Azerbaijan, he was appointed as a Member of the Board of the Central Bank of Azerbaijan.<br>&nbsp;</p><p>By the Decree of the President of the Republic of Azerbaijan dated December 4, <strong>2024</strong>, he was appointed as Deputy Chairman of the Central Bank of Azerbaijan.</p>', 14, 2, '2025-10-02 07:26:00.818665', '2025-10-02 07:26:00.818665', NULL);
