INSERT INTO public."DirectorDetailTranslations" VALUES (56, 'Education', '<p><strong>2004</strong> Bachelor of Law, Baku State University.<br>&nbsp;</p><p><strong>2023 </strong>Master''s degree,&nbsp;''Business management-EMBA'', University of Sheffield.</p>', 17, 2, '2025-10-02 07:31:18.904788', '2025-10-02 07:31:18.904788', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (57, 'Karyera', '<p>mk faliyytin <strong>2005</strong>-ci ild Azrbaycan Respublikasnn dliyy Nazirliyind balam, mslhti, aparc mslhti v ba mslhti vziflrind almdr.<br>&nbsp;</p><p><strong>2008-2009</strong>-cu illrd Azrbaycan Respublikas Mrkzi Banknn Kredit tkilatlarnn faliyytin nzart departamentinin Pullarn yuyulmasna qar faliyyt bsind byk mtxssis vzifsind faliyytini davam etdirmidir.<br>&nbsp;</p><p><strong>2009-2012</strong>-ci illrd Azrbaycan Respublikasnn Mrkzi Bank yannda Maliyy Monitorinqi Xidmtind Mlumatlarn emal bsinin risi vzifsind ilmidir.<br>&nbsp;</p><p><strong>2012</strong>-ci ilin aprel aynda Mrkzi Bankn Kredit tkilatlarnn faliyytin nzart departamentinin Daxili Nzart bsinin risi vzifsin tyin edilmidir.<br>&nbsp;</p><p><strong>2013-2019</strong>-cu illrd Mrkzi Bankn Risklrin idar edilmsi departamentinin direktoru vzifsind ilmidir.<br>&nbsp;</p><p><strong>2019-2024</strong>-c illrd Azrbaycan mantlrin Sortalanmas Fondunun Himayilik urasnn sdri olaraq faliyyt gstrmidir.<br>&nbsp;</p><p><strong>2020</strong>-ci ilin yanvar ayndan <strong>2024</strong>-c ilin noyabr aynadk Mrkzi Bankn ba direktoru vzifsind ilmidir.<br>&nbsp;</p><p><strong>2024</strong>-ci ilin noyabr aynn 7-dn Azrbaycan Respublikas Milli Mclisinin qrar il Azrbaycan Respublikas Mrkzi Bank dar Heytinin zv vzifsin tyin edilmidir.<br>&nbsp;</p><p>Azrbaycan Respublikas Prezidentinin&nbsp;<strong>4 dekabr 2024-c il</strong>&nbsp;tarixli Srncam il Mrkzi Bankn sdrinin mavini vzifsin tyin edilmidir.</p>', 18, 1, '2025-10-02 07:34:25.051568', '2025-10-02 07:34:25.051568', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (58, 'Career', '<p>Professional career:&nbsp;<br><br><strong>2005</strong>, <strong>February</strong> Specialist, Ministry of Justice.<br>&nbsp;</p><p><strong>2005-2007</strong> Leading Consultant, Ministry of Justice.<br>&nbsp;</p><p><strong>2007-2008</strong> Senior Consultant, Ministry of Justice.<br>&nbsp;</p><p><strong>2008-2009</strong> Senior specialist, Anti-money Laundering Division, Credit Institutions Supervision Department, National Bank of the Republic of Azerbaijan.<br>&nbsp;</p><p><strong>2009-2012</strong> Head of Information Processing Division, Financial Monitoring Service under the Central Bank of the Republic of Azerbaijan.<br>&nbsp;</p><p><strong>2012, April  2013, January</strong> Head of Onsite Supervision Division, Credit Institutions Supervision Department, Central Bank of the Republic of Azerbaijan.<br>&nbsp;</p><p><strong>2013  2019</strong> Director, Risk Management Department, Central Bank of the Republic of Azerbaijan.<br>&nbsp;</p><p><strong>2019 - 2024</strong>&nbsp;Chairman of the Board of Trustees of the Azerbaijan Deposit Insurance Fund<br>&nbsp;</p><p><strong>2020, January  2024, November </strong>Executive Director, Central Bank of the Republic of Azerbaijan.<br>&nbsp;</p><p><strong>2024, November 7</strong>&nbsp;Member of the Management Board of the Central Bank of the Republic of Azerbaijan at the decision of the Milli Majlis of the Republic of Azerbaijan<br>&nbsp;</p><p><strong>2024, December 4</strong> Deputy Governor of the Central Bank of the Republic of Azerbaijan at the Decree of the President of the Republic of Azerbaijan.</p>', 18, 2, '2025-10-02 07:34:25.051581', '2025-10-02 07:34:25.051581', NULL);
