INSERT INTO public."DirectorDetailTranslations" VALUES (62, 'Born', '<p><strong>1989</strong>, Baku city, Azerbaijani.</p>', 20, 2, '2025-10-02 07:37:06.021126', '2025-10-02 07:37:06.021126', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (63, 'Thsil', '<p><strong>2010</strong>-cu ild Bak Dvlt Universitetinin Beynlxalq hquq ixtisas zr bakalavr drcsini, <strong>2012</strong>-ci ild hmin universitetin Kommersiya hququ ixtisas zr magistr drcsini frqlnm diplomlar il bitirmidir.<br><br><strong>2021</strong>-ci ild is Byk Britaniyann daretm zr xtisaslam nstitutunun (The Chartered Governance Institute) daretm pekarlar n ixtisaslama proqramn bitirmidir.</p>', 21, 1, '2025-10-02 07:38:19.214744', '2025-10-02 07:38:19.214744', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (64, 'Education', '<p><strong>2010</strong> Baku State University, Bachelor''s degree in International Law, Honors diploma<br>&nbsp;</p><p><strong>2012</strong> Baku State University, Master''s degree in Commercial Law, Honors diploma<br>&nbsp;</p><p><strong>2021</strong> Chartered Governance Institute UK &amp; Ireland, Chartered Governance Qualifying Programme, GradCG</p>', 21, 2, '2025-10-02 07:38:19.214745', '2025-10-02 07:38:19.214745', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (65, 'Karyera', '<p>mk faliyytin <strong>2011</strong>-ci ild PAA Bank ASC-d Port Baku bsinin kassiri vzifsil balam, <strong>2012</strong>-ci ilin yanvar-avqust aylarnda Bankn Korporativ sndlrl  v protokol tminat departamentinin icras, <strong>2012-2013</strong>-c illrd Hquq v tkilati ilr departamentin Korporativ katiblik bsinin kolleqial orqanlar il i zr koordinatoru, <strong>2013-2015</strong>-ci illrd hmin departamentin Hquq bsinin hquq mslhtisi, <strong>2015-2021</strong>-ci illrd Korporativ katiblik bsinin rhbri, <strong>2021-2022</strong>-ci illrd Korporativ idaretm v inzibatlq departamentinin direktoru vziflrind almdr.<br>&nbsp;</p><p><strong>2022</strong>-ci ilin iyun aynda Azrbaycan Respublikas Mrkzi Banknda sdrin maviri vzifsin tyin edilmidir.<br>&nbsp;</p><p><strong>2022</strong>-ci ilin iyun-iyul aylarnda Azrbaycan Respublikas Mrkzi Bankn sdrinin maviri vzifsind ilmidir.<br>&nbsp;</p><p><strong>2022</strong>-ci ilin iyul ayndan <strong>2024</strong>-c ilin noyabr aynadk Mrkzi Bankn ba direktoru vzifsind ilmidir.<br>&nbsp;</p><p><strong>2024</strong>-ci ilin noyabr aynn 7-dn Azrbaycan Respublikas Milli Mclisinin qrar il Azrbaycan Respublikas Mrkzi Bank dar Heytinin zv vzifsin tyin edilmidir.<br>&nbsp;</p><p>Azrbaycan Respublikas Prezidentinin&nbsp;<strong>4 dekabr 2024-c il</strong>&nbsp;tarixli Srncam il Mrkzi Bankn sdrinin mavini vzifsin tyin edilmidir.</p>', 22, 1, '2025-10-02 07:40:43.873479', '2025-10-02 07:40:43.873479', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (66, 'Career', '<p><strong>2011</strong> Cashier, Port Baku branch, PASHA Bank OJSC,<br>&nbsp;</p><p><strong>2012</strong>, January-August, Specialist, Department of Corporate Document Handling and Protocol Provision, PASHA Bank OJSC,<br>&nbsp;</p><p><strong>2012-2013</strong> Coordinator on the Work with Collegial Bodies, Corporate Secretary Division of Legal and Organizational Department, PASHA Bank OJSC,<br>&nbsp;</p><p><strong>2013-2015</strong> Legal Advisor, Legal Division, Legal and Organizational Department, PASHA Bank OJSC<br>&nbsp;</p><p><strong>2015-2021</strong> Head of the Corporate Secretary Division, PASHA Bank OJSC<br>&nbsp;</p><p><strong>2021-2022</strong> Director, the Corporate Governance and Administration Department, PASHA Bank OJSC<br>&nbsp;</p><p><strong>2022</strong>, <strong>June</strong> Advisor to the Governor of the Central Bank of the Republic of Azerbaijan<br>&nbsp;</p><p><strong>2022, June  July </strong>Advisor to the Governor of the Central Bank of the Republic of Azerbaijan.<br>&nbsp;</p><p><strong>2022, July  2024, November </strong>Executive Director of the Central Bank of the Republic of Azerbaijan.<br>&nbsp;</p><p><strong>2024, November 7</strong> Member of the Management Board of the Central Bank of the Republic of Azerbaijan at the decision of the Milli Majlis of the Republic of Azerbaijan<br>&nbsp;</p><p><strong>2024, December 4</strong> Deputy Governor of the Central Bank of the Republic of Azerbaijan at the Decree of the President of the Republic of Azerbaijan.</p>', 22, 2, '2025-10-02 07:40:43.87348', '2025-10-02 07:40:43.87348', NULL);
