INSERT INTO public."DirectorDetailTranslations" VALUES (71, 'Thsil', '<p><strong>2008</strong>-ci ild Bak Dvlt Universitetini nformatika ixtisas zr bakalavr<strong>, 2011</strong>-ci ild is hmin universiteti eyni ixtisas zr magistr drclri il bitirmidir.<br><br><strong>2015</strong>-ci ild ADA Universiteti v Maastricth School of Management birg EMBA proqramna daxil olmudur, <strong>2017</strong>-ci ild hmin universitetlri Beynlxalq Biznesin daredilmsi ixtisas zr magistr drcsil bitirmidir.</p><p>&nbsp;</p><p><strong>2020</strong>-ci ild Kopenhagen Biznes Mktbinin Maliyy Sektorunda Rqmsal Transformasiya, <strong>2021</strong>-ci ild is Harvard Business School-un Biznes Analizi, Mhasibatlq v darednlr n qdisadiyyat istiqamtlrind xsusi kurslarda thsilini davam etdirmkl mvafiq sertifikatlar ld etmidir. O, hminin <strong>2014</strong>-c ild Oracle irktinin tkilatn arxitekturas zr OCM sertifikatna da yiylnmidir.</p><p>&nbsp;</p><p><strong>2024</strong>-c ildn ngiltrnin London Metropolitan Universitetind Ttbiqi Psixologiya ixtisasn magistr drcsi zr thsilini davam etdirir.</p>', 25, 1, '2025-10-02 07:44:50.247721', '2025-10-02 07:44:50.247721', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (72, 'Education', '<p><strong>2008 </strong> the Baku State University, Bachelor''s degree in Informatics.<br>&nbsp;</p><p><strong>2011</strong>  the Baku State University, Master degree in Informatics.<br>&nbsp;</p><p><strong>2015 </strong> <strong>2017 </strong>the EMBA joint program of ADA University and Maastricth School of Management, Master degree in International Business Management.<br>&nbsp;</p><p><strong>2020 </strong> Kopenhagen Business School, a course in Digital Transformation in the Financial Sector.<br>&nbsp;</p><p><strong>2021 </strong> Harvard Business School, a course in Business Analytics, Economics for Managers, Financial Accounting.</p><p>OCM certificate on the organizational architecture of the Oracle<br>&nbsp;</p><p><strong>2024 </strong> up to now  the London Metropolitan University, Master degree in Applied Psychology.</p>', 25, 2, '2025-10-02 07:44:50.247722', '2025-10-02 07:44:50.247722', NULL);
