INSERT INTO public."DirectorDetailTranslations" VALUES (74, 'Personal Life', '<p>Married with 3 children.</p>', 26, 2, '2025-10-02 07:45:15.604166', '2025-10-02 07:45:15.604166', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (75, 'Karyera', '<p>mk faliyytin <strong>2009</strong>-cu ild ICL MMC-d texniki mtxssis vzifsil balamdr.</p><p>&nbsp;</p><p><strong>2010-2011</strong>-ci illrd nfosecurity MMC-d aparc veb-proqram vzifsind almdr.</p><p>&nbsp;</p><p><strong>2011-2016</strong>-c illrd Azercell Telekom MMC-d nformasiya Kommunikasiya Texnologiyalar departamentind kiik proqram, proqram, aparc proqram, <strong>2016-2018</strong>-ci illrd is hmin irktd Mhsul v Xidmtin Yaradlmas blmsinin rhbri vziflrind almdr.<br>&nbsp;</p><p><strong>2018-2020</strong>-ci illrd PAA Bank ASC-d Rqmsal Laboratoriya departamentinin Rqmsal Mhndislik bsinin rhbri vzifsind almdr. <strong>2021</strong>-ci ilin yanvar ayndan <strong>2024</strong>-c ilin may aynadk hmin bankn Texnologiya blokunun ba direktoru vzifsind ilmidir.<br>&nbsp;</p><p><strong>2024</strong>-c ilin may-noyabr aylarnda Azrbaycan Respublikas Mrkzi Bankn ba direktoru vzifsind ilmidir.<br>&nbsp;</p><p><strong>2024</strong>-ci ilin noyabr aynn 7-dn Azrbaycan Respublikas Milli Mclisinin qrar il Azrbaycan Respublikas Mrkzi Bank dar Heytinin zv vzifsin tyin edilmidir.<br>&nbsp;</p><p>Azrbaycan Respublikas Prezidentinin&nbsp;<strong>4 dekabr 2024-c il</strong>&nbsp;tarixli Srncam il Mrkzi Bankn sdrinin mavini vzifsin tyin edilmidir.</p>', 27, 1, '2025-10-02 07:47:49.629467', '2025-10-02 07:47:49.629467', NULL);
INSERT INTO public."DirectorDetailTranslations" VALUES (76, 'Career', '<p><strong>2009 </strong> Technical Specialist, the ICL LLC.<br>&nbsp;</p><p><strong>2010-2011 </strong> Web programmer, the Infosecurity LLC.<br>&nbsp;</p><p><strong>2011-2016  </strong>Junior Programmer, Programmer, Leading Programmer, the Azercell Telekom LLC.<br>&nbsp;</p><p><strong>2016-2018 </strong> Head of the Product and Service Development Unit, the Azercell Telecom.<br>&nbsp;</p><p><strong>2018-2020 </strong> Head of the Digital Engineering Division of the Digital Lab Department of the Pasha Bank OJSC, <strong>January, 2021  May, 2024 </strong> Chief Technology Officer, the Pasha Bank OJSC.<br>&nbsp;</p><p><strong>2024, May  November </strong>Executive Director, Central Bank of the Republic of Azerbaijan.<br>&nbsp;</p><p><strong>2024, November 7 </strong>Member of the Management Board of the Central Bank of the Republic of Azerbaijan at the decision of the Milli Majlis of the Republic of Azerbaijan.<br>&nbsp;</p><p><strong>2024, December 4</strong> Deputy Governor of the Central Bank of the Republic of Azerbaijan at the Decree of the President of the Republic of Azerbaijan.</p>', 27, 2, '2025-10-02 07:47:49.629468', '2025-10-02 07:47:49.629468', NULL);
