INSERT INTO public."EKYCTranslations" VALUES (1, '<p>Maliyy sektorunun inkiaf Strategiyasnn tdbirlr planna uyun olaraq maliyy sektorunda z mtrini tan yanamasnn effektiv ttbiq edilmsi mqsdil Paylanlm - z mtrini tan platformasnn (bundan sonra Paylanlm EKYC) yaradlmas nzrd tutulmudur.<br><br>Paylanlm  z mtrini tan Platformas (EKYC)  mrkzldirilmi mtri idetifikasiya, verifikasiya&nbsp; zr hllr platformasdr.<br>&nbsp;<br>Platformann sas mqsdi :&nbsp;<br>&nbsp;</p><ul><li>Mrkzi Bankn tnzimlyici rolunu qoruyaraq, bazar itiraklarna beynlxalq standartlara uyun etibarl v effektiv Paylanlm z mtrini tan&nbsp; hllinin tqdim edilmsi v nticd mtrinin onboarding v uyunluq proseslrind smrliliyinin artrlmas v mtri tcrbsinin yaxladrlmas<br>&nbsp;</li></ul><p>Mxtlif qurumlar v qoulmu bazar itiraklar arasnda z mtrini tan prosesini asanladrlmas v efektiv mlumat mbadilsini tkil edilmsi<br><br>Daha trafl: <a target="_blank" rel="noopener noreferrer" href="https://fintech.cbar.az/kyc">https://fintech.cbar.az/kyc</a></p>', 1, 1, '2025-09-26 18:38:03.026502', '2025-09-26 18:38:03.026503', NULL);
INSERT INTO public."EKYCTranslations" VALUES (2, '<p>In line with the Action Plan of the Financial Sector Development Strategy, the creation of a Distributed Know Your Customer (Distributed eKYC) platform is envisaged to ensure the effective implementation of the Know Your Customer (KYC) approach in the financial sector.<br>&nbsp;</p><p>The Distributed KYC Platform (eKYC) is a centralized solution for customer identification and verification.<br>&nbsp;</p><p>Main objectives of the platform:<br>&nbsp;</p><p>To provide market participants with a reliable and efficient Distributed KYC solution in accordance with international standards, while preserving the Central Bank''s regulatory role, thereby enhancing the efficiency of customer onboarding and compliance processes and improving the overall customer experience.<br>&nbsp;</p><p>To facilitate the KYC process and enable effective information exchange among different institutions and connected market participants.<br><br>For more information: <a target="_blank" rel="noopener noreferrer" href="https://fintech.cbar.az/kyc">https://fintech.cbar.az/kyc</a></p>', 1, 2, '2025-09-26 18:38:03.026541', '2025-09-26 18:38:03.026541', NULL);


