INSERT INTO public."FinancialDevelopmentTranslations" VALUES (1, '2024-2026-c illrd maliyy sektorunun inkiaf Strategiyas', '<h4><strong>Hrmtli maliyy sektoru itiraklar,</strong></h4><p>&nbsp;</p><p>Azrbaycan Respublikas Mrkzi Banknn dar Heyti trfindn 2024-2026-c illrd maliyy sektorunun inkiaf Strategiyas tsdiq olunmudur.<br><br>Strategiya lkmizd maliyy sisteminin mhm sektorlar olan sorta, kapital bazarlar v dni sistemlrinin inkiaf etdirilmsi, habel bank sektorunun dayanqlnn daha da gclndirilmsi kimi prioritetlri ehtiva edir. Strategiya maliyy inklzivliyinin genilndirilmsi, maliyy xidmtlrinin hatliliyinin artrlmas v maliyy altlrinin axlndirilmsi, sektorda smrliliyin yksldilmsi, korporativ idaretmnin ttbiqi, habel ffaflq v dayanqllnn gclndirilmsi kimi strateji mqsdlri znd ks etdirir.<br><br>Strategiya sndi hminin hr sektorun ehtimal olunan bazar potensialn, Mrkzi Bankn mvafiq keyfiyyt tlblrini v risk sasl nzart mexanizmlrini, rqmsal maliyy, dayanql maliyy, pekar inkiaf v halinin maliyy biliklrinin artrlmas kimi istiqamtlri myyn edir.</p><p>&nbsp;</p><p>Strategiyada srtli inkiaf mrhlsind olan <strong>sorta sektoru</strong> zr vasiti v sat kanallarnn (sorta agentlri v brokerlri daxil olmaqla) genilndirilmsi, knll v icbari sortann tviqi, sorta mlumat v monitorinq mrkzinin yaradlmas, elc d korporativ idaretmnin gclndirilmsi v risk sasl prudensial tnzimlmnin hyata keirilmsi msllri nzrd tutulub. Sorta sektoru zr sas strateji hdflr, sorta tminatn genilndirmk v istehlak hquqlarn effektiv mdafi etmkl, sortaya olan inam indeksinin 66%-dn 80%- yksldilmsini v sortalarn dm qabiliyytinin artrlmas il yana, adambana dn mumi sorta haqqnn cari 121 manatdan potensial olaraq 195 manata atdrlmasn hat edir. Bu kompleks yanama risklri effektiv idar etmkl iqtisadi artm dstklmk mqsdi dayr.<br><br>Yksk inkiaf potensial olan <strong>kapital bazarlar</strong> zr strategiya lkmizd kapital bazarlarnn maliyy sistemind rolunu artrmaq v iqtisadi inkiafa thf vermk mqsdi dayr. Kapital bazarlar zr sas strateji hdflr bazar infrastrukturunun inkiaf etdirilmsini, bazara olan etimadn gclndirilmsini v dayanql, bazara x imkanlarnn genilndirilmsini v investisiya altlrinin eidinin artrlmasn hat edir. Bundan baqa, kapital bazarlarnn ehtimal olunan potensialnn qeyri-neft DM-d paynn cari 10%-dn 14%- atdrlmas, halinin kapital bazarlarnda investisiyalarnn hcminin cari 150 milyon manatdan potensial olaraq 1 milyard manata atdrlmas v effektiv nzart rivsinin formaladrlmas strategiyada nzrd tutulur.<br><br><strong>dni sektorunda</strong> innovativ hllrin ttbiqi il yana dni xidmtlrin latanln artrlmas, dni bazarnda ffaflq v rqabtliliyin gclndirilmsi diqqt mrkzinddir. dni xidmtlri zr thlksizliyin v smrliliyin tmin edilmsi mqsdil milli dni sisteminin masirldirilmsi, bazar itiraklar n lverili mhitin yaradlmas v effektiv nzart rivsinin formaladrlmas da nzrd tutulur. dni sektoru zr balca strateji hdf olaraq adambana dn orta illik nadsz mliyyat saynn cari 93-dn potensial olaraq 200- atdrlmas planladrlr. Ntic etibaril, rqabt qabiliyytli v innovativ dni ekosisteminin formaladrlmas v nadsz dnilrin genilndirilmsi iqtisadi artma hmiyytli thf vercyi gzlnilir.<br><br>Strategiyaya uyun olaraq <strong>bank sektorunda</strong> lverili v msuliyytli bank xidmtlrinin genilndirilmsi vasitsil dayanql inkiafn dstklnmsi nzrd tutulur. Bu mqsdl bank sektoru zr bazarn genilndirilmsi, bank olmayan kredit tkilatlarn inkiaf etdirmkl onlarn iqtisadiyyatn maliyylmsind rolunun yksldilmsi, elc d nzart rivsinin masirldirilmsi istiqamtind tdbirlrin hyata keirilmsi planladrlr. Bu rivd, bank sektorunda biznes kreditlrinin hcminin ehtimal olunan potensial 16.5 milyard manata atdrlmas, mvafiq korporativ idaretm, ffaflq v rqabt qabiliyytliliyinin inkiaf v risk sasl tnzimlm v nzartin gclndirilmsi hdflnir.<br><br>Strategiyada hminin <strong>ES </strong>(ekoloji, sosial v idaretm) <strong>v dayanql maliyy</strong> meyarlarnn maliyy xidmtlrin inteqrasiyas, <strong>rqmsal maliyy</strong> hllrinin inkiaf, bu sahd <strong>innovasiyalarn </strong>geni miqyasda tviqi v <strong>kiberthlksizliyin </strong>gclndirilmsi tbbslri d hat olunub.<br><br>Bundan lav, maliyy sektorunda alan <strong>mtxssislrin pekarlq sviyysinin</strong> daha da artrlmas, habel, cmiyytd <strong>maliyy biliklrinin v latanlnn</strong> tviqi kimi fundamental msllr strategiyada z ksini tapmdr.<br><br>2024-2026-c illrd maliyy sektorunun inkiaf Strategiyas-nn hdflrinin v prioritetlrinin uurla hyata keirilmsi lkmizin makroiqtisadi v maliyy sabitliyin thf verck, vtndalarn gcl v dayanql maliyy sistemindn faydalanmaq imkanlarn daha da artracaqdr.<br><br>Strategiyann icras bard mlumat illik sasda ictimaiyyt tqdim olunacaqdr.<br><br><strong>Hrmtl,</strong><br><br><strong>Taleh Kazmov</strong><br><strong>Azrbaycan Respublikas Mrkzi Banknn sdri</strong><br><br><strong>26 yanvar 2024-c il</strong></p>', '2024-2026-c illrd maliyy sektorunun inkiaf Strategiyas', 'Strategiya sndinin hatli icmal il bu keiddn istifad etmkl tan ola bilrsiniz:', 1, 1, '2025-09-17 18:24:51.526079', '2025-09-17 18:24:51.52608', NULL);
