INSERT INTO public."GovernmentPaymentPortalTranslations" VALUES (1, 'Hkumt dni Portal (HP)  dvlt orqanlar trfindn gstriln elektron xidmtlr zr dnilrin elektron qaydada toplanlmasnn tmin edilmsi, bdc dnilrinin aparlmas prosesinin sadldirilmsi v birbaa emalnn tkili, kommunal, rabit, sorta v digr dnilrin vahid platformadan toplanlmasnn tmin edilmsi mqsdil yaradlmdr. HP-n yaradlmasnda balca mqsdlrdn biri d Milli dni Sistemi infrastrukturundan daha smrli istifadnin tmin olunmas, lknin btn regionlarnda elektron dni xidmtlrin x imkanlarnn genilndirilmsi olmudur.', 1, 1, '2026-02-04 17:15:03.678117+04', '2026-02-04 17:15:03.678117+04', NULL);
INSERT INTO public."GovernmentPaymentPortalTranslations" VALUES (2, 'Government Payment Portal (GPP)  was created to ensure the electronic collection of payments for electronic services provided by state bodies, simplify the process of making budget payments and organize their direct processing, and ensure the collection of utility, communication, insurance and other payments from a single platform. One of the main goals in creating the GPP was to ensure more efficient use of the National Payment System infrastructure and expand access to electronic payment services in all regions of the country.', 1, 2, '2026-02-04 17:15:03.678183+04', '2026-02-04 17:15:03.678183+04', NULL);


