INSERT INTO public."HistoryTranslations" VALUES (1, 'Azrbaycan Respublikasnn Mrkzi Bank', '<p>Azrbaycan z mstqilliyini brpa etdikdn drhal sonra qbul edilmi qanunvericilik aktlarndan biri "Azrbaycan Respublikasnn iqtisadi mstqilliyinin saslar haqqnda" Azrbaycan Respublikasnn 1991-ci il 25 may tarixli Konstitusiya Qanununun "Bank sistemi v pul tdavl" adlanan 14-c maddsind Azrbaycanda mstqil bank sisteminin v milli pul vahidinin tdavlnn hquqi saslar tsbit edilmi, Milli Bankn statusu v slahiyytlri myyn edilmidir. Milli Bank kredit, pul tdavl, hesablamalar v valyuta mnasibtlri sahsind dvlt siyastini hyata keirn, btvlkd bank sisteminin faliyytini tnzimlyn v ehtiyat bank funksiyalarn icra edn ali emissiya idarsi elan edilmidir.</p>', 1, 1, '2025-09-18 13:43:28.157741', '2025-09-18 13:43:28.157742', NULL);
INSERT INTO public."HistoryTranslations" VALUES (2, 'Goals of the Central Bank', '<p>The main goal of the Central Bank is to maintain price stability within its authorities set by the Law.</p><p>Without prejudice to the main goal the Central Bank safeguards financial stability within its mandated powers with the laws governing financial markets.&nbsp;</p><p>Profit making is not the main goal of the Central Bank.</p>', 1, 2, '2025-09-18 13:43:28.157799', '2025-09-18 13:43:28.157799', NULL);


