INSERT INTO public."InterbankCardCenterTranslations" VALUES (1, 'Banklararas Kart Mrkzi (BKM)  lkd prosessinq faliyyti gstrn v Beynlxalq Kart Tkilatlarna (BKT) birbaa x olan btn tkilatlarn xidmt bklri arasnda interfeysin tmin edilmsi, rezident banklar trfindn emissiya edilmi dni kartlar il lk daxilind aparlan kart mliyyatlarnn emal prosessinin bu infrastruktur vasitsi il hyata keirilmsi il thlksizlik sviyysinin yksldilmsi, aparlan kart mliyyatlarnn effektivliyinin artrlmas n ttbiq olunan banklararas xidmt haqlarnn bazar tlblrin uyun evik tnzimlnmsi, kart infrastrukturu itiraklarnn xrclrinin aa salnmas mqsdi il yaradlmdr.', 1, 1, '2026-02-04 16:59:10.587937+04', '2026-02-04 16:59:10.587937+04', NULL);
INSERT INTO public."InterbankCardCenterTranslations" VALUES (2, 'Interbank Card Center (ICC)  was established to provide an interface between the service networks of all organizations that provide processing activities in the country and have direct access to International Card Organizations (ICOs), to increase the security level by implementing the processing process of card transactions conducted within the country with payment cards issued by resident banks through this infrastructure, to flexibly adjust the interbank service fees applied in accordance with market requirements to increase the efficiency of card transactions, and to reduce the costs of card infrastructure participants.', 1, 2, '2026-02-04 16:59:10.588014+04', '2026-02-04 16:59:10.588014+04', NULL);


