INSERT INTO public."InternationalCooperationCaptionTranslations" VALUES (1, '<p>Qlobal iqtisadi qarslql asllgn artmas v dunya iqtisadiyyatnn uzlsdiyi cagrslar sraitind beynlxalq tskilatlar v digr mrkzi banklarla mkdaslq xarici iqtisadi soklarn v sistem risklrinin laqlndirilmis skild idar olunmasna komk edir. Azrbaycan Respublikasnn Mrkzi Bank da (ARMB) faliyytinin muasir tlblr uygun smrli tskili v mrkzi bankclgn butun funksional istiqamtlri uzr beynlxalq standartlarn ttbiqi mqsdil beynlxalq tskilatlar, digr olklrin mrkzi banklar v nzart qurumlar il mkdaslga muhum hmiyyt verir. ARMB faliyyti crcivsind beynlxalq v regional forumlarda aktiv istirak edrk qlobal maliyy sabitliyi v beynlxalq maliyy tnzimlm islahatlar il bagl muzakirlr tohf verir.</p><p>&nbsp;</p>', 1, 1, '2025-09-26 14:38:43.244334', '2025-09-26 14:38:43.244334', NULL);
INSERT INTO public."InternationalCooperationCaptionTranslations" VALUES (2, '<figure class="table"><table><tbody><tr><td>In the context of growing global economic interdependence and the challenges facing the world economy, cooperation with international organizations and other central banks contributes to the coordinated management of external economic shocks and systemic risks. The Central Bank of the Republic of Azerbaijan (CBAR) attaches great importance to cooperation with international organizations, central banks, and supervisory authorities of other countries to ensure the effective organization of its activities in accordance with modern requirements and to apply international standards across all functional areas of central banking. Within its operations, CBAR actively participates in international and regional forums, contributing to discussions on global financial stability and international financial regulatory reforms.</td><td>&nbsp;</td></tr></tbody></table></figure><p><br>&nbsp;</p>', 1, 2, '2025-09-26 14:38:43.244384', '2025-09-26 14:38:43.244384', NULL);


