INSERT INTO public."InternationalEventTranslations" VALUES (15, 'Birinci Beynlxalq Tdqiqat Konfrans', 'birinci-beynelxalq-tedqiqat-konfransi', '<p>30 - 31 oktyabr 2014-c il tarixlrind Bak hrind nkiaf etmkd olan lklrd makroiqtisadi siyast v maliyy sabitliyi msllri mvzusunda 1-ci Beynlxalq Tdqiqat Konfrans keirilmidir. Konfransda 15 lknin mrkzi banklar v universitetlrindn 30-a yaxn tannm tdqiqat, habel lkmizin qabaqcl ali mktb, beyin mrkzlrinin tdqiqatlar v maliyy-bank sferasnn nmayndlri itirak etmilr.&nbsp;</p><p>&nbsp;</p><p>Konfransn sas mqsdi tdqiqatlar v siyastilr arasnda institusional islahatlar, makroiqtisadi v maliyy siyasti rivsi, hminin bhrandan sonrak dvrd maliyy sabitliyi msllri d daxil olmaqla inkiaf edn iqtisadi sistemlrd rast glinn arlar trafnda interaktiv mzakirlrin tkil edilmsindn ibart olmudur.</p><p>&nbsp;</p><p>Konfransda AB-n Cnubi Kaliforniya Universitetinin professoru Joshua Aizenman Post-bhran dvrnd inkiaf etmkd olan v resurslarla zngin lklrin fiskal v monetar siyast tcrblri v Trkiynin Bilkent Universitetinin professoru Refet Grkaynak Mrkzi bankln optimal mandat mvzusunda tqdimatla x etmilr.</p><p>&nbsp;</p><p>sas mruzlrdn sonra konfrans sessiyalar zr z iini davam etdirmidir. Konfransda 7 sessiya zr qabaqcl mrkzi banklarn v universitetlrdn 30-a yaxn tannm tdqiqats, o cmldn Mrkzi Bankn Tdqiqatlar v inkiaf mrkzinin tdqqiatlar tqdimatla x etmidir.</p><p>&nbsp;</p><p>Konfransn sonunda sessiyalar zr aparlm tdqiqat ilrinin nticlri mumildirilmi v post-bhran dvrnd inkiaf etmkd olan v resursla zngin lklrd makroiqtisadi arlar, monetar siyast rivsinin formalamas, makro-prudensial siyast v maliyy bazarlarnn tnzimlnmsin dair tkliflr hazrlanmdr.</p>', 12, 1, '2025-10-10 09:24:12.266784', '2025-10-10 09:24:12.266784', NULL);
