INSERT INTO public."InternationalEventTranslations" VALUES (13, 'Azrbaycan v Mrkzi Asiya lklrinin mrkzi (milli) banklarnn dni ekspertlrinin regional toplants', 'azerbaycan-ve-merkezi-asiya-olkelerinin-merkezi-milli-banklarinin-odenis-ekspertlerinin-regional-toplantisi', '<p>13-14 iyun 2024-c il tarixlrind Azrbaycan Respublikasnn Mrkzi Banknn tbbs il Bak hrind Qazaxstan, Qrzstan, zbkistan v Tacikistan mrkzi banklarnn nmayndlrinin itirak il regional tdbir tkil olunub. Bu tdbir rivsind mrkzi banklarn dni sahsi zr ekspertlri arasnda tcrb mbadilsi ba tutub v qlobal dni trendlrin dair mzakirlr aparlb.</p><p>&nbsp;</p><p>Tdbir rivsind Azrbaycann dni sektorunda ba vern yeniliklr, qanunvericilik bazasnn tkmilldirilmsi, nadsz dnilrdn istifad trendlri, ttbiq olunan innovativ dni hllri, fintexlrin dni bazarna clb edilmsi, elc d Milli dni Sisteminin hatliliyinin genilndirilmsi istiqamtind hyata keiriln tdbirlr bard mlumatlar diqqt atdrlb.</p><p>&nbsp;</p><p>Hminin rqmsal valyutalarn ttbiqi imkanlar, ani dni sistemlrindn istifadnin artrlmas, aq banklq modelinin fintexlrin inkiafnda rolu, maliyy sektorunda masir tnzimlm texnologiyalarnn ttbiqi, mrkzi banklar arasnda kiberthlksizlik sahsind mlumat mbadilsinin genilndirilmsi kimi mhm msllr dair mzakirlr d yer alb. Grlrd Azrbaycan v Orta Asiya mrkzi banklar arasnda glck mkdalq imkanlar nzrdn keirilib v lklrin dni infrastrukturunun inteqrasiya imkanlar da mzakir edilib.</p>', 9, 1, '2025-10-10 09:22:24.355033', '2025-10-10 09:22:24.355033', NULL);
INSERT INTO public."InternationalEventTranslations" VALUES (14, 'Regional Meeting of Payment Experts from Central (National) Banks of Central Asian Countries and Azerbaijan', 'regional-meeting-of-payment-experts-from-central-national-banks-of-central-asian-countries-and-azerbaijan', '<p>The Central Bank of the Republic of Azerbaijan initiated a regional event on 13-14 June 2024 in Baku featuring representatives from central banks of Kazakhstan, Kyrgyzstan, Uzbekistan, and Tajikistan. During the event, payment experts from these central banks shared their experiences and discussed global payment trends.</p><p>&nbsp;</p><p>Among the topics discussed were innovations in the Azerbaijani payments system, improvements to the legislative framework, cashless payment trends, innovative payment solutions used, the involvement of fintechs to the payments market, and initiatives to expand the coverage of the National Payments System.</p><p>&nbsp;</p><p>Participants also debated topics such as options for introducing digital currencies, boosting the use of instant payment systems, the role of the open banking model in fintech development, the application of modern regulatory technologies in the financial sector and the expansion of cybersecurity information sharing between central banks. They also considered opportunities for future cooperation between the Central Bank of Azerbaijan and the central banks of Central Asia and the integration of the payments'' infrastructures of these countries.</p>', 9, 2, '2025-10-10 09:22:24.355129', '2025-10-10 09:22:24.35513', NULL);
INSERT INTO public."InternationalEventTranslations" VALUES (16, 'The 1st International Research Conference', 'the-1st-international-research-conference', '<p>The 1st International Research Conference titled Macroeconomic Policies and Financial Stability Issues in Emerging Markets was held in Baku on 30  31 October 2014. The conference was attended by about 30 renowned researchers from central banks and universities of 15 countries, as well as researchers from our leading higher institutions and think tanks, and financial  banking sector representatives.</p><p>&nbsp;</p><p>The key goal of the conference was to hold interactive discussions among researchers and policymakers on institutional reforms, the macroeconomic and financial policy framework, as well as post-crisis financial stability issues and challenges in developing economies.</p><p>&nbsp;</p><p>The keynote speakers were Prof. Joshua Aizenman from the South Carolina University on Fiscal and Monetary Policy Concerns of Emerging and Resource Rich Countries in the Post-crisis Period and Prof. Refet Grkaynak from the Bilkent University on the Optimum Mandate of Central Banking.</p><p>&nbsp;</p><p>The keynote speeches were followed by 7 sessions, where about 30 renowned researchers from leading central banks and universities, as well as researchers from the Center for Researches and Development of the&nbsp;CBA&nbsp;delivered their presentations.</p><p>&nbsp;</p><p>The conference was wound up by summary of research findings and post-crisis macroeconomic challenges in developing and resource rich countries, followed by proposals on formation of the monetary policy framework, and regulation of financial markets.</p>', 12, 2, '2025-10-10 09:24:12.266789', '2025-10-10 09:24:12.266789', NULL);
