INSERT INTO public."InternationalFinancialOrganizationTranslations" VALUES (1, '<p><strong>Dnya Bank Qrupu</strong><br><br>Dnya Banknn (DB) sas missiyas yoxsulluun azaldlmas v mumi rifah halnn artrlmasndan ibartdir.<br><br>Azrbaycan DB Qrupuna daxil olan be quruma aada qeyd olunan tarixlrd zv olmudur:<br><br>- <a target="_blank" rel="noopener noreferrer" href="https://www.worldbank.org/ext/en/home">Beynlxalq Yenidnqurma v nkiaf Bank</a> - 18 sentyabr 1992<br><br>- <a target="_blank" rel="noopener noreferrer" href="https://www.miga.org/">oxtrfli nvestisiya Zmantlri Agentliyi</a> - 23 sentyabr 1992<br><br>- <a target="_blank" rel="noopener noreferrer" href="https://icsid.worldbank.org/">Beynlxalq nvestisiya Mbahislrinin Hlli Mrkzi</a> - 18 oktyabr 1992<br><br>- <a target="_blank" rel="noopener noreferrer" href="https://ida.worldbank.org/en/home">Beynlxalq nkiaf Assosiasiyas</a> - 31 mart 1995<br><br>- <a target="_blank" rel="noopener noreferrer" href="https://www.ifc.org/en/home">Beynlxalq Maliyy Korporasiyas</a> - 11 oktyabr 1995<br><br>Azrbaycan Respublikas Mrkzi Banknn (ARMB) sdri DB-d Azrbaycan zr mdirdir.<br>&nbsp;<br>Azrbaycan DB il lk Trfdalq rivsi (T) zr mkdalq edir. T Azrbaycan Hkumti trfindn myyn olunmu ehtiyac v prioritetlr saslanan trfdalq plandr. lkd makroiqtisadi vziyytin thlili, effektiv monetar siyastin hyata keirilmsi, eyni zamanda DB il birg hyata keiriln layihlrin mzakir edilmsi mqsdil Azrbaycanda sfrd olan D B-nin missiyas il ARMB-nin rhbrliyinin mtmadi grlri tkil edilir v mslhtlmlr aparlr.<br><br>ARMB DB il mkdalq rivsind mxtlif texniki yardm layihlri hyata keirir.<br><a target="_blank" rel="noopener noreferrer" href="https://www.worldbank.org">www.worldbank.org</a><br><br><strong>Beynlxalq Valyuta Fondu</strong><br><br>Beynlxalq Valyuta Fondunun (BVF) sas missiyas davaml inkiaf v rifaha nail olmaqdan ibartdir.&nbsp;<br><br>Azrbaycan BVF-y 1992-ci ild zv olmudur. A RMB-nin&nbsp; sdri BVF-d Azrbaycan zr vzedici mdirdir.<br><br>BVF-nin ekspertlrinin ARMB-y mtmadi sfrlri tkil edilir. Bu sfrlr zaman&nbsp; inflyasiyann sviyysinin tnzimlnmsi v proqnozlarn sabitldirilmsi n ARMB-nin apard siyast, mznn v faiz drcsi siyasti, mdaxil v sterilizasiya, manatla pul bazasnn artm, valyuta ehtiyatlarnn diversifikasiya planlar v digr msllr bard BVF ekspertlri il mzakirlr aparlr.<br><a target="_blank" rel="noopener noreferrer" href="https://www.imf.org">www.imf.org</a><br><br><strong>Asiya nkiaf Bank</strong><br><br>Asiya nkiaf Banknn (AB) sas missiyas yoxsulluun aradan qaldrlmas, firavan, inklziv, davaml v dayanql inkiafa nail olmaqdan ibartdir.&nbsp;<br><br>Azrbaycan AB- 1999-cu ild zv olmudur.<br><br>ARMBAB il mkdalq rivsind mxtlif texniki yardm layihlri hyata keirir. &nbsp;<br><a target="_blank" rel="noopener noreferrer" href="https://www.adb.org">www.adb.org</a><br><br><strong>Avropa Yenidnqurma v nkiaf Bank</strong> &nbsp;<br><br>Avropa Yenidnqurma v nkiaf Banknn (AYB) sas mqsdi ekoloji v sosial chtdn salam v davaml inkiaf tviq etmkdn ibartdir.<br><br>Azrbaycan AYB- 1992-ci ild zv olmudur.<br><br>ARMB AYB il mkdalq rivsind mxtlif texniki yardm layihlri hyata keirir. &nbsp;<br><a target="_blank" rel="noopener noreferrer" href="https://www.ebrd.com/">www.ebrd.com</a></p>', 1, 1, '2025-09-25 03:19:14.50993', '2025-09-25 03:19:14.50993', NULL);
INSERT INTO public."InternationalFinancialOrganizationTranslations" VALUES (2, '<h3><strong>World Bank Group</strong><br>&nbsp;</h3><p>The main mission of the World Bank (WB) is to reduce poverty and promote shared prosperity.<br>&nbsp;</p><p>Azerbaijan became a member of the five institutions of the World Bank Group on the following dates:<br>&nbsp;<br>- <a target="_blank" rel="noopener noreferrer" href="https://www.worldbank.org/ext/en/home">International Bank for Reconstruction and Development</a>  September 18, 1992<br>&nbsp;</p><p>- <a target="_blank" rel="noopener noreferrer" href="https://www.miga.org/">Multilateral Investment Guarantee Agency</a>  September 23, 1992<br>&nbsp;</p><p>- <a target="_blank" rel="noopener noreferrer" href="https://icsid.worldbank.org/">International Centre for Settlement of Investment Disputes</a>  October 18, 1992<br>&nbsp;</p><p>- <a target="_blank" rel="noopener noreferrer" href="https://ida.worldbank.org/en/home">International Development Association</a>  March 31, 1995<br>&nbsp;</p><p>- <a target="_blank" rel="noopener noreferrer" href="https://www.ifc.org/en/home">International Finance Corporation</a>  October 11, 1995<br>&nbsp;</p><p>The Governor of the Central Bank of the Republic of Azerbaijan (CBAR) serves as the Governor for Azerbaijan at the World Bank.<br>&nbsp;</p><p>Azerbaijan cooperates with the World Bank under the Country Partnership Framework (CPF). The CPF is a partnership plan based on the needs and priorities defined by the Government of Azerbaijan. To analyze the macroeconomic situation in the country, implement an effective monetary policy, and discuss joint projects with the World Bank, regular meetings and consultations are held between the Bank''s mission and the CBAR management during their visits to Azerbaijan.<br>&nbsp;</p><p>Within the framework of cooperation with the World Bank, the CBAR implements various technical assistance projects.<br><a target="_blank" rel="noopener noreferrer" href="https://www.worldbank.org">www.worldbank.org</a><br>&nbsp;</p><h3><strong>International Monetary Fund&nbsp;</strong><br>&nbsp;</h3><p>The main mission of the International Monetary Fund (IMF) is to achieve sustainable growth and prosperity.<br>&nbsp;</p><p>Azerbaijan became a member of the IMF in 1992. The Governor of the Central Bank of the Republic of Azerbaijan (CBAR) serves as the Alternate Governor for Azerbaijan at the IMF.<br>&nbsp;</p><p>Regular visits of IMF experts to the CBAR are organized. During these visits, discussions are held with IMF experts on the CBAR''s policies to regulate and stabilize inflation forecasts, exchange rate and interest rate policy, interventions and sterilization, growth of the manat monetary base, diversification of foreign exchange reserves, and other related issues.<br><a target="_blank" rel="noopener noreferrer" href="https://www.imf.org">www.imf.org</a><br>&nbsp;</p><h3><strong>Asian Development Bank&nbsp;</strong><br>&nbsp;</h3><p>The main mission of the Asian Development Bank (ADB) is to eliminate poverty and promote prosperous, inclusive, sustainable, and resilient development.<br>&nbsp;</p><p>Azerbaijan became a member of the ADB in 1999.<br>&nbsp;</p><p>Within the framework of cooperation with the ADB, the Central Bank of the Republic of Azerbaijan implements various technical assistance projects.<br><a target="_blank" rel="noopener noreferrer" href="https://www.adb.org">www.adb.org</a><br>&nbsp;</p><h3><strong>European Bank for Reconstruction and Development&nbsp;</strong><br>&nbsp;</h3><p>The main mission of the European Bank for Reconstruction and Development (EBRD) is to promote environmentally and socially sound and sustainable development.<br>&nbsp;</p><p>Azerbaijan became a member of the EBRD in 1992.<br>&nbsp;</p><p>Within the framework of cooperation with the EBRD, the Central Bank of the Republic of Azerbaijan carries out various technical assistance projects.<br><a target="_blank" rel="noopener noreferrer" href="https://www.ebrd.com">www.ebrd.com</a></p>', 1, 2, '2025-09-25 03:19:14.509984', '2025-09-25 03:19:14.509984', NULL);


