INSERT INTO public."InternshipDirectionTranslations" VALUES (7, 'Tdqiqatlar departamenti', '<p>Departamentinin faliyytinin sas mqsdi makroiqtisadi gstricilrin proqnozlarnn hazrlanmas v Mrkzi Bankda siyast qrarlarnn qbuluna dstk mqsdil tdqiqat ilrinin hyata keirilmsidir. Proqnozlarn keyfiyytinin yaxladrlmasna xidmt edn yeni modellrin qurulmas, onlarn mtmadi tkmilldirilmsi departamentin sas mqsdidir.<br><br><i><strong>Makroiqtisadi tdqiqatlar bsi</strong></i></p><p><br>2025-ci ild Tdqiqatlar departamentinin Makroiqtisadi tdqiqatlar bsi tcrbi qbul edck. Szgedn b makroiqtisadi sabitlik v dayanqllq istiqamtlrind aradrmalar aparr v qiymtlndirmlr edir, balca makroiqtisadi proseslri, o cmldn iqtisadi artm, inflyasiyan mtmadi thlil edir v bu istiqamtd tdqiqatlar hyata keirir, pul v mznn siyasti rejimlrini, hminin pul siyastinin transmissiya mexanizmini aradrr. Clb ediln tcrbi makroiqtisadi proseslri yax anlamaq, mlumatlar statistik thlil etmk, ekonometrik modellrin qiymtlndirilmsi prosesind itirak etmk, Mrkzi Bankn faiz siyasti qrarlarnn qbulu n hazrlanan materiallarla tan olmaq v hazrlq prosesind itirak etmk kimi imkanlara yiylnckdir.</p>', 1, 1, '2025-10-10 06:42:36.15413', '2025-10-10 06:42:36.15413', NULL);
