INSERT INTO public."MissionTranslations" VALUES (3, 'Ea voluptatum numqua', 'Corporis sint eaque ', 2, 1, '2025-09-18 14:19:34.191772', '2025-09-18 14:19:34.191773', NULL);
INSERT INTO public."MissionTranslations" VALUES (4, 'Quisquam sit dolore', '', 2, 2, '2025-09-18 14:19:34.191776', '2025-09-18 14:19:34.191776', NULL);
INSERT INTO public."MissionTranslations" VALUES (18, 'Drstlk', 'Tkilati kimliyimizin mrkzind drstlk dayanr. Bizim n drstlk sadc gzlnti deyil; bu, bizim hesabatlla v etik davrana sadiqliyimizdir. Faliyytimiz zaman qrzsizlik prinsiplrin istinad edirik. Biz, faliyytimizd qanuni v etik rivlr riayt edirik. Biz, proses v davranlarn qbul olunmu qaydalara uyunluunu tmin edirik. Biz, tkilatdaxili v tkilatxarici trfdalarmzla i mhitind qarlql inama, etibara, qrzsizliy saslanan mnasibtlrimizi daim qorumaq, saxlamaq v inkiaf etdirmy alrq. Qrarlarmz vern zaman btn maraql trflrin mnafelrini nzr alrq. Hr ks brabr imkanlar yaradrq. Biz, iqtisadi sabitliyin mhafizilri olaraq baa drk ki, ictimai etimad sarslmaz drst mvqe il qazanlr.', 1, 1, '2025-10-01 10:58:53.308774', '2025-10-01 10:58:53.308774', NULL);
INSERT INTO public."MissionTranslations" VALUES (19, 'Cavabdehlik', 'Biz, mandatmzdan irli gln slahiyyt v hdliklrin msuliyytini drk edir v onlara sadiqlik nmayi etdiririk. lkmizin inkiaf v xalqmzn rifahnn yksldilmsi istiqamtind zrimiz dn cavabdehliyi v msuliyyti anlayrq. Bu istiqamtd btn mmkn resurslarmzdan yararlanaraq potensialmz sfrbr edirik. Verdiyimiz qrarlar ffaf bir kild kommunikasiya edirik. Mqsdlrimiz nail olmaq n verdiyimiz qrarlara v gstrdiyimiz faliyytin nticlrin gr cavabdehlik dayr, nticsindn asl olmayaraq onlara yksk ruhla sahiblnirik.', 3, 1, '2025-10-01 10:59:28.325134', '2025-10-01 10:59:28.325134', NULL);
INSERT INTO public."MissionTranslations" VALUES (20, 'nkiaf', 'Davaml yrnm v mkdalq mdniyytini tviq etmkl missiyamz effektiv hyata keirir, faliyytimiz dyr qatacaq yeniliklri ttbiq etmkdn kinmirik. Hr zaman yeni ideyalar, yeni yanamalar v innovativ hll yollar axtarndayq. Msbt transformasiya imkanlarndan istifad etmkl davaml tkmillmy v inkiaf etmy fokuslanrq. Dyin bazar tlblrin evik reaksiyalarn verilmsi v texnoloji tendensiyalarn ncdn proqnozladrlmas diqqt mrkzimizddir. Faliyytimizin qatd dyrin frqindyik, buna gr d iimizi n mkmml kild grmk n btn qvvmizi sfrbr edirik. nkiaf yolunda kollektiv nailiyyt, qarlql faydaya v ortaq mqsdlr ynlirik. Biz, maliyy sektorunun dinamik dyiikliklrini effektiv idar edir, sabitliyi tmin etmkl yana iqtisadiyyatn dayanql inkiafna thf veririk. Ekosistemi srbst kild inkiaf etmsi n tviq edirik.', 4, 1, '2025-10-01 10:59:56.695541', '2025-10-01 10:59:56.695541', NULL);


