INSERT INTO public."MonetaryPolicyCaptionTranslations" VALUES (1, '<p>Mrkzi Bankn bu istiqamtd faliyyti Azrbaycan Respublikasnn Mrkzi Bank haqqnda Qanunla tnzimlnir. Pul siyasti Mrkzi Bankn sas mqsdi olan qiymtlrin sabitliyini tmin etmk mqsdil hyata keiriln tdbirlr sistemidir.<br>&nbsp;<br>Pul siyastinin hdfin atmaq mqsdil Mrkzi Bank pul siyasti altlrindn istifad edir. Srncamnda olan pul siyasti altlri vasitsil pul ktlsi, valyuta mznnsi v faiz drclrin tsir gstrmkl Mrkzi Bank znn son mqsdin nail olmaa alr. Pul siyastin dair adekvat qrarlar qbul etmk n Mrkzi Bank daim lkdki makroiqtisadi vziyyti thlil edir v proqnozladrr. Makroiqtisadi vziyyt mntzm olaraq Mrkzi Bankn kollegial idaretm orqanlar olan Pul Siyasti v Maliyy Sabitliyi Komitsind v dar Heytind mzakir edilir, bu mzakirlr sasnda pul siyastin dair qrarlar qbul olunur. Qrarlar Mrkzi Bankn kommunikasiya vasitlri, o cmldn press-relizlr vasitsil ictimaiyyt aqlanr.<br>&nbsp;<br>Mrkzi Bank qardak il (hminin ortamddtli dvr) n pul siyastinin sas istiqamtlri bard byanat hazrlayr v ictimaiyyt aqlayr. Sndd cari ild makroiqtisadi siyast rivsi, hyata keiriln pul siyastinin yekunlar, qardak il n myyn ediln pul siyastinin mqsd v vziflri, onlarn hyata keirilmsi yollar, elc d ortamddtli dvr siyast istiqamtlri gstrilir.<br>&nbsp;<br>Mrkzi Bank il rzind makroiqtisadi vziyyti v hyata keiriln pul siyasti bard mlumatlar geni oxucu ktlsin atdrmaq mqsdil rblk sasda Pul Siyasti cmaln hazrlayaraq ictimaiyyt aqlayr.</p>', 1, 1, '2025-09-16 06:07:28.018234', '2025-09-16 06:07:28.018234', NULL);
INSERT INTO public."MonetaryPolicyCaptionTranslations" VALUES (2, '<p>The Central Bank''s related activity is regulated by the Law on the Central Bank of the Republic of Azerbaijan. The monetary policy is a system of actions taken to secure price stability, the main goal of the Central Bank.</p><p>&nbsp;</p><p>The Central Bank uses monetary policy tools to attain its monetary target and strives to reach its ultimate goal influencing money supply, the exchange and interest rates by means of the monetary policy tools at its disposal. The Bank always analyzes and forecasts the macroeconomic situation to take adequate monetary policy decisions. The Central Bank''s collegial bodies  the Monetary Policy and Financial Stability Committee and the Management Board regularly discuss the macroeconomic situation and make decisions on this basis, which are disclosed to broad public via communication facilities, including press-releases.</p><p>&nbsp;</p><p>The Central Bank develops and makes public a statement on main directions of the monetary policy for the year to come (also for medium term). The document includes a macroeconomic policy frame in the current year, results of the implemented monetary policy, goals and objectives of the monetary policy for the upcoming year, the ways for their implementation and medium term policy directions.</p><p>&nbsp;</p><p>The Central Bank''s Monetary Policy Review quarterly goes public to deliver information on the macroeconomic stance and the implemented monetary policy.</p>', 1, 2, '2025-09-16 06:07:28.018273', '2025-09-16 06:07:28.018274', NULL);


