INSERT INTO public."NakhchivanBlogTranslations" VALUES (9, 'Azrbaycan Respublikas Mrkzi Banknn Naxvan Muxtar Respublikas darsi trfindn Heydr liyev li il bal silsil tdbirlr davam etdirilir.', '<p><i><strong>Azrbaycan Respublikas Mrkzi Banknn Naxvan Muxtar Respublikas darsi v Naxvan Dvlt Universitetinin birg tbbskarl il mummilli Lider Heydr liyevin anadan olmasnn 100 illiyi mnasibtil Maliyy savadll layihsi rivsind Aq banklq mvzusunda tlim</strong></i><br>23 oktyabr tarixind Azrbaycan Respublikas Mrkzi Banknn Naxvan Muxtar Respublikas darsi v Naxvan Dvlt Universitetinin birg tbbskarl il mummilli Lider Heydr liyevin anadan olmasnn 100 illiyi mnasibtil Universitetin mllim v tlb kollektivi n Maliyy savadll layihsi rivsind Aq banklq mvzusunda tlim keirilmidir.</p><p>Tlimi giri sz il universitetin rektoru, dosent Elbrus sayev aaraq bu tip silsil tdbirlrin keirilmsinin tlblr n xsusi hmiyyt malik olduunu vurulam, masir bank mhsul v xidmtlrin gnmzd byk ktl trfindn maraq gstrilmsinin mvcud sahd ba vern innovativ inkiafn bariz nmunsi olduunu bildirmidir.</p><p>Sonra Azrbaycan Respublikas Mrkzi Banknn Naxvan Muxtar Respublikas darsinin sdri Elin liyev tlimin sas mqsdinin region halisi arasnda bank mhsul v xidmtlri il bal mliyyatlarda daha evik v dzgn qrarlarn verilmsini dstklmk v onlarda yeniliki bank sektoruna inam gclndirmkdn ibart olduunu bildirmidir.</p><p>Daha sonra videobalant il tdbir qoulan Azrbaycan Respublikas Mrkzi Banknn Ba direktoru Frid Osmanov v Azrbaycan Fintex Assosiasiyas ctimai Birliyinin idar heytinin sdri Ruslan Talbov&nbsp;qarlql mkdalq rivsind bu cr tdbirlrin keirilmsini yksk qiymtlndirdiyini sylmi v regionda halinin bank savadllnn artrlmas istiqamtind mariflndirici seminar v tdbirlrin keirilmsin bundan sonra da mvafiq dstyin gstrilcyini bildirmidir.</p><p>darnin mkdalar trfindn fintex anlay v tkaml, onun formalar, aq banklq v onun stnlklri, kibergigiyena qaydalar v s. mvzular elektron slaydlarla tdris olunmu, sonda itiraklar arasnda oyun sasl tdris platformas olan Kahoot sistemi vasitsil yar keirilmi, qalib xslr hdiyylr tqdim edilmidir.</p><p>Sonda Azrbaycan Respublikas Mrkzi Banknn Maliyy savadll bsinin risi Xumar Hseynova Mrkzi Bank trfindn "Maliyy savadll" layihsi rivsind hazrlanm resurslar bard auditoriyan mlumatlandirmis v tlblri maraqlandran suallar cavablandirmisdir.</p>', 1, 1, '2025-09-29 11:13:43.590686', '2025-09-29 11:13:43.590686', NULL);
INSERT INTO public."NakhchivanBlogTranslations" VALUES (10, 'A series of events related to the Year of Heydar Aliyev continues to be held by the Nakhchivan Autonomous Republic Branch of the Central Bank of the Republic of Azerbaijan. ', '<p><i><strong>On the initiative of the Nakhchivan Autonomous Republic Branch of the Central Bank of the Republic of Azerbaijan and Nakhchivan State University, a training on Open Banking was held within the framework of the Financial Literacy Project on the occasion of the 100th anniversary of National Leader Heydar Aliyev.</strong></i><br>On October 23, a training on Open Banking was held for the faculty and students of Nakhchivan State University within the framework of the Financial Literacy Project, on the occasion of the 100th anniversary of National Leader Heydar Aliyev. The event was jointly organized by the Nakhchivan Autonomous Republic Branch of the Central Bank of the Republic of Azerbaijan and Nakhchivan State University.</p><p>The training was opened with an introductory speech by the University Rector, Associate Professor Elbrus Isayev, who emphasized the special importance of such series of events for students. He noted that the growing interest of the general public in modern banking products and services is a clear example of the innovative developments taking place in the sector.</p><p>Following this, Elchin Aliyev, Chairman of the Nakhchivan Autonomous Republic Branch of the Central Bank, stated that the main objective of the training was to support the population of the region in making more efficient and accurate decisions in banking operations and to strengthen their confidence in the innovative banking sector.</p><p>Later, Farid Osmanov, Director General of the Central Bank of the Republic of Azerbaijan, and Ruslan Talibov, Chairman of the Board of the Azerbaijan FinTech Association Public Union, joined the event via video link. They highly appreciated the organization of such events within the framework of mutual cooperation and confirmed that relevant support would continue to be provided for seminars and events aimed at improving financial literacy in the region.</p><p>During the training, branch staff presented topics such as the concept and evolution of FinTech, its forms, open banking and its benefits, cyber hygiene rules, and other related subjects using electronic slides. At the end of the session, a competition was held among participants using the game-based learning platform Kahoot, and prizes were awarded to the winners.</p><p>Finally, Xumar Huseynova, Head of the Financial Literacy Department of the Central Bank, informed the audience about the resources prepared within the Financial Literacy project and answered questions raised by the students.</p>', 1, 2, '2025-09-29 11:13:43.590688', '2025-09-29 11:13:43.590688', NULL);
