INSERT INTO public."NakhchivanContactTranslations" VALUES (1, '<p><strong>laq Nmrsi</strong></p><p>darnin (036) 550 59 10 nmrsi il laq saxlanlr</p><p>&nbsp;</p><p><strong>Whatsapp</strong></p><p>Aada qeyd olunan istiqamtlr zr darnin&nbsp;+994 60-400-22-44&nbsp;nmrli whatsapp xidmtindn (xidmt) istifad edil bilr:</p><p>&nbsp;</p><ol><li><strong>Dvlt orqanlarndan dary nvanlanm v ya birbaa olaraq dary daxil olmu mracitlrl bal hr hans sbbdn cavab mktublar ld edilmdikd</strong>Mracit edn xsin xsiyyti eynildirilmkl cavab mktubu xidmt vasitsi il ona tqdim edilir.</li><li><strong>darnin nzart subyektlri il laq saxlanlmasnda tinlik yarandqda</strong>Mracit edn xs bard mlumat, onunla laq yaradlmas mqsdi il darnin nzart subyektin ynlndirilir.</li><li><strong>Qbulda itirak etmk n qeydiyyatdan keirildikd</strong>Vtndalar darnin Whatsapp nmrsi vasitsil qeydiyyatdan kemkl darnin&nbsp;C.Mmmdquluzad 32&nbsp;nvannda yerln inzibati binasna glmkl Qbulotanda yerind qbulda itirak ed bilrlr.</li></ol>', 1, 1, '2025-09-21 12:29:02.655597', '2025-09-21 12:29:02.655597', NULL);
INSERT INTO public."NakhchivanContactTranslations" VALUES (2, '<p><strong>Contact Number</strong></p><p>The Department is in contact with the number (036) 550 59 10</p><p>&nbsp;</p><p><strong>Whatsapp</strong></p><p>The Department''s WhatsApp service (service) at +994 60-400-22-44 can be used for the following purposes:</p><p>&nbsp;</p><ol><li><strong>If for any reason no response letters are received regarding the applications addressed to the</strong> Department from state bodies or directly received by the Department, the applicant''s identity is identified and the response letter is provided to him through the service.</li><li><strong>If there is difficulty in maintaining contact with </strong>the Department''s control subjects, information about the applicant is forwarded to the Department''s control subject in order to establish contact with him.</li><li><strong>When registering to participate in the receptionCitizens can register via</strong> the Department''s "Whatsapp" number and attend the reception on site at the "Reception Hall" by coming to the administrative building of the Department located at 32 J. Mammadguluzadeh Street.</li></ol>', 1, 2, '2025-09-21 12:29:02.655638', '2025-09-21 12:29:02.655638', NULL);


