INSERT INTO public."OpenBankingTranslations" VALUES (1, '<p>nnvi banklq sistemlrind mtrilrin hesab mlumatlarna giri hququ&nbsp; yalnz onlarn banklarna mxsusdur.<br><br>Aq banklq prinsiplrin gr is banklar mtri mlumatlarnn saxlanlmas qismind itirak etmkl, yalnz bank mtrilrinin icazsi mqabilind maliyy mlumatlarnn etibarl yol il nc trf tchizatlarn rqmsal platformalarda grnmsini v mliyyat apara bilmlrini tmin edir.<br><br>Aq banklq prinsiplri Avropada qbul olunmu PSD2 (Payment Services Directive) direktivi sasnda formaladrlmdr.<br><br>Aq banklq anlayn ttbiq etmkl maliyy qurumlar bank trfdalar v nc trflrl srtli v effektiv laq quraraq mtrilr daha yax xidmt gstrmk n ekosistemlrini genilndir bilrlr. Eyni zamanda mtri davran qaydalarn izlyib, thlil etmkl mtri xidmtlrini daha da inkiaf etdir bilrlr.<br><br>nc trf tchizatlar is mtrilr bu istiqamtd srtli v fasilsiz maliyy xidmtlri, btn hesablarnn bir ttbiqdn idar edilmsi kimi unikal imkanlar tklif ed bilrlr.</p><p>&nbsp;</p><p>Azrbaycanda Aq banklq hlli mkrzldirilmi platforma zrind nzrd tutulmudur. Mrkzldirilmi API lz v Developer portal Mrkzi Bank trfindn tmin olunur. Banklar tqdim etdiklri API-lri vahid API lz il inteqrasiya edirlr v hr bir nc trf tchizat il (TPP) ayrca mqavil balamaa v inteqrasiya etmy ehtiyac yoxdur. nc trf tchizatlar vahid platforma il inteqrasiya edrk, btn banklarn API-lrin x ld edirlr.</p><p>Daha trafl: <a target="_blank" rel="noopener noreferrer" href="https://openfinance.cbar.az/">https://openfinance.cbar.az/</a></p>', 1, 1, '2025-09-29 20:33:15.336864', '2025-09-29 20:33:15.336864', NULL);
