INSERT INTO public."OperatorBankCaptionTranslations" VALUES (1, '<p>Mrkzi Bank trfindn nad pulla bal biznes proseslrin optimalladrlmas, elc d banklarda masir texnoloji sistem v avadanlqlarn ttbiqi il nad pulun idar edilmsind smrliliyin yksldilmsi mqsdil bir sra biznes proseslrin banklara trlmsi hyata keirilir.</p><p>&nbsp;</p><p>z mtrilrindn qbul etdiyi pullarla yana, digr banklardan v pot rabitsinin milli operatorundan alnm kaz milli pul nianlarnn avtomatladrlm emal avadanlnda eidlnmsini hyata keirrk birbaa v ya digr kommersiya banklar vasitsil tkrar tdavl buraxlmas n Mrkzi Bank trfindn myyn edilmi tlblr cavab vern banklardan operator banklarn seilmsi hyata keirilir.</p><p>&nbsp;</p><p><strong>Operator banklarn seilmsi aadak meyarlar sasnda hyata keirilir. Bel ki, operator bank:</strong><br>&nbsp;</p><p>Hr tn tqvim ili zr orta gndlik nad pul mdaxili v ya nad pul mxaricindn n yksk olannn hcmindn lav gndlik n az 200 min dd kaz milli pul nianlarnn eidlnmsini tmin edn avtomatladrlm emal avadanlna malik olmal;<br>&nbsp;</p><p>z mtrilrindn qbul etdiyi pullarla yana digr banklardan alnm kaz milli pul nianlarnn avtomatladrlm emal avadanlnda 1 (bir) ay mddtindn gec olmayaraq Mrkzi Bankn pul nianlarnn tdavl yararszlq lamtlrini, dyidirilmsini v ekspertizasn tnzimlyn qaydalarna uyun olaraq eidlnmsini hyata keirmli;<br>&nbsp;</p><p>Kaz pul nianlarnn avtomatladrlm emaln hyata keirn avadanla texniki dstk gstrmli v pul nianlarnn saxtaladrlmas lamtlrinin myyn edilmsi zr ekspertizann hyata keirilmsi mqsdil kadr potensialna malik olmal;<br>&nbsp;</p><p>Avtomatladrlm emal avadanlqlarnn pul nianlarnn tdavl yararl v yararszlna gr adaptasiya sviyysin gndlik sasda nzarti hyata keirmli;</p><p>Sistem v avadanlqlarn istismar v texniki qulluq normalarna uyun istismarn tkil etmli, onlarn dvri olaraq texniki dstklnmsini tmin etmli;<br>&nbsp;</p><p>Avtomatladrlm emal avadanlqlarnn mahid kameralar il tchiz edilmi xsusi sahd quradrmal v mahid kameralarnn grntlrini n az 6 (alt) ay mddtind bankda saxlamal;<br>&nbsp;</p><p>Mrkzi Bankn tlblrin uyun olaraq eidlnmi pul nianlarnn tkrar tdavl buraxlmasn tmin etmli;<br>&nbsp;</p><p>Kassa mliyyatlarnn (mdaxil/mxaric), emal proseslrinin, habel digr banklarn nad pul vsaitlrinin avtomatladrlm emal avadanlqlarnda apard eidlm mliyyatlarnn gndlik uotunu aparmal v ay rzind mvafiq mlumatlar ks etdirn hesabat nvbti ayn ilk 5 (be) i gnndn gec olmayaraq Mrkzi Banka hesabatn tqdim edilmsin msul xsin gclndirilmi elektron imzas il tsdiq edilmi elektron formada tqdim etmli;<br>&nbsp;</p><p>Mrkzi Bank trfindn monitorinqlrin keirilmsi n rait yaratmal;<br>&nbsp;</p><p>Faliyyti il bal digr banklarla balanm mqavil zr hdliklrini lazm qaydada icra etmlidir.</p>', 1, 1, '2025-09-19 18:56:59.328214', '2025-09-19 18:56:59.328214', NULL);
INSERT INTO public."OperatorBankCaptionTranslations" VALUES (2, '<p>The Central Bank delegates a number of business processes to banks in order to optimize the business processes related to cash and to increase the effectiveness and efficiency of cash management through the use of modern technological systems and equipment in banks.</p><p>&nbsp;</p><p>The Central Bank carries out the process of selecting operator banks from among the banks that meet the requirements established by the Central Bank to recirculate national currency banknotes received from other banks and the national postal operator, directly or through other commercial banks, by sorting them in automated processing equipment, in addition to cash received from their own customers.</p><p>&nbsp;</p><p><strong>Operator banks are selected based on the following criteria. So, the operator bank shall:</strong><br>&nbsp;</p><p>have automated processing equipment capable of sorting of at least 200,000 pieces of national banknotes per day, in addition to the volume of the largest of the average daily cash receipts or cash disbursements for each preceding calendar year;<br>&nbsp;</p><p>sort national banknotes received from other banks in automated processing equipment in accordance with the Regulations of the Central Bank ''On signs of currencies unfit for circulation, their replacement and expertise'' within 1 (one) month at the latest, in addition to cash funds received from its own customers;<br>&nbsp;</p><p>provide technical support for equipment that performs automated processing of banknotes and have personnel potential for the purpose of carrying out expertise on identifying the signs of counterfeiting of currency;<br>&nbsp;</p><p>monitor daily the level of adaptation of automated processing equipment for currencies'' suitability and unsuitability for circulation;<br>&nbsp;</p><p>organize the operation of systems and equipment in accordance with the standards of operation and maintenance and ensure their periodic technical support;<br>&nbsp;</p><p>install automated processing equipment in a special area equipped with surveillance cameras and store surveillance camera images at the bank for at least 6 (six) months;<br>&nbsp;</p><p>ensure the re-circulation of banknotes sorted in accordance with the requirements of the Central Bank;<br>&nbsp;</p><p>keep a daily record of cash transactions (receipts/disbursements), processing operations, as well as sorting operations of other banks'' cash in automated processing equipment, and submit a report containing the relevant information for the month to the Central Bank no later than the first 5 (five) working days of the following month in an electronic form certified by the strengthened electronic signature of the person responsible for submitting these reports;<br>&nbsp;</p><p>create conditions for monitoring by the Central Bank;<br>&nbsp;</p><p>fulfill its obligations under contracts concluded with other banks related to its activity.</p>', 1, 2, '2025-09-19 18:56:59.328251', '2025-09-19 18:56:59.328251', NULL);


