INSERT INTO public."PaymentAgentCaptionTranslations" VALUES (1, '<p>Bank, dni tkilat v elektron pul tkilat&nbsp;dni xidmtlri v dni sistemlri haqqnda Qanunun 3.1.1-ci, 3.1.2-ci v 3.1.4-c maddlrind nzrd tutulmu dni xidmtlrinin gstrilmsi, bank v elektron pul tkilat eyni zamanda elektron pulun sat v elektron pulun qalq dyrinin geri dnilmsi n lk daxilind dni agentini clb ed bilrlr. dni xidmti tchizats clb etdiyi dni agentlrinin dni xidmtlri zr faliyytin gr tam msuliyyt dayr.</p><p>&nbsp;</p><p>dni agenti  bank, dni tkilat v ya elektron pul tkilat il balanlm mqavil sasnda onun adndan x edrk dni xidmtlrini gstrn hquqi xs v ya sahibkarlq faliyytini hquqi xs yaratmadan hyata keirn fiziki xs.</p><p><br>Mrkzi Bank nzart subyektlrinin v dni agentlrinin ictimaiyyt n aq olan reyestrini trtib edir. Reyestr nzart subyektlrinin, onlarn filial v nmayndliklrinin adlar, hquqi nvan, rhbr xslrinin adlar, verilmi v lv edilmi lisenziyalarn qeydiyyat nmrsi v tarixi, hyata keirilmsin lisenziya verilmi faliyyt nv, o cmldn dni agentlrinin ad, nvan, rhbr xslri (hquqi xs olduqda), hyata keirilmlrin icaz verilmi faliyyt nvlri, faliyytin xitam verilmi nzart subyektlri v dni agentlri bard mlumatlar daxil edilir.</p>', 1, 1, '2025-09-20 07:48:35.024094', '2025-09-20 07:48:35.024095', NULL);
INSERT INTO public."PaymentAgentCaptionTranslations" VALUES (2, '<p>Banks, payment institutions and electronic money institutions may involve payment agents domestically to provide the payment services specified in Articles 3.1.1, 3.1.2 and 3.1.4 of the Law of the Republic of Azerbaijan ''on Payment Services and Payment Systems''. Additionally, banks and electronic money institutions may involve payment agents domestically to sell electronic money and refund the residual value of electronic money. Payment system providers are fully responsible for the payment services provided by payment agents they involve.</p><p>&nbsp;</p><p>A payment agent is a a legal entity or an unincorporated individual providing payment services on behalf of a bank, a payment institution or an electronic money institution based on the agreement concluded with them.</p><p>&nbsp;</p><p>The Central Bank maintains a public register of supervised entities and payment agents. The Register includes names of supervised entities, their branches and representative offices, legal addresses, names of their officials, registration numbers and dates of licenses issued and revoked, types of licensed activities, including the payment agent''s name, address, managers (if a legal entity), types of licensed activities, supervised entities terminated and information about payment agents.</p>', 1, 2, '2025-09-20 07:48:35.024132', '2025-09-20 07:48:35.024132', NULL);


