INSERT INTO public."PolicyAnalysisTranslations" VALUES (1, '<p><strong>1. mumi mddalar&nbsp;</strong><br>Bu Metodoloji rhbrlik Azrbaycan Respublikasnn Mrkzi Banknda (bundan sonra - AMB) Pul siyasti v maliyy sabitliyi komitsinin iclaslar n analitik materiallarn hazrlanmas mqsdil istifad olunan Proqnozladrma v siyast thlili sisteminin mahiyytini, mrhllrini v idaretm rivsini myyn edir.<br><br><strong>2. Anlaylar v akronimlr</strong></p><p>2.1. Bu Metodoloji rhbrlikd istifad olunan anlaylar v akronimlr aadak mnalar ifad edir:&nbsp;<br>2.1.1. PSTS  Proqnozladrma v siyast thlili sistemi;&nbsp;<br>2.1.2. PSTS qrupu  Proqnozladrma v siyast thlili sistemi rivsind Analitik blokun mkdalarndan tkil olunan qrup;&nbsp;<br>2.1.3. PSMSK  Pul siyasti v maliyy sabitliyi komitsi;&nbsp;<br>2.1.4. PSMSK-nin zvlri  AMB-nin dar Heyti v mvafiq rhbr xslrindn tkil olunmu kollegial orqan;&nbsp;<br>2.1.5. Analitik blok  Pul siyasti, Statistika v Tdqiqatlar departamentlri;&nbsp;<br>2.1.6. Qeyri-struktur modellr  dyinlr arasnda qarlql laqy dair he bir mhdudiyytin ttbiq olunmad ekonometrik modellr;&nbsp;<br>2.1.7. DST  dinamik stoxastik mumi tarazlq modeli;&nbsp;<br>2.1.8. RPM  rblk proqnozladrma modeli;&nbsp;<br>2.1.9. Pul siyasti qrar  faiz dhlizinin parametrlrin v pul siyastinin aralq v mliyyat hdflrin dair qrarlarn mcmusu.<br><br><strong>3. Proqnozladrma v siyast thlili sisteminin mqsdi v mahiyyti</strong></p><p>3.1.Qabaqcl mrkzi banklarn tcrbsind olduu kimi AMB-d d PSTSnin qurulmasnda sas mqsd PSMSK trfindn pul v mznn siyastin dair qrarlarn qbul olunmas n analitik dstk gstrmkdir.<br>3.2.PSTS-nin ttbiqi qlobal mhitd, trfda lklrd gedn iqtisadi proseslrin v Azrbaycanda cari makroiqtisadi vziyytin thlilin, onu xarakteriz edn sas gstricilri (inflyasiya, mcmu buraxl ksiri, iqtisadi artm, mcmu tlbin komponentlri, cari mliyyatlar balans v s.) mmkn inkiaf ssenarilri zr proqnozladrmaa imkan verir.<br>3.3.PSTS rivsind biznes proseslr 5 mrhldn ibart olmaqla PSMSK-nin iclasndan 5 hft vvl balayr. lk 3 mrhl 4 hftlik mddti hat edir. Bu zaman thlil nticlri v ssenarilr zr proqnozlar hazrlanaraq tqdimat formatnda PSMSK-nin zvlrin tqdim edilir. PSTS-nin son 2 mrhlsi 5-ci hfty tsadf edir. Bu mrhllrd PSMSK iclasnn keirilmsi, qrarlarn qbul edilmsi v ictimaiyyt aqlanmas tmin edilir.<br>3.4. PSTS rivsind mrhllr v hftlik i blgs zr biznes proseslrin fasilsiz v vaxtnda hyata keirilmsi ciddi hmiyyt dayr v myyn olunmu qrafikdn knarlama PSTS-nin mahiyyt v mqsdil ziddiyyt tkil edir.<br>&nbsp;</p><p><strong>4. PSTS rivsind biznes proseslr</strong></p><p>4.1. PSTS rivsind hyata keiriln biznes proseslr aadak mrhllri hat edir:<br>4.1.1. 1-ci mrhl (1-ci hft): tqdimatn mndricatnn hazrlanmas. Bu mrhld PSTS qrupunun koordinatoru trfindn lk iqtisadiyyatnda, qlobal mhitd v trfda lklrd gedn iqtisadi proseslr nzr alnmaqla PSMSK-d mzakiry xarlacaq tqdimatn mndricat (hat edilck aktual mvzular) hazrlanr. Mndricat vvlc Analitik blokun mkdalar arasnda mzakir edilrk tkmilldirilir. Daha sonra PSTS qrupunun koordinatoru tqdimatn mndricatn PSMSK-nin zvlrin ry n epot vasitsil mvafiq hftnin 3-c i gn tqdim edir. PSMSK-nin zvlri hmin hftnin sonuna qdr mndricata dair ry v tkliflr bildir bilrlr.<br>4.1.2. 2-ci mrhl (2-ci hft): frziyylrin v ssenarilrin myyn edilmsi. Bu mrhld AMB-nin faliyytindn asl olmayan amillr (neftin qiymti v hasilat hcmi, dvlt bdcsinin parametrlri, qlobal mt birjalarnda qiymtlr, trfda lklrd inflyasiya, iqtisadi artm v s.) dair PSTS qrupu trfindn istinad olunacaq frziyylr v baza ssenarinin parametrlri hazrlanr. Analitik blok daxilind mzakirlrdn sonra baza ssenarinin reallamasna mane ola bilck risklr myyn edilir. Risklr sasnda alternativ ssenarilr (bdbin v nikbin ssenarilr) trtib oluna bilr. Hazrlanm frziyylr, baza v alternativ ssenarilr mvafiq hftnin 3-c i gn PSTS qrupunun koordinatoru trfindn PSMSK-nin zvlrin ry n tqdim edilir. Mzakirlrdn sonra frziyylr v ssenarilr konsensus sasnda PSMSK-nin zvlri trfindn qbul edilir. Bu mrhld paralel olaraq ekonometrik modellrin verilnlr bazasnn v thlillr n zruri olan mlumatlarn yenilnmsin balanr.<br>4.1.3. 3-c mrhl (3-c v 4-c hftlr): thlillrin aparlmas, proqnozlarn hazrlanmas. lk 2 mrhld razladrlm mndricat, frziyy v ssenarilr sasn PSTS qrupunun zvlri mvafiq thlillr aparr v makroiqtisadi gstricilrin proqnozlarn hazrlayr. Analitik blok daxilind mzakir sasnda thlil v proqnozlar zrind tkmilldirm v dqiqldirmlr aparlr. Yekun nticlr saslanaraq pul siyasti qrarna dair tkliflr hazrlanr.<br>4.1.4. 4-c mrhl (5-ci hft): PSMSK-nin iclasnn keirilmsi. Hazrlanm tqdimat v materiallar iclasn keirilcyi tarixdn n az 1 i gn vvl PSMSK-nin zvlrin tqdim edilir. clasda tqdimat Analitik blokun kuratoru v ya bloka daxil olan departamentlrdn birinin direktoru hyata keirir. PSMSK iclas 2 gn keirilir. clasn birinci gn tqdimat v mvafiq dqiqldirici suallar, ikinci gn is pul siyastin dair tkliflr mzakir edilir. PSMSK-nin tvsiylri nzr alnmaqla AMB dar Heyti pul siyasti qrarn qbul edir. PSMSK-nin iclaslarna dair protokol trtib olunur v qrar protokolla rsmildirilir.<br>4.1.5. 5-ci mrhl (5-ci hft): qrarn geni ictimaiyyt aqlanmas. AMB-nin rsmi internet shifsind vvlcdn myyn edilmi tarix v vaxtda pul siyasti qrar presreliz vasitsil ictimaiyyt aqlanr. Hr ilin pul siyastinin sas istiqamtlri bard byanatnda ncdn aqlanm qrafik zr qrarlara dair mtbuat konfrans keirilir.<br>4.1.6. PSMSK trfindn qrar qbul olunan hft AMB-ni tmsil edn msul xslr n pul v mznn siyasti il bal sakit hft hesab olunur. Bu hft rzind qrarn elan olunduu gndk mvafiq ictimai kommunikasiya hyata keirilmir.</p><p>&nbsp;</p><p><strong>5. PSTS rivsind proqnozladrma prosesi</strong></p><p>5.1. Proqnozladrma prosesi  mrhldn ibartdir: naukastinq, qsamddtli proqnozladrma v ortamddtli proqnozladrma.<br>5.1.1. Naukastinq mrhlsind dvr bitdikdn, lakin rsmi statistik mlumatlar drc olunmazdan nc zruri makroiqtisadi gstricilr alternativ mlumatlar vasitsil qiymtlndirilir.<br>5.1.2. Naukastinqin nticlrindn istifad etmkl qeyri-struktur modellr vasitsil gstricilrin qsamddtli (1-3 rblk) proqnozu verilir.<br>5.1.3. Hm naukastinq, hm d qsamddtli proqnoz nticlri sas modellr olan DST v ya RPM- daxil edilrk ortamddtli proqnozlar hazrlanr.</p><p>&nbsp;</p><p><strong>6. PSTS-nin idaretm v tkilati msllri</strong></p><p>6.1.PSTS qrupu Analitik bloka daxil olan departamentlrin mkdalarndan tkil olunur. Qrupa koordinatorluq funksiyas Pul siyasti v ya Tdqiqatlar departamentlrindn birinin direktor mavini v ya b risi trfindn hyata keirilir.<br>6.2.PSTS qrupunun zvlri PSTS prosesind istifad olunan btn analitik v statistik mlumatlara, hminin ekonometrik modellr x imkanna malik olurlar.<br>6.3.PSTS-nin mrhllri zr knarlamalarn aradan qaldrlmas zr zruri tdbirlr Analitik blokun kuratoru v ya bloka daxil olan departamentlrin direktorlar il koordinasiya edilir.</p><p>&nbsp;</p><p><strong>7. Yekun mdda</strong></p><p>Metodoloji rhbrlik tsdiq edildiyi gndn qvvy minir.</p>', 1, 1, '2025-09-20 18:14:32.73681', '2025-09-20 18:14:32.73681', NULL);
INSERT INTO public."PolicyAnalysisTranslations" VALUES (2, '<p><strong>1. General Provisions</strong><br>This Methodological Guidance defines the essence, stages, and management framework of the Forecasting and Policy Analysis System (hereinafter  FPAS) used at the Central Bank of the Republic of Azerbaijan (hereinafter  CBA) for preparing analytical materials for the meetings of the Monetary Policy and Financial Stability Committee (hereinafter  MPFSC).</p><p>&nbsp;</p><p><strong>2. Concepts and Acronyms</strong></p><p>2.1. The following concepts and acronyms used in this Methodological Guidance have the meanings indicated below:<br>2.1.1. FPAS  Forecasting and Policy Analysis System;<br>2.1.2. FPAS Group  a group composed of employees of the Analytical Block within the FPAS framework;<br>2.1.3. MPFSC  Monetary Policy and Financial Stability Committee;<br>2.1.4. Members of MPFSC  a collegial body composed of the CBA Management Board and relevant executives;<br>2.1.5. Analytical Block  Departments of Monetary Policy, Statistics, and Research;<br>2.1.6. Unstructured Models  econometric models without any restrictions on the interactions between variables;<br>2.1.7. DSGE  Dynamic Stochastic General Equilibrium model;<br>2.1.8. QPM  Quarterly Projection Model;<br>2.1.9. Monetary Policy Decision  a set of decisions regarding the parameters of the interest rate corridor and the intermediate and operational targets of monetary policy.</p><p>&nbsp;</p><p><strong>3. Purpose and Essence of the Forecasting and Policy Analysis System</strong></p><p>3.1. As in advanced central banks, the main purpose of establishing FPAS at the CBA is to provide analytical support for the MPFSC in making decisions on monetary and exchange rate policies.<br>3.2. The application of FPAS allows for analysis of global economic processes, developments in partner countries, and the current macroeconomic situation in Azerbaijan, forecasting key indicators (inflation, output gap, economic growth, components of aggregate demand, current account balance, etc.) under possible development scenarios.<br>3.3. Business processes within FPAS consist of 5 stages, beginning 5 weeks before the MPFSC meeting. The first 3 stages cover a 4-week period, during which analysis results and scenario-based forecasts are prepared and presented to the MPFSC members in presentation format. The final 2 stages coincide with the 5th week, during which the MPFSC meeting is held, decisions are made, and results are communicated to the public.<br>3.4. Continuous and timely implementation of business processes according to weekly stages within FPAS is crucial; deviation from the established schedule contradicts the essence and purpose of FPAS.</p><p>&nbsp;</p><p><strong>4. Business Processes within FPAS</strong></p><p>4.1. Business processes implemented under FPAS include the following stages:<br>4.1.1. Stage 1 (Week 1): Preparation of the presentation content. The FPAS Group Coordinator prepares the draft content (key topics to be covered) for discussion at the MPFSC meeting, considering economic developments in Azerbaijan, the global environment, and partner countries. The draft content is first discussed and refined among Analytical Block staff, then submitted by the FPAS Group Coordinator to MPFSC members for feedback by the third working day of the week. Members provide feedback and suggestions by the end of the week.<br>4.1.2. Stage 2 (Week 2): Determination of assumptions and scenarios. The FPAS Group prepares reference assumptions and parameters for the baseline scenario regarding factors beyond the CBA''s control (oil prices and production volumes, state budget parameters, global commodity prices, inflation and economic growth in partner countries, etc.). Risks that may prevent the realization of the baseline scenario are identified, and alternative scenarios (pessimistic and optimistic) may be developed. Prepared assumptions and scenarios are submitted by the FPAS Group Coordinator to MPFSC members for review on the third working day. After discussions, assumptions and scenarios are approved by consensus. Simultaneously, the database for econometric models and required analytical data are updated.<br>4.1.3. Stage 3 (Weeks 3-4): Conducting analyses and preparing forecasts. Based on the agreed content, assumptions, and scenarios from the first two stages, FPAS Group members conduct analyses and prepare macroeconomic forecasts. Discussions within the Analytical Block refine the analyses and forecasts. Final results are used to develop proposals for the monetary policy decision.<br>4.1.4. Stage 4 (Week 5): MPFSC meeting. Prepared presentations and materials are provided to MPFSC members at least one working day before the meeting. The presentation is delivered by the curator of the Analytical Block or the director of one of the departments within the block. The MPFSC meeting lasts two days: the first day covers the presentation and clarifying questions, and the second day discusses proposals on monetary policy. Recommendations of the MPFSC are considered by the CBA Management Board in adopting the monetary policy decision. Minutes are prepared and formalize the decision.<br>4.1.5. Stage 5 (Week 5): Public announcement of the decision. The monetary policy decision is published on the CBA official website at the pre-determined date and time. Press conferences are held in accordance with the pre-announced schedule on the main directions of the annual monetary policy.</p><p>4.1.6. The week in which the MPFSC adopts a decision is considered a quiet week for CBA representatives, during which no public communications on monetary and exchange rate policy are conducted until the decision is announced.</p><p>&nbsp;</p><p><strong>5. Forecasting Process within FPAS</strong></p><p>5.1. The forecasting process consists of three stages: nowcasting, short-term forecasting, and medium-term forecasting.<br>5.1.1. In the nowcasting stage, necessary macroeconomic indicators are estimated using alternative data before official statistics are published.<br>5.1.2. Using the results of nowcasting, short-term forecasts (1-3 quarters) are produced with unstructured models.<br>5.1.3. Both nowcasting and short-term forecasts are incorporated into main models (DSGE or QPM) to generate medium-term forecasts.</p><p>&nbsp;</p><p><strong>6. Management and Organizational Matters of FPAS</strong></p><p>6.1. The FPAS Group is composed of employees from the departments of the Analytical Block. Coordination is provided by a Deputy Director or Head of Department from either the Monetary Policy or Research Department.<br>6.2. FPAS Group members have access to all analytical and statistical data, as well as econometric models used in the FPAS process.<br>6.3. Necessary measures to address deviations from FPAS stages are coordinated with the curator of the Analytical Block or directors of the departments within the block.</p><p>&nbsp;</p><p><strong>7. Final Provision</strong></p><p>This Methodological Guidance enters into force from the date of approval.</p>', 1, 2, '2025-09-20 18:14:32.736859', '2025-09-20 18:14:32.736859', NULL);


