INSERT INTO public."PublicationCaptionTranslations" VALUES (1, '<p>Azrbaycan Respublikasnn Mrkzi Banknda aparlan tdqiqat ilrinin sas mqsdi lkd effektiv makroiqtisadi, o cmldn pul v mznn siyastinin analitik-empirik tdqiqat bazasn formaladrmaq, sosial-iqtisadi inkiaf dstklyn makroiqtisadi sabitliyin fundamentallarnn akarlanmasna thf vermkdir. Tdqiqat ilri dvri xarakter dayr v mtmadi olaraq elektron formatda ictimaiyyt tqdim olunur.</p><p>&nbsp;</p><p>Tdqiqatlarn nticlri il <strong>i mqallr silsilsi</strong>, qurulmu modellr v indekslrl <strong>Ekonometrik modellr</strong> blmsind, tdqiqat ynml lav materiallarla <strong>Digr nrlr</strong> blmsind tan olmaq mmkndr.</p>', 1, 1, '2025-09-29 17:06:18.04082', '2025-09-29 17:06:18.04082', NULL);
INSERT INTO public."PublicationCaptionTranslations" VALUES (2, '<p>The main goal of researches conducted at the Central Bank of the Republic of Azerbaijan is to shape an analytic  empirical research base of the effective macroeconomic, and monetary and exchange rate policy in the country, and contribute to discovery of macroeconomic resilience fundamentals supporting socio-economic development. Periodic researches are released for public use electronically twice a year.</p><p>&nbsp;</p><p>Findings of researches are presented in the <strong>Working paper series</strong>, built models and indices in <strong>Empirical models</strong>, and research oriented additional materials in the <strong>Other publications </strong>sections.</p>', 1, 2, '2025-09-29 17:06:18.040868', '2025-09-29 17:06:18.040868', NULL);


