INSERT INTO public."RealTimeSettlementSystemCaptionTranslations" VALUES (1, 'Real Vaxt Rejimind Hesablamalar Sistemi (AZIPS) real vaxt rejimind ilyn, krmlrin ayr-ayrlqda hr dni sndi zr emal olunmasn tmin edn mcmu dnilr sistemidir. AZIPS-d hesablamalar milli (Azrbaycan Manat - AZN) v xarici valyutalarda aparlr. Sistem 9:20-dn 17:00-a kimi itiraklardan dni sndlrinin qbulunu hyata keirir. mliyyatlar hr bir itiraknn Mrkzi Bankda alm mvafiq mxbir hesablarnda olan vsaitlr v digr itiraklardan daxil olan vsaitlr hesabna hyata keirilir. Mxbir hesablarda vsait atmazl yarandqda dni sndlri nvbd saxlanlr v itrak trfindn tyin olunmu prioritetlr sasnda emal olunur. Bu prioritetlr rivsind dni sndlri FIFO (1-ci daxil olan 1-ci emal olunur) prinsipi il ilnilir. Nvbd olan sndlr itiraklar trfindn geri arla v prioritetlri dyidiril bilr. Vsait atmazlndan gn rzind nvbd qalan sndlr gnn sonunda sistem trfindn avtomatik rejimd lv olunur v bu haqda itiraklara mvafiq mlumat gndrilir. Gn rzind itiraklarn sorular sasnda onlara mxbir hesablarnda aparlan mliyyatlar, nvbd olan sndlr v qalq haqqnda mlumatlar verilir. tiraklar sistem 10 gn vvldn glck valyutalama tarixi il dni sndlri gndr bilrlr.', 1, 1, '2026-02-04 16:40:03.571125+04', '2026-02-04 16:40:03.571125+04', NULL);
INSERT INTO public."RealTimeSettlementSystemCaptionTranslations" VALUES (2, 'Real-Time Settlement System (AZIPS) is a real-time, aggregated payment system that ensures the processing of transfers separately for each payment document. Settlements in AZIPS are carried out in national (Azerbaijani Manat - AZN) and foreign currencies. The system accepts payment documents from participants from 9:20 to 17:00. Operations are carried out at the expense of the funds in the corresponding correspondent accounts of each participant opened with the Central Bank and funds received from other participants. In the event of a shortage of funds in correspondent accounts, payment documents are kept in a queue and processed based on the priorities set by the participant. Within these priorities, payment documents are processed on the FIFO (first-in, first-out) principle. Documents in the queue can be recalled by participants and their priorities can be changed. Documents that remain in the queue during the day due to a shortage of funds are automatically canceled by the system at the end of the day and relevant information is sent to participants. During the day, participants are provided with information on transactions carried out on their correspondent accounts, documents in the queue, and balances based on their requests. Participants can send payment documents to the system with a future currency exchange date up to 10 days in advance.', 1, 2, '2026-02-04 16:40:03.57118+04', '2026-02-04 16:40:03.57118+04', NULL);


