INSERT INTO public."ReceptionCitizenTranslations" VALUES (1, 'Qbul qaydas', 'Azrbaycan Respublikasnn Mrkzi Bank trfindn vtndalarn qbul edilmsi Vtndalarn mracitlri haqqnda Azrbaycan Respublikasnn Qanununa, Azrbaycan Respublikas Prezidentinin 23 iyun 2016-c il tarixli, 950 nmrli Frman il tsdiq edilmi Dvlt v bldiyy orqanlarnda, dvlt v ya bldiyy mlkiyytind olan v ya paylarnn (shmlrinin) nzart zrfi dvlt v ya bldiyyy mxsus olan hquqi xslrd v bdc tkilatlarnda vtndalarn mracitlri il bal kargzarln aparlmas Qaydasna v Azrbaycan Respublikas Mrkzi Banknn Azrbaycan Respublikasnn Mrkzi Banknda istehlaklarn v investorlarn mracitlrin baxlmas v qbulu Qaydalarnda nzrd tutulmu qaydada hyata keirilir.', 1, 1, '2025-12-02 14:17:00.881468', '2025-12-02 14:17:00.881468', NULL);
INSERT INTO public."ReceptionCitizenTranslations" VALUES (2, 'Admission procedure', 'The Central Bank of the Republic of Azerbaijan shall accept citizens in accordance with the Law of the Republic of Azerbaijan On Citizens'' Appeals, the Rules for conducting clerical work regarding citizens'' appeals in state and municipal bodies, legal entities owned by the state or municipality or whose shares (stocks) are controlled by the state or municipality approved by the Decree of the President of the Republic of Azerbaijan No. 950 dated June 23, 2016, and the Rules of the Central Bank of the Republic of Azerbaijan Consideration and acceptance of appeals of consumers and investors in the Central Bank of the Republic of Azerbaijan.', 1, 2, '2025-12-02 14:17:00.881547', '2025-12-02 14:17:00.881547', NULL);
INSERT INTO public."ReceptionCitizenTranslations" VALUES (3, 'Qbul cdvli', 'Mrkzi Bankn mvafiq struktur blmsinin slahiyytli mkdalar trfindn vtndalarn qbul gnlri i gnlri hesab ediln bazar ertsi-cm axam gn saat 09:00-16:00-dk, cm gn is 09:00-13:00-dk (nahar fasilsi 13:00-14:00) myyn edilir. Vtndalarn mvafiq struktur blmnin slahiyytli mkdalar trfindn qbulu gnlri Mrkzi Bankn inzibati binasnn giriind mlumat stendind yerldirilir.', 2, 1, '2025-12-02 14:42:40.390194', '2025-12-02 14:42:40.390194', NULL);
INSERT INTO public."ReceptionCitizenTranslations" VALUES (4, 'Admission schedule', 'The days of reception of citizens by authorized employees of the relevant structural unit of the Central Bank are determined as working days from Monday to Thursday from 09:00 to 16:00, and on Friday from 09:00 to 13:00 (lunch break from 13:00 to 14:00). The days of reception of citizens by authorized employees of the relevant structural unit are posted on the information stand at the entrance to the administrative building of the Central Bank.', 2, 2, '2025-12-02 14:42:40.390195', '2025-12-02 14:42:40.390195', NULL);


