INSERT INTO public."RegistrationSecurityCaptionTranslations" VALUES (1, '<p>Kapital bazarnn sas itiraklarndan biri emitentlrdir. Emitent investisiya qiymtli kazlarnn emissiyasn Qiymtli kazlar bazar haqqnda Azrbaycan Respublikasnn Qanununun 2-ci fsli il myyn edilmi qaydada hyata keirn hquqi xs, dvlt (mvafiq qaydada buna slahiyytlndirilmi dvlt orqan vasitsil) v ya bldiyydir. Emitent buraxd qiymtli kazlarn mlkiyytisi deyildir.</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Emitentlr trfindn investisiya qiymtli kazlarnn (shm v korporativ istiqraz) emissiyas aadak mrhllrl hyata keirilir:</strong><br><br>- Emitent investisiya qiymtli kazlarnn buraxl haqqnda qrar qbul edir. Ktlvi tklif ediln investisiya qiymtli kazlar n emitent investisiya qiymtli kazlarnn emissiya prospektini v ya informasiya memorandumunu trtib edir;<br><br>- Emitent qiymtli kazlarn dvlt qeydiyyatna alnmas v ktlvi tklif ediln investisiya qiymtli kazlar n emissiya prospekti v ya informasiya memorandumunun tsdiq edilmsi n Mrkzi Banka mract edir;<br>&nbsp;</p><ul><li>- Mrkzi Bank investisiya qiymtli kazlarnn buraxlnn dvlt qeydiyyat v emissiya prospektinin v ya informasiya memorandumunun tsdiq edilmsi n tqdim ediln sndlr 10 (on) i gn mddtind baxr. Qeydiyyatdan imtina n mvafiq hallar olmadqda, investisiya qiymtli kazlarnn buraxl dvlt qeydiyyatna alnr v emissiya prospekti v ya informasiya memorandumu tsdiq edilir. Mrkzi Bank emitent investisiya qiymtli kazlarnn dvlt reyestrindn xar v emissiya prospektinin tsdiq olunmas haqqnda yazl bildiri tqdim edir.<br>&nbsp;</li></ul><p>- Emitent Mrkzi Bank trfindn tsdiq edilmi emissiya prospekti v ya informasiya memorandumunu Mrkzi Bankn Mlumatlarn Elektron Aqlanmas Sistemi vasitsil ictimaiyyt aqlayr;<br>&nbsp;</p><p>- Emitent qiymtli kazlarn saxlanmas v qiymtli kaz mlkiyytilrinin reyestrinin aparlmas xidmtlrinin gstrilmsi zr Milli Depozit Mrkzi il mqavil balayr;</p><p>Emitent qiymtli kazlarn fond birjasnda v ya birjadanknar bazarda yerldirir;<br>&nbsp;</p><p>- Qiymtli kazlarn yerldirilmsi baa atdqdan sonra emitent 10 (on) i gn rzind Mrkz Banka qiymtli kazlarn emissiyasnn v ya ktlvi tklifinin yekunlar haqqnda hesabat v yerldirilmi qiymtli kazlarn say bard Milli Depozit Mrkzi trfindn veriln aray tqdim edir;<br>&nbsp;</p><p>- Ktlvi tklif ediln qiymtli kazlar zr ktlvi tklifin yekunlar haqqnda hesabat tsdiq olunduqdan sonra emitent bu mlumat Mrkzi Bankn Mlumatlarn Elektron Aqlanmas Sistemi vasitsil ictimaiyyt aqlayr.</p><p>&nbsp;</p><p>Mrkzi Bank investisiya qiymtli kazlarnn buraxlnn dvlt qeydiyyatn v emissiya prospektinin tsdiqini, hminin qiymtli kazlarn buraxlnn v emissiya prospektlrinin<strong> dvlt reyestrini</strong> aparr.</p><p>&nbsp;</p><p>&nbsp;</p><p>Emitentlr Qiymtli kazlar bazar haqqnda Azrbaycan Respublikasnn Qanununun 75-ci maddsin mvafiq olaraq,<strong> illik hesabatlarn</strong> (maliyy hesabatlar v onun yoxlanlmas zr knar auditor ryi v idaretm hesabat) Mrkzi Banka tqdim etmkl ictimaiyyt aqlamaldr:<br><br>- Kredit tkilatlar, sortalar, tkrarsortalar, qiymtli kazlar bazarnda lisenziyaladrlan xslr, habel investisiya fondlar v onlarn idarilri trfindn illik maliyy hesabatlarnn tqdim edilmsi v drc edilmsi qaydas Azrbaycan Respublikasnn mvafiq sahvi qanunlar il tnzimlnir.<br><br>&nbsp;</p><p>- Digr emitentlr (mikro sahibkarlq subyektlri istisna olmaqla) Azrbaycan Respublikas Nazirlr Kabinetinin 27.05.2010-cu il tarixli 97 nmrli Qrar il tsdiq edilmi <a target="_blank" rel="noopener noreferrer" href="http://www.e-qanun.az/framework/19630"></a><a target="_blank" rel="noopener noreferrer" href="https://e-qanun.az/framework/19630">Kommersiya tkilatlarnn illik maliyy hesabatlarnn v birldirilmi (konsolid edilmi) maliyy hesabatlarnn tqdim edilmsi v drc edilmsi Qaydalar</a><a target="_blank" rel="noopener noreferrer" href="http://www.e-qanun.az/framework/19630"></a>na uyun olaraq illik maliyy hesabatlarn v birldirilmi (konsolid edilmi) maliyy hesabatlarn hesabat dvr baa atdqdan sonra, sonrak ilin aprel aynn 30-dan v iyun aynn 30-dan gec olmayaraq tqdim etmli v drc etmlidirlr.<br>&nbsp;</p><p>Qiymtli kazlar ktlvi tklif edilmi v tnzimlnn bazarda ticart buraxlm emitentlr <strong>illik hesabatlarn</strong>, hminin maliyy ilinin ilk alt ay baa atdqdan sonra iki aydan gec olmayaraq <strong>yarmillik hesabatlarn</strong> (aralq maliyy hesabat, aralq idaretm hesabat) Mrkzi Bankn <a target="_blank" rel="noopener noreferrer" href="https://cbar-next.vercel.app/az/meas">Mlumatlarn Elektron Aqlanmas Sistemi</a> vasitsil ictimaiyyt aqlamaldr.<br><br><br><strong>nvestisiya qiymtli kazlarnn buraxlnn dvlt qeydiyyatna alnmas v dvriyydn xarlmas aadak qaydada hyata keirilir:</strong><br><br>1. nvestisiya qiymtli kazlarnn buraxlnn dvlt qeydiyyatna alnmas;</p><p>2. Hquqi xslrin yenidn tkili zaman investisiya qiymtli kazlarnn emissiyas v konvertasiyas;</p><p>3. Shmlrin birldirilmsi, xrdalanmas v onlarn nominal dyrinin artrlmas zaman shmlrin emissiyas;</p><p>4. nvestisiya qiymtli kazlarnn dvriyydn xarlmas;</p><p>5. nvestisiya qiymtli kazlarnn Azrbaycan Respublikas razisindn knarda buraxl v yerldirilmsi;</p><p>6. Emissiya prospektind v buraxlla bal qrara lav v dyiikliklrin edilmsi;</p><p>7. nvestisiya qiymtli kazlarnn emissiyasnn yekunlar haqqnda hesabatn tsdiq edilmsi.</p>', 1, 1, '2025-09-20 08:11:16.969252', '2025-09-20 08:11:16.969252', NULL);
INSERT INTO public."RegistrationSecurityCaptionTranslations" VALUES (2, '<p>Issuers are one of the main participants of the capital market. The issuer is a legal entity, state (through a duly authorized state body) or municipality that issues investment securities as per Chapter 2 of the Law of the Republic of Azerbaijan on the Securities Market. The issuer is not the owner of the securities it issues.</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Issuance of investment securities (shares and corporate bonds) by issuers is carried out in the following stages:</strong><br>&nbsp;</p><p>- The issuer adopts a decision to issue investment securities. For publicly offered investment securities the issuer develops an emission prospectus or information memorandum;<br>&nbsp;</p><p>- The issuer applies to the Central Bank for approval of the prospectus and information memorandum for state registration of securities and publicly offered investment securities;<br>&nbsp;</p><p>- The Central Bank reviews the documents submitted for state registration of investment securities and approval of the emission prospectus or information memorandum within 10 (ten) working days. Unless there are grounds for refusal of registration, the issuance of investment securities is state registered and the emission prospectus or information memorandum approved. The Central Bank submits to the issuer an extract from the state register of investment securities and a written notice on approval of the emission prospectus.<br>&nbsp;</p><p>- The issuer makes public the emission prospectus or information memorandum approved by the Central Bank through the Central Bank''s Electronic Data Disclosure System;<br>&nbsp;</p><p>- The issuer signs an agreement with the National Depository Center on provision of the services on safekeeping of securities and maintaining the register of owners of securities;<br>&nbsp;</p><p>- The issuer places its securities in the stock exchange or the OTC market;<br>&nbsp;</p><p>- Within 10 (ten) working days after the placement of securities, the issuer submits to the Central Bank a report on results of issuance or public offering of securities and a statement from the National Depository Center on the number of placed securities;<br>&nbsp;</p><p>- After the report on results of public offering of publicly offered securities is approved, the issuer makes this information public through the Central Bank''s Electronic Data Disclosure System.<br>&nbsp;</p><p>The Central Bank maintains the state registration of issue of investment securities and approval of the emission prospectus, as well as the <strong>state register</strong> of the issuance of securities and emission prospectus.<br>&nbsp;</p><p>&nbsp;</p><p>According to Article 75 of the Law of the Republic of Azerbaijan on the Securities Market, the issuers should make public their<strong> annual reports</strong> (financial statements and an external auditor opinion and management report) by submitting them to the Central Bank.<br>&nbsp;</p><ul><li>- Submission and publication of annual financial reports of credit institutions, insurers, and reinsurers, persons licensed in the securities market, as well as investment funds and their managers is regulated with related laws of the Republic of Azerbaijan.<br>&nbsp;</li><li>- Other issuers (except for micro businesses) should submit and publish annual financial reports and consolidated financial statements after the end of the reporting period, no later than April 30 and June 30 of the following year in accordance with the ''Regulations on submission and publication of annual financial reports and consolidated financial statements of commercial organizations'' approved at Resoution # 97 of the Cabinet of Ministers of the Republic of Azerbaijan dated 27.05.2010.<br><br>Issuers whose securities are publicly offered and admitted to trading in a regulated market should make public their annual reports and also semi-annual reports (interim financial report, interim management report) no later than two months after the end of the first six months of the financial year through the Central Bank''s <a target="_blank" rel="noopener noreferrer" href="https://www.cbar.az/page-182/about-esid">Electronic Data Disclosure System</a>.<br><br>&nbsp;</li></ul><p><br><strong>Investment securities are state registered and withdrawn from circulation as follows:</strong><br><br>1. State registration of the issuance of investment securities;</p><p>2. Issuance and conversion of investment securities during reorganization of legal entities;</p><p>3. Issuance of stocks during merger, split and increase of their nominal value;</p><p>4. Withdrawal of investment securities from circulation;</p><p>5. Issuance and placement of investment securities outside the territory of the Republic of Azerbaijan;</p><p>6. Making additions and changes to emission prospectus and the decision on the issuance;</p><p>7. Approval of the report on results of the issuance of investment securities.</p>', 1, 2, '2025-09-20 08:11:16.96929', '2025-09-20 08:11:16.96929', NULL);


