INSERT INTO public."RegistrationSecurityTranslations" VALUES (20, 'Hquqi xslrin yenidn tkili zaman investisiya qiymtli kazlarnn emissiyas v konvertasiyas', '<p>Hquqi xslrin yenidn tkili zaman investisiya qiymtli kazlarnn emissiyas v konvertasiyas<a target="_blank" rel="noopener noreferrer" href="http://huquqiaktlar.gov.az/StatementDetails.aspx?statementId=34231"> Hquqi xslrin yenidn tkili zaman investisiya qiymtli kazlarnn emissiyas v konvertasiyas Qaydasnn</a> tlblrin uyun olaraq hyata keirilir.<br>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Tqdim edilmli sndlr&nbsp;</strong></td><td><strong>Qeyd</strong></td></tr><tr><td>1. Yerldiriln qiymtli kazlarn buraxllarnn dvlt qeydiyyatna alnmas n <strong>riz</strong>;</td><td>riz Hquqi xslrin yenidn tkili zaman investisiya qiymtli kazlarnn emissiyas v konvertasiyas Qaydasnn 1 sayl lavsin uyun trtib edilmlidir.</td></tr><tr><td>2. Qiymtli kazlarn hr buraxl haqqnda <strong>qrar</strong>;</td><td>Qrar Mlki Mcllnin 107-6-c maddsinin v Hquqi xslrin yenidn tkili zaman investisiya qiymtli kazlarnn emissiyas v konvertasiyas Qaydasnn 2.2-ci bndinin tlblrin mvafiq qaydada trtib edilmlidir.</td></tr><tr><td>3. Yenidn tkil olunan hquqi xslrin yenidn tkili haqqnda qrarlarn qbul edildiyi mumi yncaqlarn protokollarndan hmin qrarlara dair yetrsayn v ssvermnin nticlrinin ks olunduu xarlar;</td><td>&nbsp;</td></tr><tr><td>4. Emitentin hquqi xs kimi dvlt qeydiyyatna alnmas haqqnda hadtnamnin v nizamnamsinin <strong>notariat qaydasnda</strong> v ya "nzibati icraat haqqnda" Azrbaycan Respublikasnn Qanununun 9-cu maddsind myyn edilmi qaydada tsdiq edilmi surtlri;</td><td>&nbsp;</td></tr><tr><td>5. Birlm, qoulma v ya evrilm halnda - <strong>thvil aktnn surt</strong>i;</td><td>&nbsp;</td></tr><tr><td>6. Blnm v ya ayrlma halnda - <strong>blnm</strong> <strong>balansnn</strong> surti;</td><td>&nbsp;</td></tr><tr><td>7. Tminatl istiqrazlarn yerldirilmsi zaman onlara konvertasiya edilck istiqrazlar zr verilmi tminatn qvvd olmas bard hmin tminat tqdim etmi xsin yazl bildirii v ya bel tminata xitam verildiyi halda, yeni tminatn verilmsini tsdiq edn sndin surti.</td><td>&nbsp;</td></tr></tbody></table></figure>', 4, 1, '2025-10-03 07:20:56.971806', '2025-10-03 07:20:56.971806', NULL);
INSERT INTO public."RegistrationSecurityTranslations" VALUES (21, 'Issuance and conversion of investment securities during reorganization of legal entities', '<p>Investment securities are issued and converted during reorganization of legal entities according to the requirements of the <a target="_blank" rel="noopener noreferrer" href="http://huquqiaktlar.gov.az/StatementDetails.aspx?statementId=34231">Regulations on issuance and conversion of investment securities during reorganization of legal entities</a>.<br>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Deliverables</strong></td><td><strong>Note</strong></td></tr><tr><td>1.&nbsp;<strong>Application</strong> on state registration of issuance of placed securities;</td><td>The application should be compiled in accordance with Annex 1 to the Regulations on issuance and conversion of investment securities during reorganization of legal entities.</td></tr><tr><td>2.&nbsp;<strong>Decision</strong> per issue of securities;</td><td>The decision should be compiled in accordance with Article 107-6 of the Civil Code and Item 2.2 of the Regulations on issuance and conversion of investment securities during reorganization of legal entities.</td></tr><tr><td>3.&nbsp;Excerpts from minutes of general meetings where decisions on reorganization of reorganized legal entities were made, reflecting the quorum on those decisions and voting results;</td><td>&nbsp;</td></tr><tr><td>4.<strong> Notarized copies</strong> of the issuer''s state registration as a legal entity and charter or copies approved in accordance with Article 9 of the Law of the Republic of Azerbaijan on Administrative Proceedings;</td><td>&nbsp;</td></tr><tr><td>5.&nbsp;<strong>Copy of an acceptance act</strong>  in case of a merger, acquisition or transformation;</td><td>&nbsp;</td></tr><tr><td>6.&nbsp;<strong>Copy of a dissolution balance</strong>  in case of dissolution or separation;</td><td>&nbsp;</td></tr><tr><td>7.&nbsp;Written notification of the person who provided collateral on validity of the collateral for the bonds to be converted during placement of secured bonds, or a copy of the document confirming new collateral in the event of termination of such collateral.</td><td>&nbsp;</td></tr></tbody></table></figure>', 4, 2, '2025-10-03 07:20:56.971808', '2025-10-03 07:20:56.971808', NULL);
INSERT INTO public."RegistrationSecurityTranslations" VALUES (30, 'nvestisiya qiymtli kazlarnn Azrbaycan Respublikas razisindn knarda buraxl v yerldirilmsi', '<p>nvestisiya qiymtli kazlarnn Azrbaycan Respublikas razisindn knarda buraxl v yerldirilmsi <a target="_blank" rel="noopener noreferrer" href="http://huquqiaktlar.gov.az/StatementDetails.aspx?statementId=34145">nvestisiya qiymtli kazlarnn Azrbaycan Respublikas razisindn knarda buraxl v yerldirilmsi Qaydas</a>nn tlblrin uyun olaraq hyata keirilir.<br>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Tqdim edilmli sndlr</strong></td><td><strong>Qeyd</strong></td></tr><tr><td>1. nvestisiya qiymtli kazlarnn qeydiyyata alnmas n <strong>riz</strong>;</td><td>&nbsp;</td></tr><tr><td>2. nvestisiya qiymtli kazlarnn buraxl haqqnda <strong>qrar</strong>;</td><td>Qrar Mlki Mcllnin 107-6-c maddsinin v Qiymtli kazlar bazar haqqnda Qanunun 4-c maddsinin tlblrin mvafiq qaydada trtib edilmlidir.</td></tr><tr><td>3. Emitentin hquqi xs kimi dvlt qeydiyyatna alnmas haqqnda hadtnamnin v nizamnamsinin <strong>notariat qaydasnda</strong> v ya "nzibati icraat haqqnda" Azrbaycan Respublikasnn Qanununun 9-cu maddsind myyn edilmi qaydada tsdiq edilmi surtlri;</td><td>&nbsp;</td></tr><tr><td>4. nvestisiya qiymtli kazlarnn emissiya prospekti (investisiya qiymtli kazlarnn emissiyas emissiya prospekti il mayit olunarsa);</td><td>nvestisiya qiymtli kazlarnn emissiya prospekti Qiymtli kazlar bazar haqqnda Qanunun 5-ci maddsinin v <a target="_blank" rel="noopener noreferrer" href="http://huquqiaktlar.gov.az/StatementDetails.aspx?statementId=34055">Emissiya prospekti v informasiya memorandumuna dair tlblr haqqnda Qaydalarn</a> tlblrin mvafiq qaydada trtib edilmlidir.</td></tr><tr><td>5. Emitent dvlt bdcsindn maliyy yardm v ya investisiya ynml txsisat alan, habel, dvlt zmanti il alnm borc da daxil olmaqla, dvlt bdcsi qarsnda hdliyi olduqda xarici borclanmaa Azrbaycan Respublikasnn Maliyy Nazirliyinin razl.</td><td>&nbsp;</td></tr></tbody></table></figure>', 7, 1, '2025-10-09 07:44:01.994314', '2025-10-09 07:44:01.994314', NULL);
INSERT INTO public."RegistrationSecurityTranslations" VALUES (22, 'Shmlrin birldirilmsi, xrdalanmas v onlarn nominal dyrinin artrlmas zaman shmlrin emissiyas', '<p>Shmlrin birldirilmsi, xrdalanmas v onalarn nominal dyrinin artrlmas zaman shmlrin emissiyas <a target="_blank" rel="noopener noreferrer" href="http://huquqiaktlar.gov.az/StatementDetails.aspx?statementId=34226">Shmlrin birldirilmsi, xrdalanmas v onlarn nominal dyrinin artrlmas zaman shmlrin emissiyas haqqnda Qaydalar</a>n tlblrin uyun hyata keirilir.</p><p>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Tqdim edilmli sndlr&nbsp;</strong></td><td><strong>Qeyd</strong></td></tr><tr><td>1. Shmlrin buraxlnn dvlt qeydiyyatna alnmas n <strong>riz</strong>;</td><td>riz Shmlrin birldirilmsi, xrdalanmas v onlarn nominal dyrinin artrlmas zaman shmlrin emissiyas haqqnda Qaydalarn 1 sayl lavsin uyun olaraq trtib edilmlidir.</td></tr><tr><td>2. Shmlrin buraxl haqqnda <strong>qrar</strong>;</td><td>Qrar Mlki Mcllnin 107-6-c maddsinin v Shmlrin birldirilmsi, xrdalanmas v onlarn nominal dyrinin artrlmas zaman shmlrin emissiyas haqqnda Qaydalarn 2.2-ci bndinin tlblrin mvafiq qaydada trtib edilmlidir.</td></tr><tr><td>3. Emitentin hquqi xs kimi dvlt qeydiyyatna alnmas haqqnda hadtnamnin v nizamnamsinin <strong>notariat</strong> <strong>qaydasnda</strong> v ya "nzibati icraat haqqnda" Azrbaycan Respublikas Qanununun 9-cu maddsind myyn edilmi qaydada tsdiq edilmi surtlri;</td><td>&nbsp;</td></tr><tr><td>4.&nbsp;<strong>Shmlrin nominal dyrinin bldrlmmi mnftin hesabna artrlmas zaman</strong>  baa atm son maliyy ili zr emitentin maliyy hesabatlar v onlarn yoxlanlmas haqqnda auditor ryinin surtini v son rb zr trtib edilmi, emitentin nizamnamsi il myyn ediln xslr trfindn tsdiq edilmi maliyy hesabatlar;</td><td>&nbsp;</td></tr><tr><td>5. <strong>Shmlrin nominal dyrinin azaldlmas zaman</strong> - emitentin nizamnam kapitalnn azaldlmas haqqnda onun kreditorlarna bildirilrin gndrilmsini tsdiq edn snd;</td><td>&nbsp;</td></tr><tr><td>6. <strong>Shmlrin birldirilmsi v xrdalanmas zaman</strong> - birldiriln v ya xrdalanan shmlrin mlkiyytilrinin say v onlarn hr birin mxsus shmlrin say gstriln siyah.</td><td>&nbsp;</td></tr></tbody></table></figure>', 5, 1, '2025-10-03 07:24:20.281669', '2025-10-03 07:24:20.281669', NULL);
INSERT INTO public."RegistrationSecurityTranslations" VALUES (23, 'Issuance of shares during merger, split and increase of their nominal value', '<p>Shares are issued during merger, split and increase of their nominal value in accordance with the requirements of the <a target="_blank" rel="noopener noreferrer" href="http://huquqiaktlar.gov.az/StatementDetails.aspx?statementId=34226">Regulations on issuance of shares during merger, split and increase of their nominal value</a>.<br>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Deliverables</strong></td><td><strong>Note</strong></td></tr><tr><td>1.&nbsp;<strong>Application</strong> on state registration of issuance of shares;</td><td>The application should be developed in accordance with Annex 1 to the Regulations on issuance of shares during merger, split and increase of their nominal value.</td></tr><tr><td>2. <strong>Decision</strong> per issue of securities;</td><td>The decision should be developed in accordance with the requirements of Article 107-6 of the Civil Code and Item 2.2. of the Regulations on issuance of shares during merger, split and increase of their nominal value.</td></tr><tr><td>3.&nbsp;<strong>Notarized copies</strong> of the issuer''s state registration as a legal entity and charter or copies approved in accordance with Article 9 of the Law of the Republic of Azerbaijan on Administrative Proceedings;</td><td>&nbsp;</td></tr><tr><td>4.&nbsp;<strong>When the nominal value of shares is increased at the expense of retained earnings</strong>  issuer''s audited financial statements for the recent financial year ended and a copy of auditor review and financial statements developed on the recent quarter and signed by the persons designated by the charter of the issuer;</td><td>&nbsp;</td></tr><tr><td>5. <strong>When the nominal value of shares is decreased </strong> a copy of the document confirming issuer''s sending notifications to its creditors on reduction of authorized capital;</td><td>&nbsp;</td></tr><tr><td>6.<strong>&nbsp;When shares are merged and split</strong>  a list of the number of owners of shares merged or split and the number of shares per owner.</td><td>&nbsp;</td></tr></tbody></table></figure>', 5, 2, '2025-10-03 07:24:20.281671', '2025-10-03 07:24:20.281671', NULL);
INSERT INTO public."RegistrationSecurityTranslations" VALUES (24, 'nvestisiya qiymtli kazlarnn dvriyydn xarlmas', '<figure class="table"><table><tbody><tr><td><strong>Tqdim edilmli sndlr</strong></td><td><strong>Qeyd</strong></td></tr><tr><td><strong>1. nvestisiya qiymtli kazlarn dvriyydn xarlmas n qiymtli kazlarn dvlt reyestrind mvafiq qeydlrin edilmsi:</strong></td><td>&nbsp;</td></tr><tr><td>1.1. Qiymtli kazlarn dvriyydn xarlmas v lv edilmsi haqqnda <strong>qrarn</strong> qbul edilmsi;</td><td>Qrar Mlki Mcllnin 107-6-c maddsinin tlblrin mvafiq qaydada trtib edilmlidir.</td></tr><tr><td>1.2. Qiymtli kazlarn dvlt reyestrind mvafiq qeydlrin edilmsi n (qrarn surti lav olunmaqla) <strong>mracit mktubu</strong>;</td><td>&nbsp;</td></tr><tr><td>1.3. Shmdarlarn mumi yncann keirilmsi bard <strong>ktlvi informasiya vasitlrind verilmi elan</strong>;</td><td>Bu bndd tlb olunan sndl bal Mlki Mcllnin 107-1-ci maddsind gstriln mddt v rtlr riayt edilmlidir.</td></tr><tr><td>1.4. Shmdarlarn mumi yncann arlmas bard bildirilrin shmdarlara gndrilmsini <strong>tsdiq edn snd</strong>;</td><td>Bu bndd tlb olunan sndl bal Mlki Mcllnin 107-1-ci maddsind gstriln mddt v rtlr riayt edilmlidir.</td></tr><tr><td>1.5. Milli Depozit Mrkzi trfindn verilmi <strong>qiymtli kaz mlkiyytilri bard mlumat</strong>.</td><td>&nbsp;</td></tr><tr><td><strong>2. Qiymtli kazlarn dvlt reyestrind investisiya qiymtli kazlarnn dvriyydn xarlmas bard qeydlrin edilmsi:</strong></td><td>&nbsp;</td></tr><tr><td>2.1. Geri satn alnm qiymtli kazlarn hrkti bard Milli Depozit Mrkzi trfindn verilmi <strong>aray</strong>;</td><td>Aray Milli Depozit Mrkzi trfindn Mrkzi Banka tqdim edilir.</td></tr><tr><td>2.2. Qiymtli kazlarn geri satn alnmasnn nticlri haqqnda <strong>mlumat</strong>.</td><td>Mlumat nvestisiya qiymtli kazlarnn dvriyydn xarlmas v lv edilmsi Qaydalarnn 2.16-c bndinin tlblrin mvafiq qaydada emitent trfindn trtib edilrk Mrkzi Banka tqdim edilir.</td></tr></tbody></table></figure>', 6, 1, '2025-10-09 07:29:05.696765', '2025-10-09 07:29:05.696765', NULL);
INSERT INTO public."RegistrationSecurityTranslations" VALUES (25, 'Withdrawal of investment securities from circulation', '<figure class="table"><table><tbody><tr><td><strong>Deliverables</strong></td><td><strong>Note</strong></td></tr><tr><td><strong>1.&nbsp;Making relevant notes in the state register of securities for withdrawal of investment securities from circulation:</strong></td><td>&nbsp;</td></tr><tr><td>1.1.&nbsp;A <strong>decision</strong> is taken to withdraw investment securities from circulation and liquidate them;&nbsp;</td><td>The decision should be adopted in accordance with the requirements of Article 107-6 of the Civil Code.</td></tr><tr><td>1.2.&nbsp;<strong>Request letter</strong> to make relevant notes in the state register of securities (attaching a copy of the decision);</td><td>&nbsp;</td></tr><tr><td>1.3.&nbsp;<strong>Announcement made in mass media</strong> on convening a general meeting of shareholders;</td><td>The timeframe and conditions specified in Article 107-1 of the Civil Code should be observed with respect to the document required in this item.</td></tr><tr><td>1.4.&nbsp;<strong>Document confirming</strong> that notifications on convening the general meeting of shareholders have been sent to shareholders;</td><td>The timeframe and conditions specified in Article 107-1 of the Civil Code should be observed with respect to the document required in this item.</td></tr><tr><td>1.5.&nbsp;<strong>Information released</strong> by the National Depository Center on owners of securities as of the date of the general meeting of shareholders.</td><td>&nbsp;</td></tr><tr><td><strong>2.&nbsp;Making relevant notes in the state register of securities on withdrawal of investment securities from circulation:</strong></td><td>&nbsp;</td></tr><tr><td>2.1.&nbsp;<strong>Statement</strong> by the National Depository Center on movement of repurchased securities;</td><td>The statement is submitted by the National Depository Center to the Central Bank.</td></tr><tr><td>2.2.&nbsp;<strong>Information</strong> on results repurchase of securities.</td><td>The information is developed and delivered to the Central Bank by the issuer in accordance with the requirements of Item 2.16 of the Regulations on withdrawal of investment securities from circulation and their liquidation.</td></tr></tbody></table></figure>', 6, 2, '2025-10-09 07:29:05.696814', '2025-10-09 07:29:05.696814', NULL);
INSERT INTO public."RegistrationSecurityTranslations" VALUES (28, 'Emissiya prospektind v buraxlla bal qrara lav v dyiikliklrin edilmsi', '<p><strong>Emissiya prospektind v ya informasiya memorandumunda dyiikliklr edilmsi</strong> <a target="_blank" rel="noopener noreferrer" href="http://e-qanun.az/framework/30333">Qiymtli kazlar bazar haqqnda</a> Azrbaycan Respublikasnn Qanununun 10-cu maddsin uyun olaraq hyata keirilir.<br>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Tqdim edilmli sndlr</strong></td><td><strong>Qeyd</strong></td></tr><tr><td>1. riz;</td><td>riz mvafiq qrarn qbul edildiyi gndn <strong>be i gn</strong> rzind Mrkzi Banka tqdim edilmlidir.</td></tr><tr><td>2. Dyiikliklrin qbul edilmsi bard qrar;</td><td>Emissiya prospektind dyiikliklr bard qrar emitentin investisiya qiymtli kazlarnn emissiyas haqqnda qrar qbul etmi orqan qbul etmlidir.</td></tr><tr><td>3. Dyiikliklrin mtni v saslandrlma.</td><td>&nbsp;</td></tr></tbody></table></figure><p>&nbsp;</p><p><strong>Buraxlla bal qrara lav v dyiikliklrin edilmsi</strong><br>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Tqdim edilmli sndlr</strong></td><td><strong>Qeyd</strong></td></tr><tr><td>1. Mracit mktubu;</td><td>&nbsp;</td></tr><tr><td>2. Dyiikliklrin qbul edilmsi bard qrar;</td><td>Qrar Mlki Mcllnin 107-6-c maddsinin tlblrin mvafiq qaydada trtib edilmlidir.</td></tr><tr><td>3. Dyiikliklrin mzmunu.</td><td>&nbsp;</td></tr></tbody></table></figure>', 8, 1, '2025-10-09 07:43:48.3967', '2025-10-09 07:43:48.3967', NULL);
INSERT INTO public."RegistrationSecurityTranslations" VALUES (29, 'Making additions and changes to emission prospectus and the decision on the issuance', '<p>Changes to the emission prospectus or information memorandum are made in accordance with Article 10 of the <a target="_blank" rel="noopener noreferrer" href="http://e-qanun.az/framework/30333">Law on the Securities Market</a>.<br>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Deliverables</strong></td><td><strong>Note</strong></td></tr><tr><td>1.&nbsp;Application;</td><td>The application should be submitted to the Central Bank within<strong> five working days</strong> after the relevant decision is taken.</td></tr><tr><td>2. Dyiikliklrin qbul edilmsi bard qrar;</td><td>The decision on changes to the emission prospectus should be taken by the body of the issuer that took a decision on the issuance of investment securities.</td></tr><tr><td>3. Dyiikliklrin mtni v saslandrlma.</td><td>&nbsp;</td></tr></tbody></table></figure><p><br><strong>Making additions and changes to the decision on issuance</strong><br>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Deliverables</strong></td><td><strong>Note</strong></td></tr><tr><td>1.&nbsp;Request letter;</td><td>&nbsp;</td></tr><tr><td>2.&nbsp;Decision on adopting changes;</td><td>The decision should be developed in accordance with the requirements of Article 107-6 of the Civil Code.</td></tr><tr><td>3.&nbsp;Content of changes</td><td>&nbsp;</td></tr></tbody></table></figure>', 8, 2, '2025-10-09 07:43:48.396702', '2025-10-09 07:43:48.396702', NULL);
INSERT INTO public."RegistrationSecurityTranslations" VALUES (31, 'Issuance and placement of investment securities outside the territory of the Republic of Azerbaijan', '<p>Investment securities are issued and placed outside the territory of the Republic of Azerbaijan in accordance with the requirements of the <a target="_blank" rel="noopener noreferrer" href="http://huquqiaktlar.gov.az/StatementDetails.aspx?statementId=34145">Regulations on issuance and placement of investment securities outside the territory of the Republic of Azerbaijan</a>.<br>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Deliverables</strong></td><td><strong>Note</strong></td></tr><tr><td>1.&nbsp;<strong>Application</strong> on registration of investment securities;</td><td>&nbsp;</td></tr><tr><td>2.&nbsp;<strong>Decision</strong> on issuance of investment securities;</td><td>The decision is developed in accordance with the requirements of Article 107-6 of the Civil Code and Article 4 of the Law of the Republic of Azerbaijan on the Securities Market.</td></tr><tr><td>3. <strong>Notarized copies</strong> of the issuer''s state registration as a legal entity and charter or copies approved in accordance with Article 9 of the Law of the Republic of Azerbaijan on Administrative Proceedings;</td><td>&nbsp;</td></tr><tr><td>4.&nbsp;<strong>Emission prospectus</strong> of investment securities (if the issuance of investment securities is accompanied with an emission prospectus);</td><td>The emission prospectus of investment securities should be developed in accordance with the requirements of Article 5 of the Law on the Securities Market and the<a target="_blank" rel="noopener noreferrer" href="http://huquqiaktlar.gov.az/StatementDetails.aspx?statementId=34055"> Regulations on the requirements on emission prospectus and information memorandum</a>.</td></tr><tr><td>5.&nbsp;Consent of the Ministry of Finance of the Republic of Azerbaijan to foreign borrowing if the issuer has obligations due to the state budget, including financial assistance or investment-oriented allocations from the state budget, as well as state-guaranteed loans.</td><td>&nbsp;</td></tr></tbody></table></figure>', 7, 2, '2025-10-09 07:44:01.994318', '2025-10-09 07:44:01.994318', NULL);
INSERT INTO public."RegistrationSecurityTranslations" VALUES (32, 'nvestisiya qiymtli kazlarnn emissiyasnn yekunlar haqqnda hesabatn tsdiq edilmsi', '<p><strong>Emissiyasnn v ya ktlvi tklifin yekunlar haqqnda hesabatn tsdiq edilmsi</strong> Qiymtli kazlar bazar haqqnda Azrbaycan Respublikasnn Qanununun 11-ci maddsinin v <a target="_blank" rel="noopener noreferrer" href="http://huquqiaktlar.gov.az/StatementDetails.aspx?statementId=34045">nvestisiya qiymtli kazlarna abun yazl v yerldirilmsi haqqnda Qaydalar</a>n 5-ci bndinin tlblrin uyun olaraq hyata keirilir.<br>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Tqdim edilmli sndlr&nbsp;</strong></td><td><strong>Qeyd</strong></td></tr><tr><td>1. Mracit mktubu;</td><td>&nbsp;</td></tr><tr><td>2. Qiymtli kazlarn emissiyasnn v ya ktlvi tklifinin yekunlar haqqnda hesabat;</td><td>Hesabat nvestisiya qiymtli kazlarna abun yazl v yerldirilmsi haqqnda Qaydalarn 1 sayl lavsin uyun olaraq trtib edilmlidir.</td></tr><tr><td>3. Yerldirilmi qiymtli kazlarn say bard Milli Depozit Mrkzi trfindn veriln aray.</td><td>&nbsp;</td></tr></tbody></table></figure><p><br><strong>Birlm, blnm, ayrlma v ya evrilm halnda qiymtli kazlar buraxl zaman qiymtli kazlarn emissiyasnn yekunlar haqqnda hesabat tsdiq edilmsi</strong> <a target="_blank" rel="noopener noreferrer" href="http://huquqiaktlar.gov.az/StatementDetails.aspx?statementId=34231">Hquqi xslrin yenidn tkili zaman investisiya qiymtli kazlarnn emissiyas v konvertasiyas Qaydas</a>nn 4-c bndinin tlblrin uyun olaraq hyata keirilir.<br>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Tqdim edilmli sndlr</strong></td><td><strong>Qeyd</strong></td></tr><tr><td>1. Mracit mktubu;</td><td>&nbsp;</td></tr><tr><td>2. Qiymtli kazlarn emissiyasnn yekunlar haqqnda hesabat;</td><td>Hesabat Hquqi xslrin yenidn tkili zaman investisiya qiymtli kazlarnn emissiyas v konvertasiyas Qaydasnn 2 sayl lavsin uyun olaraq trtib edilmlidir.</td></tr><tr><td>3. Yerldirilmi qiymtli kazlar bard Milli Depozit Mrkzi trfindn veriln aray.</td><td>&nbsp;</td></tr></tbody></table></figure><p><br><strong>Shmlrin birldirilmsi, xrdalanmas v onlarn nominal dyrinin artrlmas zaman shmlrin emissiyasnn yekunlar haqqnda hesabatn tsdiq edilmsi</strong> <a target="_blank" rel="noopener noreferrer" href="http://huquqiaktlar.gov.az/StatementDetails.aspx?statementId=34226">Shmlrin birldirilmsi, xrdalanmas v onlarn nominal dyrinin artrlmas zaman shmlrin emissiyas haqqnda Qaydalar</a>n 5-ci bndinin tlblrin uyun hyata keirilir.<br>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Tqdim edilmli sndlr</strong></td><td><strong>Qeyd</strong></td></tr><tr><td>1. riz;</td><td>riz Shmlrin birldirilmsi, xrdalanmas v onlarn nominal dyrinin artrlmas zaman shmlrin emissiyas haqqnda Qaydalarn 2 sayl lavsin uyun olaraq trtib edilmlidir.</td></tr><tr><td>2. Shmlrin emissiyasnn yekunlar haqqnda hesabat;</td><td>Hesabat Shmlrin birldirilmsi, xrdalanmas v onlarn nominal dyrinin artrlmas zaman shmlrin emissiyas haqqnda Qaydalarn 3 sayl lavsin uyun olaraq trtib edilmlidir.</td></tr><tr><td>3. Yerldirilmi qiymtli kazlar bard Milli Depozit Mrkzi trfindn veriln aray.</td><td>&nbsp;</td></tr></tbody></table></figure>', 9, 1, '2025-10-09 07:53:19.929279', '2025-10-09 07:53:19.929279', NULL);
INSERT INTO public."RegistrationSecurityTranslations" VALUES (33, 'Approval of the report on results of the issuance of investment securities', '<p><strong>The report on results of the issuance of investment securities</strong> is approved in accordance with the requirements of Article 11 of the Law of the Republic of Azerbaijan on the Securities Market and Item 5 of the <a target="_blank" rel="noopener noreferrer" href="http://huquqiaktlar.gov.az/StatementDetails.aspx?statementId=34045">Regulations on subscription to and placement of investment securities</a>.<br>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Deliverables</strong></td><td><strong>Note</strong></td></tr><tr><td>1.&nbsp;Request letter;</td><td>&nbsp;</td></tr><tr><td>2.&nbsp;Report on results of the issuance or public offering of securities;</td><td>The report should be developed in accordance with Annex 1 to the Regulations on subscription to and placement of investment securities.</td></tr><tr><td>3.&nbsp;Statement from the Natoinal Depository center on the number of placed securities.</td><td>&nbsp;</td></tr></tbody></table></figure><p><br><strong>The report on results of the issuance of investment securities in case of merger, dissolution or transformation</strong> is approved in accordance with the requirements of Item 4 of the <a target="_blank" rel="noopener noreferrer" href="http://huquqiaktlar.gov.az/StatementDetails.aspx?statementId=34231">Regulations on the issuance and conversion of investment securities during reorganization of legal entities</a>.&nbsp;<br>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Deliverables</strong></td><td><strong>Note</strong></td></tr><tr><td>1.&nbsp;Request letter;&nbsp;</td><td>&nbsp;</td></tr><tr><td>2.&nbsp;Report on results of the issuance of securities;</td><td>The report should be developed in accordance with the requirements of Annex 2 to the Regulations on the issuance and conversion of investment securities during reorganization of investment securities.</td></tr><tr><td>3. Statement from the National Depository center on placed securities.</td><td>&nbsp;</td></tr></tbody></table></figure><p><br><strong>The report on results of the issuance of shares during merger, split and incerase of nominal value of shares</strong> is approved in accordance with Item 5 of the <a target="_blank" rel="noopener noreferrer" href="http://huquqiaktlar.gov.az/StatementDetails.aspx?statementId=34226">Regulations on issuance of shares during merger, split and increase of nominal value of shares</a>.<br>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Deliverables</strong></td><td><strong>Note</strong></td></tr><tr><td>1.&nbsp;Application;</td><td>The application should be developed in accordance with Annex 2 of the Regulations on issuance of shares during merger, split and increase of nominal value of shares.</td></tr><tr><td>2.&nbsp;Report on results of the issuance of shares;</td><td>The report should be developed in accordance with Annex 3 of the Regulations on issuance of shares during merger, split and increase of nominal value of shares.</td></tr><tr><td>3.&nbsp;Statement from the Natoinal Depository Center on placed securities.</td><td>&nbsp;</td></tr></tbody></table></figure>', 9, 2, '2025-10-09 07:53:19.929281', '2025-10-09 07:53:19.929281', NULL);
INSERT INTO public."RegistrationSecurityTranslations" VALUES (36, 'nvestisiya qiymtli kazlarnn buraxlnn dvlt qeydiyyatna alnmas', '<p>nvestisiya qiymtli kazlarnn emissiyas v ktlvi tklifi <a target="_blank" rel="noopener noreferrer" href="https://e-qanun.az/framework/30333">Qiymtli kazlar bazar haqqnda Azrbaycan Respublikasnn Qanununun</a> 2-ci fsli il myyn edilmi qaydada hyata keirilir. nvestisiya qiymtli kazlarnn buraxlnn dvlt qeydiyyatna alnmas v emissiya prospektinin tsdiq edilmsi szgedn Qanunun 6-c maddsi il tnzimlnir.</p><p>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Tqdim edilmli sndlr</strong></td><td><strong>Qeyd</strong></td></tr><tr><td>1. nvestisiya qiymtli kazlarnn qeydiyyata alnmas n&nbsp;<strong>riz</strong>;</td><td>rizd qiymtli kazlar bard mlumat (nv, nominal dyri, miqdar) verilmli v riz emitentin slahiyytli vzifli xsi trfindn imzalanmal v mhrlnmlidir.</td></tr><tr><td>2. nvestisiya qiymtli kazlarnn buraxl haqqnda&nbsp;<strong>qrar</strong>;</td><td>Qrar&nbsp;<a target="_blank" rel="noopener noreferrer" href="https://e-qanun.az/framework/46944">Azrbaycan Respublikasnn Mlki Mcllsinin</a>&nbsp;(Mlki Mcll) 107-6-c maddsinin v Qiymtli kazlar bazar haqqnda Qanunun 4-c maddsinin tlblrin mvafiq qaydada trtib edilmlidir.</td></tr><tr><td>3. Emitentin hquqi xs kimi dvlt qeydiyyatna alnmas haqqnda hadtnamnin v nizamnamsinin&nbsp;<strong>notariat qaydasnda</strong>&nbsp;v ya "nzibati icraat haqqnda" Azrbaycan Respublikas Qanununun 9-cu maddsind myyn edilmi qaydada tsdiq edilmi surtlri;</td><td>&nbsp;</td></tr><tr><td>4. nvestisiya qiymtli kazlarnn&nbsp;<strong>emissiya prospekti</strong>&nbsp;(investisiya qiymtli kazlarnn emissiyas emissiya prospekti il mayit olunarsa);</td><td>nvestisiya qiymtli kazlarnn emissiya prospekti Qiymtli kazlar bazar haqqnda Qanunun 5-ci maddsinin v&nbsp;<a target="_blank" rel="noopener noreferrer" href="https://e-qanun.az/">Emissiya prospekti v informasiya memorandumuna dair tlblr haqqnda Qaydalarn</a>&nbsp;tlblrin mvafiq qaydada trtib edilmlidir.</td></tr><tr><td>5. nvestisiya qiymtli kazlarnn emissiya prospektinin tsdiq edilmsi n <strong>dvlt rsumunun</strong> dnilmsini tsdiq edn snd (investisiya qiymtli kazlarnn emissiyas emissiya prospekti il mayit olunarsa);</td><td><p>Dvlt rsumunun mbli <a target="_blank" rel="noopener noreferrer" href="http://www.e-qanun.az/framework/2860">Dvlt rsumu haqqnda Azrbaycan Respublikasnn Qanununun</a> 21.1-ci maddsin uyun olaraq myyn edilir.</p><p>Dvlt rsumunun dnilmsi n rekvizitlr:</p><p>&nbsp;</p><p><strong>Benefisiar (alan) bank</strong><br>Ad: Dvlt Xzindarl Agentliyi<br>Kodu: 210005<br>VEN: 1401555071<br>Mxbir hesab: AZ41NABZ01360100000003003944<br>S.W.I.F.T.: CTREAZ 22</p><p>&nbsp;</p><p><strong>Vsaiti alan</strong><br>Ad: qtisadiyyat Nazirliyi yannda Dvlt Vergi Xidmti Milli Glirlr Ba darsi<br>Hesab : AZ17CTRE00000000000002117131<br>VEN: 1602473621</p><p>Bdc sviyysinin kodu: 1<br>Bdc tsnifatnn kodu: 142271 (qiymtli kazlarn qeydiyyata alnmasna v dvlt reyestrin daxil edilmsin gr)</p></td></tr><tr><td>6. nvestisiya qiymtli kazlarnn sertifikatnn nmunsi (investisiya qiymtli kazlar sndli formada buraxlarsa).</td><td>&nbsp;</td></tr></tbody></table></figure>', 1, 1, '2025-11-30 14:03:55.328175', '2025-11-30 14:03:55.328175', NULL);
INSERT INTO public."RegistrationSecurityTranslations" VALUES (37, 'State registration of the issuance of investment securities', '<p>Investment securities are issued and publicly offered as per Chapter 2 of the <a target="_blank" rel="noopener noreferrer" href="http://www.e-qanun.az/framework/30333">Law of the Republic of Azerbaijan on the Securities Market</a>. State registration of investment securities and approval of emission prospectus is regulated by Article 6 of the said Law.</p><p>&nbsp;</p><figure class="table"><table><tbody><tr><td><strong>Deliverables</strong></td><td><strong>Note</strong></td></tr><tr><td>1. <strong>Application</strong> on state registration of investment securities;</td><td>The application should include information on securities (type, nominal value, quantity), be signed and stamped by an official of the issuer.</td></tr><tr><td>2.&nbsp;<strong>Decision</strong> on issuance of investment securities;</td><td>The decision should be developed in accordance with Article 107.6 the <a target="_blank" rel="noopener noreferrer" href="http://www.e-qanun.az/code/8">Civil Code of the Republic of Azerbaijan</a> and the requirements of Article 4 of the Law of the Republic of Azerbaijan on the Securities Market.</td></tr><tr><td>3.<strong>&nbsp;Notarized copies</strong> of the issuer''s state registration as a legal entity and charter or copies approved in accordance with Article 9 of the Law of the Republic of Azerbaijan on Administrative Proceedings;</td><td>&nbsp;</td></tr><tr><td>4.&nbsp;<strong>Emission prospectus</strong> of investment securities (if the issuance of investment securities is accompanied with an emission prospectus);</td><td>The emission prospectus of investment securities should be developed in accordance with the requirements of Article 5 of the Law of the Republic of Azerbaijan on the Securities Market and the <a target="_blank" rel="noopener noreferrer" href="http://huquqiaktlar.gov.az/StatementDetails.aspx?statementId=34055">Regulations on requirements on emission prospectus and information memorandum</a>.</td></tr><tr><td>5.&nbsp;Document confirming payment of <strong>state duty</strong> on approval of the emission prospectus of investment securities (if the issuance of investment securities is accompanied with an emission prospectus);</td><td><p>Amount of the state duty is set in accordance with Article 21.1 of the <a target="_blank" rel="noopener noreferrer" href="http://www.e-qanun.az/framework/2860">Law of Republic of Azerbaijan on State Duty</a>.</p><p>Requisites for payment of the state duty:</p><p>&nbsp;</p><p><strong>Beneficiary (receiving) bank</strong><br>Name: State Treasury Agency<br>Code: 210005<br>TIN: 1401555071<br>C/a: AZ41NABZ01360100000003003944<br>S.W.I.F.T.: CTREAZ 22<br>&nbsp;</p><p>&nbsp;</p><p><strong>Funds receiver</strong><br>Name: General Department of the State Tax service under the Ministry of Economy<br>A/n: AZ17CTRE00000000000002117131<br>TIN: 1602473621</p></td></tr><tr><td>6.&nbsp;Sample certificate of investment securities (if investment securities are issued as certified).</td><td>&nbsp;</td></tr></tbody></table></figure>', 1, 2, '2025-11-30 14:03:55.328177', '2025-11-30 14:03:55.328177', NULL);
