INSERT INTO public."ReviewApplicationTranslations" VALUES (3, 'Mracitlr baxlmas qaydas', 2, 1, '2025-12-02 14:00:43.673887', '2025-12-02 14:00:43.673887', NULL, 'Mrkzi Bankn sas vziflrindn biri maliyy xidmtlri istehlaklarnn v investorlarn hquqlarnn mdafisini v onlarn pozulmasnn qarsnn alnmasn tmin etmkdir. Bunun n Mrkzi Bank hquqi v fiziki xslrdn daxil olan maliyy xidmtlri istehlaklarnn v investorlarn hquqlarnn pozulmas il bal mracitlr zr aradrmalar aparr v hquq pozuntularna qar tdbirlr grr. Mrkzi Bank trfindn hmin xslrdn daxil olmu bank, bank olmayan kredit tkilatlar, sorta, qiymtli kazlar bazar, shmdar cmiyytlrind korporativ idaretm sahlri, investisiya fondlar v pot rabitsinin milli operatoruna v Mrkzi Bankn digr nzart subyektlrin aid mracitlr baxlr.');
INSERT INTO public."ReviewApplicationTranslations" VALUES (4, 'Procedure for reviewing applications', 2, 2, '2025-12-02 14:00:43.673967', '2025-12-02 14:00:43.673968', NULL, 'One of the main tasks of the Central Bank is to ensure the protection of the rights of financial services consumers and investors and the prevention of their violation. To this end, the Central Bank conducts investigations into applications received from legal entities and individuals regarding the violation of the rights of financial services consumers and investors and takes measures against violations of the law. The Central Bank considers applications received from these individuals related to banks, non-bank credit institutions, insurance, the securities market, corporate governance areas in joint-stock companies, investment funds, the national operator of postal communications and other subjects of supervision of the Central Bank.');
INSERT INTO public."ReviewApplicationTranslations" VALUES (5, 'Mracit et', 3, 1, '2025-12-02 14:02:31.147112', '2025-12-02 14:02:31.147112', NULL, 'Qeyd:Aadak formalarda Mrkzi Bankayazl mracit edbilrsiniz. Mrkzi Bankn rsmi internet shifsind onlayn mracit etmkl');
