INSERT INTO public."ShareholderCaptionTranslations" VALUES (1, '<p><strong>1. mumi mddalar</strong><br><br>1.1. Bu Tlimat fvqlad hallarda, o cmldn pandemiya raitind shmdar cmiyytinin shmdarlarnn mumi yncann (bundan sonra  mumi yncaq) onlayn keirilmsinin mmknly il laqdar Azrbaycan Respublikasnn Mrkzi Bankna (bundan sonra  Mrkzi Bank) daxil olan mracitlr nzr alnmaqla hazrlanmdr.<br>1.2. Bu Tlimat mumi yncaqlarn msafdn (onlayn) keirilmsi il bal minimum tvsiylri myyn edir.<br>1.3. Azrbaycan Republikasnn razisind faliyyt gstrn shmdar cmiyytlrin tvsiy edilir ki, Azrbaycan Respublikasnn Mlki Mcllsi, hminin Banklar haqqnda, Sorta faliyyti haqqnda, Qiymtli kazlar bazar haqqnda v s. qanunlarnn tlblrini, habel bu Tlimat nzr almaqla mumi yncaqlarn msafdn (onlayn) tkili, keirilmsi v qrarlarnn qbuluna dair daxili reqlament qbul etsinlr.<br>1.4. Bu Tlimat Azrbaycan Respublikasnn Mlki Mcllsin uyun olaraq qiyabi ssverm qaydasnda keiriln mumi yncaqlara amil edilmir.<br>1.5. Bu Tlimat nvbti v nvbdnknar mumi yncan tkili, keirilmsi, qrarlarn qbul edilmsi v nticlrinin rsmildirilmsi il bal qanunvericiliyin tlblrini istisna etmir.</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>2. mumi yncan msafdn (onlayn) keirilmsi</strong></p><p><br>2.1. mumi yncan onlayn keirilmsi nzrd tutulduqda aadak rtlrin yerin yetirilmsi tmin edilir:<br>2.1.1. mumi yncaqda shmdarlarn brabr itirak hququ tmin edilir;<br>2.1.2. mumi yncann arlmas bard shmdarlara gndriln bildirid Mlki Mcllnin 107-1.5-ci maddsind nzrd tutulmu mlumatlarla yana mumi yncan tkil edilcyi onlayn platforma (proqram) v mumi yncan video qeydiyyatnn aparlmas bard mlumat, mumi yncan onlayn keirilmsi il bal digr zruri mlumatlar, o cmldn mumi yncaa qoulma linki (bu mmkn olmadqda linkin lav olaraq gndrilmsi bard mlumat), yarana bilck texniki problemlrin qarsn almaq mqsdi il myyn olunan texniki tchizat v proqram tminatna dair tlblr, hminin platformadan istifad il bal aydn kild ifad edilmi tlimat ks olunur;<br>2.1.3. mumi yncan keirilmsindn vvl proqram tminatnn shmdarlara mumi yncan gediatn fasilsiz izlmk imkann vermsi v mumilikd platformann sazl yoxlanlr;<br>2.1.4. qiymtli kazlar ktlvi tklif sulu il yerldiriln v tnzimlnn bazarda ticart buraxlan emitentlr trfindn mumi yncan onlayn arlmas bard mlumatlar qanunvericiliy uyun olaraq Mrkzi Bankn rsmi internet shifsind yerln Mlumatlarn Elektron Aqlanmas Sistemind aqlanr;<br>2.1.5. mumi yncan gediat zaman onun fasilsiz olaraq texniki dstyi tmin edilir;<br>2.1.6. shmdarn v ya shmdar mumi yncaqda vkaltli nmayndsi vasitsi il itirak etdikd nmayndnin eynildirilmsi tmin edilir;<br>2.1.7. mumi yncan gediind shmdarlara proqram tminatnn texniki imkanlar nzr alnmaqla yazl v ya ifahi kild fikrini ifad etmk imkan tmin edilir;<br>2.1.8. mumi yncaqda ssverm sulu vvlcdn myyn olunur v shmdarlara mvafiq izah verilir. Shmdarn mumi yncan gndliyind olan msly mnasibtini dqiq v rtsiz bildirmsi (lehin, leyhin, bitrf) tmin edilir;<br>2.1.9. ssverm bir ne yolla - mumi yncan tkil edildiyi onlayn platformann texniki imkanlarna uyun olaraq hmin platforma daxilind (mxtlif reaksiya funksiyalar il, atda yazmaq v ya vvlcdn myyn edilmi digr sulla) v ya lav soru linki vasitsil tkil edil bilr;<br>2.1.10. onlayn keirilmi mumi yncan, o cmldn ssverm prosesinin video qeydiyyat aparlr v qanunvericilikl myyn edilmi qaydada arxivldirilir;<br>2.1.11. shmdarlarn mumi yncann protokolunda mumi yncan onlayn keirilmsi bard qeyd olunur.<br>2.2. mumi yncan msafdn (onlayn) keirilmsinin vvlcdn planladrlmad hallarda v ya linkin bildirid tqdim edilmsi mmkn olmadqda mvafiq olaraq bu Tlimatn 2.1-ci bndind nzrd tutulmu mlumatlarn v linkin mumi yncan keirilmsi gnn alabatan mddt qalm shmdarlara tqdim edilmsi tmin olunur.</p>', 1, 1, '2025-09-29 15:53:55.166954', '2025-09-29 15:53:55.166954', NULL);
INSERT INTO public."ShareholderCaptionTranslations" VALUES (2, '<p><strong>1. General provisions</strong></p><p><br><br>1.1. This Guideline has been developed in line of the appeals received by the Central Bank of the Republic of Azerbaijan (hereinafter - the Central Bank) in connection with the possibility of holding an online general meeting of shareholders (hereinafter - the general meeting) online in emergency cases, including the pandemic.<br>1.2. This Guideline determines minimum recommendations with respect to remote (online) general meetings.<br>1.3. Joint-stock companies functioning in the Republic of Azerbaijan are recommended to adopt internal rules on organization, holding and decision making of online general meetings taking into account the Civil Code of the Republic of Azerbaijan, as well as the requirements of the Laws of the Republic of Azerbaijan on Banks, on Insurance Activity, on the Securities Market and other laws and the present Guideline.<br>1.4. This Guideline does not apply to general meetings held by absentee balloting in accordance with the Civil Code of the Republic of Azerbaijan<br>1.5. This Guideline does not rule out the requirements of the legislation on the organization, holding, decision-making and formalization of results of regular and extraordinary general meetings.</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>2. Conducting the general meeting remotely (online)</strong></p><p><br>2.1. The following conditions should be met when the general meeting is to be held online:<br>2.1.1. the equal participation right of shareholders in the general meeting is ensured;<br>2.1.2. the notification sent to the shareholders on convening the general meeting includes information on the online platform (program), where the general meeting will be organized and video recording of the general meeting, other necessary information on the online general meeting, including the link for joining the general meeting (if not possible, information on sending the link additionally), hardware and software requirements identified to prevent possible technical problems, as well as clearly stated instructions for using the platform;<br>2.1.3. prior to the general meeting, the software that allows shareholders to continuously monitor the progress of the general meeting and general compatibility of the platform is checked;<br>2.1.4. the information on online convening of the general meeting by issuers whose securities are placed by public offering and traded in a regulated market is disclosed in the ''Electronic Data Disclosure System'' on the official website of the Central Bank in accordance with the law;<br>2.1.5. non-stop technical support is provided during the general meeting;<br>2.1.6. a shareholder or a representative, where a shareholder participates in the general meeting through his/her authorized representative, is identified;<br>2.1.7. during the general meeting, shareholders are provided with the opportunity to express their views in writing or verbally, in light of technical capabilities of the software;<br>2.1.8. the method of voting at the general meeting is determined in advance and explained to the shareholders accordingly. Accurate and unconditional expression of shareholder''s attitude to the issue on the general meeting agenda (in favor, against, neutral) is ensured;<br>2.1.9. voting can be organized in several ways - according to technical capabilities of the online platform where the general meeting is organized, within the very platform (by means of various response functions, by chat or other predefined method) or through an additional survey link;<br>2.1.10. the online general meeting, including the voting process is video recorded and archived under the legislation;<br>2.1.11. minutes of the general meeting of shareholders state that the general meeting was held online.<br>2.2. in case the online general meeting is not planned in advance or the link cannot be provided in the notification, the information provided for in Item 2.1 herein and the link is delivered to shareholders within a reasonable time prior to the general meeting day.</p>', 1, 2, '2025-09-29 15:53:55.166997', '2025-09-29 15:53:55.166997', NULL);


