INSERT INTO public."StructureCaptionTranslations" VALUES (1, '<p>Mrkzi Bankn tkilati strukturuna dar Heyti, mrkzi aparat v razi idarlri daxildir. Mrkzi Bankn mrkzi aparat daxili audit blmsindn,&nbsp;habel dar Heytinin myyn etdiyi digr struktur blmlrdn ibartdir. Mrkzi Bankn mrkzi aparatna daxil olan btn struktur blmlri&nbsp;v qurumlar dar Heyti trfindn tsdiq edilmi sasnamlr uyun olaraq faliyyt gstrir.<br>&nbsp;<br>Mrkzi Bank dar Heyti trfindn idar olunur.<br>&nbsp;<br>Azrbaycan Respublikasnn Konstitusiyasna sasn Mrkzi Bankn dar Heytinin zvlri Azrbaycan Respublikas Prezidentinin tqdimat sasnda Azrbaycan Respublikasnn Milli Mclisi trfindn, Mrkzi Bankn sdri v mavinlri is Mrkzi Bankn dar Heytinin zvlri srasndan Azrbaycan Respublikas Prezidenti trfindn vzify tyin edilirlr.<br>&nbsp;<br>Mrkzi Bankn dar Heytinin sdri Bankn icra strukturuna balq edir v dar Heytin sdrlik edir, Mrkzi Bank tmsil edir, rhbr heyt arasnda vzif blgsn aparr v Qanunun 24-c maddsin sasn dar Heytinin slahiyytin aid olmayan msllri hll edir.<br>&nbsp;<br>Mrkzi Bank lk regionlarnda z funksiyalarn yaratd razi idarlri vasitsil hyata keirir. Naxvan Muxtar Respublikas darsi daxil olmaqla hazrda lk razisind Mrkzi Bankn  razi idarsi faliyyt gstrir.</p>', 1, 1, '2025-09-19 15:37:56.09282', '2025-09-19 15:37:56.092821', NULL);
INSERT INTO public."StructureCaptionTranslations" VALUES (2, '<p>The organizational structure of the Central Bank includes the Board of Directors, the central office and regional offices. The central office of the Central Bank consists of the internal audit department, as well as other structural units determined by the Board of Directors. All structural units and institutions included in the central office of the Central Bank operate in accordance with the regulations approved by the Board of Directors.</p><p>The Central Bank is managed by the Board of Directors.</p><p>According to the Constitution of the Republic of Azerbaijan, the members of the Board of Directors of the Central Bank are appointed by the Milli Majlis of the Republic of Azerbaijan upon the recommendation of the President of the Republic of Azerbaijan, and the Chairman and Deputies of the Central Bank are appointed by the President of the Republic of Azerbaijan from among the members of the Board of Directors of the Central Bank.</p><p>The Chairman of the Board of Directors of the Central Bank heads the executive structure of the Bank and chairs the Board of Directors, represents the Central Bank, distributes duties among the management staff and resolves issues not within the authority of the Board of Directors in accordance with Article 24 of the Law.</p><p>The Central Bank carries out its functions in the regions of the country through the territorial offices it has created. Currently, three territorial offices of the Central Bank operate throughout the country, including the Office of the Nakhchivan Autonomous Republic.</p>', 1, 2, '2025-09-19 15:37:56.092858', '2025-09-19 15:37:56.092858', NULL);


