INSERT INTO public."TerritorialOfficeStatisticTranslations" VALUES (1, '2025', 'Azrbaycan Respublikasnn Mrkzi Bank trfindn vtndalarn qbul edilmsi Vtndalarn mracitlri haqqnda Azrbaycan Respublikasnn Qanununa, Azrbaycan Respublikas Prezidentinin 23 iyun 2016-c il tarixli, 950 nmrli Frman il tsdiq edilmi Dvlt v bldiyy orqanlarnda, dvlt v ya bldiyy mlkiyytind olan v ya paylarnn (shmlrinin) nzart zrfi dvlt v ya bldiyyy mxsus olan hquqi xslrd v bdc tkilatlarnda vtndalarn mracitlri il bal kargzarln aparlmas Qaydasna v Azrbaycan Respublikas Mrkzi Banknn Azrbaycan Respublikasnn Mrkzi Banknda istehlaklarn v investorlarn mracitlrin baxlmas v qbulu Qaydalarnda nzrd tutulmu qaydada hyata keirilir.', 1, 1, '2025-12-09 02:30:08.873242', '2025-12-09 02:30:08.873242', NULL);
